INSERT INTO `exhib_detail` (`exhib_no`, `exhib_name`, `place_no`, `startDate`, `endDate`, `exhib_intro`) VALUES
(1, '｜KIMU Garden | 柒木概念商店展', 451, '2018-10-06', '2018-11-11', 'The New Old 系列商品， 是三人終於釋放出身體裡的老靈魂，讓對生活的眷戀，住進家飾品的開始，從吊燈、桌燈、花器、鏡子、時鐘。除了深受設計師們喜愛，並經常成為國內外焦點，這次展售的《柒木設計》全系列品牌商品，將會有別於以往的呈現方式給你耳目一新的感覺，現場也會有柒木3位創辦人，娓娓道來產品產出的過程，希望能持續創造出更多陪伴大家享受 lifestyle 的美好物件，致力讓美感生活不再是口號。'),
(2, '曾日昇心靈藝術創作展', 450, '2018-10-25', '2018-11-21', '曾日昇畫家：「我的創作是運用心靈感受到色彩靈感，與自然揮灑創作，表現自然界的能量，進而創造出「將不可見化為可見的藝術」並且透過我的作品，它可以創造出積極、快樂、充滿生命力的環境。」\r\n\r\n主辦單位｜\r\n財團法人台北市開放空間文教基金會\r\n\r\n展演地點｜\r\n133號共創合作社南一 開放藝文空間\r\n\r\n展演時間｜\r\n2018/10/25(四) - 2018/11/21(三)'),
(3, '野地如茵 — 印花樂品牌十年展', 450, '2018-11-03', '2018-12-16', '印花樂一直以來都將台灣特色、環境保護的思維，轉化成美麗的印花圖案，製作成各式各樣布料生活用品。希望這些有故事的生活用品進到大家的生活裡，提醒大家關懷土地。\r\n \r\n三位創辦人，在大稻埕老街一間小小的店鋪開始；一路走來，儘管面對了許多創業的艱辛，但也認為這十年間的台灣，充滿創業成功的機會。\r\n\r\n11/03, 11/10, 11/17, 12/02有演講，歡迎上網查詢詳細資料！\r\n\r\n展覽日期｜\r\n2018/11/03(六)-2018/12/16 (日) \r\n \r\n開放時間｜\r\n10:00-18:00（12:00-13:00 休息）\r\n \r\n展覽地點｜\r\n南向製菸工廠一樓 藝異空間\r\n \r\n票務資訊｜\r\n免費入場|\r\n \r\n注意事項｜\r\n可以拍照、寵物請牽繩勿觸碰展品、無年齡限制'),
(4, '捷克與斯洛伐克平面設計 100 年', 450, '2018-10-16', '2019-02-04', '台灣設計館即將於10/16起展出「捷克與斯洛伐克平面設計100年」展覽，由田田圈文創龔維德與Eyes on Type張軒豪共同策展，以捷克與斯洛伐克平面設計的歷史與發展為主軸，展示兩國具代表性的平面設計師、布魯諾國際平面設計雙年展、斯洛伐克設計中心與斯洛伐克電影協會等相關海報、書籍、字體設計等作品，展現其平面設計作品多元豐富的美感思維。\r\n\r\n\r\n時間｜2018/10/16 - 2019/02/24 09:30~17:30（週一及特殊日休館）  \r\n地點｜台灣設計館06展區\r\n票價｜均一價60元  （門票價格視開放展覽區域調整，若有變動將公佈於官網\r\n導覽預約｜02-2745-8199 #355 黃小姐'),
(5, 'ETtoday壞朋友音樂節', 451, '2018-11-03', '2018-11-03', '壞朋友就是要你勸敗、勸吃、勸玩! \r\n11/3 壞朋友音樂節，相約你的壞朋友一起來釋放負能量!\r\n時尚拍照曬友情、擺脫厭世吃美食，\r\n夕陽下聽音樂看偶像、月光中享微醺邊談心，\r\n從白天到夜晚，壞朋友就是要混在一起，\r\n11/3 壞朋友音樂節 我們不見不散!\r\n\r\n活動時間：11/3(六) 11:00~19:30\r\n活動地點：華山文創園區華山劇場\r\n動亮點：巨星演唱、手作DIY、特色市集、互動拍照、闖關遊戲\r\n演出藝人：陳芳語、家家、王子、林芯儀、JR紀言愷、蔣卓嘉、錦安、熊仔、 麻吉弟弟、屁孩Ryan、韓森、A-TEAM'),
(6, 'Maker Faire Taipei 2018 台北創客嘉年華', 451, '2018-11-03', '2018-11-04', 'Maker泛指喜愛動手改變自己身邊一切的人，他們享受創作與改造的過程並樂於分享。而Maker Faire就是集結了所有年紀的科技愛好者、工藝家、教育家、修補工、業餘愛好者、工程師、科學社團、作家、藝術家、學生還有商業展示者展現、分享他們所作與所學。\r\n\r\n源於舊金山灣區，至今已超過200個國家舉辦的Maker Faire，自2013年引進台灣後，已累計超過十萬參觀人次，成為連接台灣創客教育與科技產業的最大平台。\r\n我們延續著推動創客教育的初衷，邀請勞動部及各深耕地方的教師及團隊，分享STEAM教育議題，回應各界對「108課綱」的關注。\r\n\r\n我們期許，透過一年一度的Maker Faire Taipei，吸引來自海內外不同領域的Maker齊聚台北，分享他們令人驚奇的創意作品，展現台灣創客的「自造力」。Maker Faire Taipei 不僅是全台灣最大的Maker聚集，更期許成為銜接國際能見度的關鍵盛會。\r\n\r\n日期：2018 / 11 / 02~04（11/2為記者會及專業人士日）\r\n\r\n時間：10：00~17：00\r\n\r\n地點：華山1914文化創意產業園區東二館及中四A、中四B'),
(7, '讀衣III藝術時尚跨界展', 451, '2018-10-20', '2018-11-05', '本著藉由文字藝術在台灣發揚中華文化的意念，策展人董陽孜邀集華人圈新一代才華橫溢且風格迥異的服裝設計師們參與創作，自2016年第一屆的讀衣展起，累積了諸多以文字線條為靈感的服裝設計脈絡和語境。今年，讀衣III藝術時尚跨界展將於10月20日(六)於華山1914文化創意產業園區紅磚區西一和西二館正式開展，延續一貫的跨界精神及對書法在當代藝術形貌的探討，首次以具體的「無」字為命題，提供揉合了草、行、楷、隸、篆等書體變化的字型，邀請六組參展設計師包括來自台灣的周裕穎、陳劭彥、蔡宜芬、潘貝寧，以及中國北京的李迎軍和鄒游，進行三十組作品的設計演繹，展露各人獨有的設計風格與時尚生命力。\r\n\r\n主辦單位\r\n自在工作室、團團文創\r\n活動地點\r\n華山紅磚六合院-西1棟\r\n華山紅磚六合院-西2棟');
