(10, 1, '中正運動中心', '臺北市中正區信義路1段1號', '(02)2396-3358', '1F：客服中心、兒童遊戲室、哺集乳室、棋藝閱覽室、運動用品販賣部\n\n2F：體適能中心、多功能教室\n\n3F：多功能綜合球場、舞蹈教室\n\n4F：飛輪教室\n\n5F：桌球室、舞蹈教室\n\n6F：足撞球室、撞球室、高爾夫球室、10M射擊場、社區教室、幼兒體能教室\n\n7F：羽球場\n\n9F：30M射箭場\n\nB1：游泳池服務台、Subway、機車停車區\n\nB2：溫水游泳池、烤箱、蒸氣室、水療室\n\nB3：汽車停車場', 4.2, '06:00:00', '22:00:00', 'Any'),
(11, 1, '北投運動中心', '臺北市北投區石牌路一段39巷100號', '(02)2820-2880', '1F：櫃檯、兒童遊戲室、哺集乳室\n\n2F：籃球場、桌球場、撞球場、飛輪教室、攀岩場\n\n3F：壁球場、瑜珈教室、體適能中心、棋藝閱覽室\n\n4F：武術教室、多功能綜合球場、綜合韻律教室\n\nB1：游泳池、機車停車場\n\nB2~B3：汽車停車場', 4, '06:00:00', '22:00:00', 'Any'),
(12, 1, '中山運動中心', '臺北市中山區中山北路二段44巷2號', '(02)2581-1060', '1F：休閒廣場、瑜珈教室\n\n2F：健身中心、飛輪教室、韻律教室、社區教室\n\n3F：多功能球場\n\n4F：羽球場\n\nB1：游泳池入口、機車停車場\n\nB2：游泳池\n\nB3：汽車停車場', 4, '06:00:00', '22:00:00', 'Any'),
(13, 2, '國賓大戲院', '台北市成都路88號', '(02)2361-1223', '「國賓大戲院」位於台北市西門町，堅持國際頂級聲光放映設備。\n可容納近千人的巨幕廳，是全亞洲最大Dolby® Atmos™ 杜比®全景聲電影院，全新音頻平台及立體音感，環境音場震撼清晰、無與倫比，是挑剔電影視聽極致表現的觀眾之最愛。率先引進D-BOX動感座椅，讓觀眾真正享受到置身現場的觀影娛樂。', 4.3, '09:20:00', '23:00:00', 'Any'),
(14, 2, '台北新光影城', '台北市萬華區西寧南路36號4樓', '(02)2314-6668', '台北新光影城，座落於西寧南路獅子林大樓4樓。\n影城共有三個廳；939個座位。 2015年全新改裝，放映設備標準新穎，音響採用杜比7.1聲道數位環繞系統，座椅升級為英國頂級品牌FERCO豪華座椅，久坐不累，搭配110公分間距，寬敞舒適。\n台北新光影城，以美式影城管理經營，且常舉辦影展及觀摩影片，服務廣大熱愛電影的消費者。帶給您寬敞的空間與美好的視覺饗宴。', 3.9, '09:30:00', '23:00:00', 'Any'),
(15, 2, '樂聲影城', '台北市萬華區武昌街2段85號1~5樓', '(02)2311-8628', '你知道西門町電影街的出現，是從樂聲大戲院開始的嗎？\n從1964年至2014年，樂聲影城陪伴西門町和台灣電影界走過50年的榮耀時光，下一個50年我們也將秉持著以觀眾為中心的服務態度，全力打造更親民、更高水準、更全面的觀影服務，樂聲，將是每一個人的電影院。', 4.1, '00:00:00', '23:59:59', 'Any'),
(16, 2, '台北日新威秀影城', '台北市武昌路2段87號1~2樓', '(02)2331-5256', '台北日新威秀影城數位IMAX影廳可容納五百多個座位，視覺方面配合超大弧形銀幕播放，這個巨型銀幕橫貫影廳兩側牆面，縱貫影廳地面至屋頂，完全涵蓋觀眾席及觀眾視野，並以專利技術增進放映畫質的亮度、鮮銳度與3D的景深層次；在視覺方面，無壓縮的超清晰數位音訊，即使連一根尖針落地，都能清楚呈現。不論坐在影廳內任何角落的觀眾，都能完全融入電影情境中，感受到被電影場景所包覆的震撼體驗！\n※本影城為方便消費者，亦設有無障礙空間。', 3.8, '09:30:00', '23:59:59', 'Any'),
(17, 2, 'in89豪華數位影城', '台北市武昌街2段89號', '(02)2331-5077', '五十年前，人類第一次在太空漫遊。\n五十年前，人類發射第一顆人造衛星。\n五十年前，那個美夢成真的年代，豪華大戲院誕生了。\n\n經歷了五十個年頭，我們依然屹立不搖，成為夢想的製造家。\n下一個五十年，還會有什麼等著我們去追夢呢？', 4.1, '09:00:00', '23:59:59', 'Any'),
(18, 2, '今日秀泰影城', '台北市峨嵋街52號4F、6F、8F', '(02)2381-4272', '日式極簡風格、禮賓服務員制度、10座影廳全數位化、日本進口的座椅與地毯，法國進口的廁所便器，上千萬引進最新的數位與3D放映設備。', 3.9, '09:30:00', '23:20:00', 'Any'),
(19, 2, '喜滿客絕色電影城', '台北市萬華區漢中街52號8至11樓', '(02)2381-1339', '絕色影城穩穩坐鎮在最喧囂繁華的鬧區中，只專注做好一件事：在一間電影院裡提供最多電影選擇。絕色9個放映廳是台北西區最多，廳數多意味著片型更廣泛，只要是好電影，就沒有不放映的理由，把電影的多元面貌介紹給觀眾，是絕色引以為傲的理念職志，對影癡級觀眾而言，舉辦過自家影展的絕色，絕對是嗜影人才知道的老地方。\n看電影，你會想到西門町，到了西門町，你會發現沒有比絕色更好的選擇。', 3.8, '10:00:00', '23:30:00', 'Any'),
(20, 2, '真善美戲院', '台北市萬華區漢中街116號7樓', '(02)2331-2270', '真善美劇院八十五年元月一日藝術電影院開張成立，顛覆傳統電影商業風格，開創文藝先鋒，堪稱台灣地區最早最用心經營藝文電影之首輪戲院，隨時提供給您最新、最優質的藝文電影。在西門盯最熱鬧、最多元、最多選擇的商圈中，我們堅持電影的選擇也應該如此，長期與藝文電影發行商相互合作，真善美戲院的口碑與對於藝文電影的經營已是有目共睹。\n擺脫大廳院的迷思、只看好萊塢電影的侷限，走一趟西門町，來到真善美劇院，保證你會獲得最多元、最滿足、最意想不到的享受。', 4.2, '10:00:00', '23:00:00', 'Any'),
(21, 2, '光點台北電影院', '台北市中山北路2段18號', '(02)2511-7786', '這是一家以「電影」為概念，以「生活」為主張的商店。\n\n光點生活規劃為以「電影‧音樂‧人文‧藝術‧設計」主題元素，在影院場域之內，提供觀影前後探討影人影事的空間，重情相遇豐富多元的藝術影音及設計產品，電影之內之外，與生活自然對話，結合電影的感性溫度與生活的知性層次，營造兩者密不可分的深邃魅力，品味自然展現。', 4.1, '10:00:00', '23:00:00', 'Any'),
(22, 2, '華山電影藝術館', '台北市中正區八德路一段1號 ', '(02)2394-0622', '光點華山電影館,位於華山文創園區中六館，原為酒廠再製酒包裝室，1996年由文化部規劃指導，改建為電影館，並由侯孝賢導演領軍之團隊「台灣電影文化協會」經營管理，於2012年11月正式開幕，為全國首座國家級藝術電影館。整館空間保留舊建築結構並結合新的創意元素，為老屋新力之創新展現。\n\n館內規劃專業影廳兩廳、影像穿廊視覺空間、多功能藝文廳、光點珈琲時光咖啡廳與光點生活文創商店。除不定期舉辦主題影展，各空間亦規劃電影相關講座、展演活動。期望打造舒適的映演環境，帶給觀眾不同的觀影感受。邀請大家走進心中的電影院，尋找屬於自己的電影感。', 4.4, '10:00:00', '23:00:00', 'Any'),
(23, 2, '台北京站威秀影城', '台北市大同區華陰街34號5、6樓', '(02)2552-5511', '台北京站威秀影城為威秀影城全省第八家影城，也是正式更名為威秀影城後，第一家全新開幕的影城。座落於西區最大公共交通轉運樞紐的複合式商場內。經過京站時尚廣場進入台北京站威秀影城的長型手扶梯後，就是由國內知名設計團隊打造，時尚大器的入口挑高大廳；漫步入內，設計感鏤空天花版，二側步道不但有電影相關資訊，還有錯落的小店可在買票後稍做瀏覽。\n※本影城為方便消費者，亦設有無障礙空間。', 4.1, '09:00:00', '23:59:59', 'Any'),
(24, 2, '朝代戲院', '台北市民權西路136號4樓', '(02)2557-1380', '上班太忙錯過了首輪強檔好片嗎？ 首輪秒下口碑卻爆棚的好片來不及看嗎？ 荷包緊緊但想要大螢幕環繞音響的享受嗎？\n位於捷運民權西路站的朝代戲院是您的好選擇！ 打破大家對二輪戲院的既有想像，我們整日有專門的清潔員，有超級熱情的服務人員，還有全臺北最好吃的爆米花，咖啡嚴選 CAMA 咖啡豆，A廳還有情人雅座大坐椅喲！', 4, '10:00:00', '23:00:00', 'Any'),
(25, 2, '百老匯數位影城', '台北市文山區羅斯福路四段200號3、4、5樓', '(02)8663-6128', '★ Dolby7.1 聲道\n★ 影城全享均一價\n★ 商務廳配備沙發座椅，並於第一排安排了電動座椅\n\n百老匯影城於2016年底重新裝修，目前擁有11個放映廳，11個放映廳全部升級 Dolby7.1 聲道，1.2.5.7.10.11廳升級為商務廳配備沙發座椅，並於第一排安排了電動座椅，影城全享均一價，觀賞商務廳不須加價。\n11個放映廳精選首輪商業及藝術電影，歡迎您來體驗。', 4.2, '09:30:00', '23:59:59', 'Any'),
(26, 2, '東南亞秀泰影城', '台北市羅斯福路4段136巷3號', '(02)2367-8999', '秀泰影城於104年7月接手營運近50年的原東南亞戲院，透過品牌形象、專業設備、最佳服務…等經營策略，重新改裝後更名為「東南亞秀泰影城」。整體內裝以時尚、簡單精緻風格設計，導入頂級放映設備、舒適的商務艙座椅，於公館商圈打造5星級精品影城，讓看電影除了是生活休閒之外，更是另一種奢華享受！', 4, '09:30:00', '23:59:59', 'Any'),
(27, 2, '湳山戲院', '台北市通化街24巷1號', '(02)2702-3130', '在台北市區的二輪電影院，而且中間還可以手上蓋個印章出來，吃個東西再回去看，非常人性化，可以出來走走再看下一部很貼心。每個星期六會換新片，星期六去看的話要記得查詢最新時刻喔！', 4.4, '09:30:00', '23:59:59', 'Any'),
(28, 2, '梅花數位影院', '台北市和平東路三段63號2樓', '(02)2732-6968', '梅花數位影院於1979年底落成，位於敦化南路和和平東路交口，早期以演出台灣新生代的導演如「兒子的大玩偶」、「光陰的故事」就是梅花數位影院做主要播映的台灣新電影。   由於戲院市場競爭激烈，梅花數位影院在長期無法達到損益兩平的情況下，在2007年9月7日宣布暫停營業。 2010年在中影公司董事長郭台強支持電影藝術的大力推行下，梅花數位影院斥資三千萬全新打造文創數位影院，並且創造文創展覽空間，為大台北人生活增添藝文色彩。', 4.1, '10:00:00', '23:30:00', 'Any'),
(29, 2, '總督影城', '台北市松山區長安東路2段219號3、4樓', '(02)2741-5991', '• 「總督數位影城」設有兩個國際水準的觀影廳，共有808席搭配全新原裝進口日本知名品牌 Kotobuki 高級座椅，流線人體工學設計，寬敞舒適的座墊及椅背，並有貼心的置杯架。 • 採用日本專業 Tokiwa 高級放映系統及比利時 Barco DP-2000 數位放映系統，搭配最新式杜比 Dolby SRD-EX 7.1 數位環繞音響，以及世界知名 Harkness Hall 超寬弧形透聲銀幕，加上絕佳音場環境設計，提供每一位消費者最奢華的視覺饗宴。 • 引進加拿大高速溫度蒸氣噴射殺菌清潔設備，現場清洗 DOLBY 3D數位眼鏡', 4.3, '10:00:00', '23:00:00', 'Any'),
(30, 2, '喜滿客京華影城', '台北市松山區八德路4段138號B1、B2、B3', '(02)3762-2001', '喜滿客京華影城為全球知名「Cinemark International L.L.C」與威京集團在台合資設立的第一個據點。 Cinemark創立於1984年，總部設在美國德州達拉斯，是擁有最多海外營業據點的美國電影院連鎖業者，且遍佈北美、中南美、歐洲、亞洲等十七個國家。Cinemark是全球複合式影城的領導品牌之一，主要訴求為『The Best Seat In Town』（我們賣的不只是電影，更是享受）。', 3.9, '10:00:00', '23:59:59', 'Any'),
(31, 2, '新民生戲院', '台北市松山區民生東路五段190號3樓', '(02)2765-3373', '新民生戲院於2012年4月25日重新開幕，我們想擁有的不僅是回憶，是想繼續創造感動的時刻。 深耕社區，放映感動，是新民生戲院秉持的核心理念。 如果您喜歡綠蔭與文化，可以走進民生社區。 如果您喜歡電影，歡迎來到新民生戲院。', 4.2, '12:00:00', '23:00:00', 'Any'),
(32, 2, '國賓影城@台北長春廣場', '台北市中山區長春路172號2F、3F、B1，176號2F、3F、B2、B3', '(02)2515-5757', '「國賓影城@台北長春廣場」地處台北商業辦公中心，有便捷的大眾交通運輸及充裕的停車位。 北市首座同時映演商業鉅片與藝術影片的時尚影城，滿足各類型觀眾豐富多樣的觀影選擇，挑高明亮的藝術空間定期舉辦藝文講座，驚艷視覺饗宴、豐厚人文精神的新地標。', 4, '10:30:00', '23:00:00', 'Any'),
(33, 2, '欣欣晶華戲院', '台北市中山區林森北路247號3、4、5樓', '(02)2537-1889', '全台首座精品影城。14座影廳全數位化、杜比3D放映、新一代QSC擴大機及JBL環繞喇叭、 1：2.3黃金比例影廳，觀賞左右視角不超過90度，上下視角不超過45度，座位間全無遮蔽。  日系雙手把設計商務艙加大座椅，日本專利加厚包覆式椅背，座位前後間距更高達122公分的寬敞空間。搭配加大落地式銀幕，不論是第一排或最後一排都是絕佳觀影座位。  影城配備部分免治馬桶，使顧客都能享受相同的品質以及如飯店般的高級設備及服務。', 4.3, '10:00:00', '23:59:59', 'Any'),
(34, 2, '國賓影城@微風廣場', '台北市松山區復興南路1段39號8、10樓', '(02)8772-1234', '「國賓影城@台北微風廣場」地處台北東區時尚中心，有便捷的大眾交通運輸及充裕的停車位。 北市首座結合購物中心的精緻都會型影城。高達八米的寬敞挑高與明亮清爽的大型落地玻璃帷幕，烘托出非凡的氣勢，開闊的視野可遠眺台北繁華熱鬧的景色。 影廳舒適的觀影空間，全數位化的鮮豔成像、配備D-BOX炫耀4D動感座椅以及全廳院杜比環繞7.1聲道。業界尖端的觀影設備以及優質的貼心服務帶給您最奢華的電影感受。', 4, '10:00:00', '23:00:00', 'Any'),
(35, 2, '台北威斯汀六福皇宮大千電影院', '台北市南京東路3段133號地下2樓', '(02)8770-6565', '坐擁 獨立雙人舒適豪華沙發座椅 品味 主廚團隊現做的精緻輕食料理 貴賓 尊享免費停車  體驗富麗堂皇的電影視覺享受  電影場次表 （星期一公休）                                                      星期二 : 13:30、16:00、19:30                                                     星期三 : 13:30、16:00、19:30                                                     星期四 : 13:30、16:00、19:30                                                     星期五 : 13:30、16:00、19:30、22:00                                                     星期六 : 11:00、13:30、16:00、19:30、22:00                                                     星期日 : 11:00、13:30、16:00、19:30                                                                            電影票價   全票400元  當日於餐廳用餐與房客  特惠票價360元 中信六福聯名卡友 及 Westin Club六福尊榮卡會員  特惠票價360元   * 接受兩星期內網路訂位 * 電話僅接受當天訂位   *凡持大千電影院票根乙張，至B1絲路宴餐廳用餐(限午/晚餐時刻)，即可享NT$1,100(net)/人 吃到飽優惠!', 4.2, '12:00:00', '22:00:00', 'Any'),
(36, 2, '美麗華大直影城', '台北市敬業3路22號6樓', '(02)8502-2208', '『美麗華大直影城不但能夠提供觀眾一種超動感的視聽震撼，更應該企圖謀合空間氛圍，為國人營造一種獨具的感官經驗』， 影城整體意象擬定當代都市歌劇之成熟品味，以貴氣的紅色與藍色系作為主軸，再以簡潔的設計感發展都市質感。 同時，為了強調主體歡樂與活潑的娛樂個性，空間上亦選擇強烈的紅、藍色系作為導入與吸引元素， 觀眾透過五層全面以米白為基調的商場中庭，即可看見中庭頂端鮮紅、鮮藍色彩所產生的形體圖騰， 透過此種建築與空間雕塑而形成的圖騰，強烈宣告影城入口的意念。  美麗華大直影城除了可容納404人之龐大的IMAX 3D影廳之外， 尚有九座標準影廳可欣賞2D影片及數位3D電影，觀眾可自由彈性的在偌大的等候區挑選喜好影片。 為避免了大部分影廳在視覺上的缺失，每一位觀眾經由精心設計的座位高度，均可輕鬆無阻礙地欣賞影片的完整過程。 影廳以整室全紅的色彩－滿鋪厚重的紅色高級羊毛地毯，以及舒適寬敞的紅色絨布座椅，不但提高了空間視覺上的豐富感，亦兼顧了吸音的效用。', 4.3, '10:00:00', '23:40:00', 'Any'),
(37, 2, '哈拉影城', '台北市內湖區康寧路3段72號2樓之1、之2、3樓之1、之2', '(02)2632-2693', '全影城共有8個影廳近1千個座位，為滿足影迷舒適觀影享受，創立全台唯一跨ㄎㄚ廳。\n打造個人最佳化的觀影空間，全程跨腳享受。\n獨家專利響震椅引領影迷全新身歷其境體驗效果戲劇張力與娛樂水準昇華至最高。', 4.1, '09:30:00', '23:30:00', 'Any'),
(38, 2, '景美佳佳戲院', '台北市文山區羅斯福路六段403號4F、6F', '(02)2934-6494', '位於景美的佳佳電影院，曾經是文山區唯一的首輪電影院，但由於地處市區邊緣又是小型戲院，無法與位於西門町、信義區等鬧區的大戲院競爭，遂轉型成二輪電影院。', 4.1, '12:00:00', '22:00:00', 'Any'),
(39, 2, '華威天母影城', '台北市士林區忠誠路2段202號4~8樓', '(02)2876-3300', '華威天母影城位於忠誠路及天母東路口，佔整棟建築物的四至九樓，共有八個高級影廳，擁有約2000個座位，為客人提供最寬敞、無障礙的視廳空間享受。並為天母娛樂新地標，引進了【頂級數位3D立體設備】提供您全新的視覺新震撼，所有優質生活享受盡在華威天母影城。\n看電影時不可或缺的爆米花、熱狗、飲料等，均可於電影開場前，於各樓層販賣部選購。同時影城也提供了貼心的餐飲外送服務。', 3.9, '09:40:00', '23:59:59', 'Any'),
(40, 2, '陽明戲院', '台北市士林區文林路113號', '(02)2881-4636', '陽明戲院就是一個歷史悠久的老戲院值得回味如此而已。開業於民國38年的陽明戲院，是間不折不扣的老字號戲院，在娛樂尚未多元化的年代，看電影是最新鮮奢侈的休閒娛樂，加上周遭學校林立，也讓此處成為大學生最愛去看電影的地方，是無數青年學子談戀愛約會的場所，它也可以說是士林夜市的中心點，許多攤商都從陽明戲院開始往外擴張，曾經盛況空前。隨著城市繁華發展區域轉移，陽明戲院因設施老舊亦曾一度沒落，在有心業者經營下投入重資汰舊換新設備，顧客逐漸回流，至今仍屹立不搖。', 3.5, '10:00:00', '23:00:00', 'Any'),
(41, 2, '台北信義威秀影城', '台北市信義區松壽路18號2、3樓， 20號3樓', '(02)8780-5566', '台北信義威秀影城內有時髦前衛、聲光炫麗的裝潢，為全國第一座專門為放映電影而量身打造的建築設計，提供了由現成建築物改裝的傳統電影院無法擁有的舒適視聽空間。', 4.1, '09:30:00', '23:59:59', 'Any'),
(42, 2, '誠品電影院', '台北市信義區菸廠路80號B2', '(02)6636-5888', '以人文生活為中心，深度結合影像生活與文化創意，放眼國際與台灣，再佐以松菸特有的歷史文化及創意生活的氛圍下，讓觀影經驗無限延伸，藝文生活無限精采。', 4.5, '11:00:00', '23:00:00', 'Any'),
(43, 2, '喜樂時代影城', '台北市南港區忠孝東路7段299號11、12、13、14樓', '(02)2788-8185', '我們在亞洲的第一站，設址於交通最便捷的南港捷運四鐵共構樞紐所在地，南港CityLink購物中心，希望打造出全台灣第一座以增加幸福感為出發點的全方位概念影城。除了提供時尚、潮流、好吃、好玩、生活外，更整合高端的電影科技與多媒體智慧互動，透過360度全感官知覺的滿足，無論是一個人的旅行或是一群人的歡聚，無論單身、情侶、家庭或是好友三兩，無論上一秒的心情是晴天或是雨天，下一站的方向永遠掌握在這一秒的決定，您可以任意搭乘交通工具來到喜樂時代影城尋找屬於自我獨特的幸福快樂，我們承諾永遠提供每一位貴賓最用心、最貼心、最安心的全方位幸福體驗，下一站幸福 • 小巨幕大震撼 最幸福的優質微影廳，我們永遠在下一站等候您。', 4.1, '10:00:00', '23:30:00', 'Any'),
(44, 2, '三重天台戲院', '新北市三重區重新路二段78號4樓', '(02)2978-4614', '※電影圖書館 最多電影知識典藏\n• 天台影城首創設立電影圖書館\n• 館內陳列電影相關中英文書籍，適合各年齡層閱讀\n※美式餐飲 多樣選擇\n• 多樣化豐富餐點，國內外進口零食\n• 保證現點現做的高品質', 3.6, '09:50:00', '23:59:59', 'Any'),
(45, 2, '板橋秀泰影城', '新北市板橋區縣民大道二段3號2-4樓', '(02)2968-5588', '新北首座精品影城。全影城擁有17座全新數位影廳、DepthQR3D系統、其中Atmos廳配備杜比全景聲(DolbyRAtmos)音響系統。獨家日式商務艙雙扶手座椅、1：2.3黃金比例影廳、落地超大銀幕，全廳觀影無死角。飯店式服務：全面配備免治馬桶、獨立空氣清淨機及除濕機，使每位購票的客人都能享受相同的品質以及如飯店般的高級設備及服務。', 4.2, '10:00:00', '23:59:59', 'Any'),
(46, 2, '板橋大遠百威秀影城', '新北市板橋區新站路28號10樓', '(02)7738-6608', '板橋大遠百威秀影城是威秀影城於新北市的第一個據點。座落於新板特區板橋大遠百複合式商場內的10樓，為全數位化影城，全面採用最先進的Christie數位二代機放映系統，並且皆有數位IMAX影廳配置，影城音響系統採用全球最先進QSC四迴路音響系統，是台灣影院中極其頂尖的音響設備。', 4.2, '09:30:00', '23:59:59', 'Any'),
