(48, 2, '鴻金寶麻吉影城', '新北市新莊區民安路188巷5號4樓', '(02)2207-0222', '堅持放映精彩好片，並提供以GDC伺服器、BARCO放映系統和英國杜比3D呈現的超優質震撼數位影音，鴻金寶麻吉影城絕對是愛看電影的您最麻吉的電影夥伴！', 3.7, '09:00:00', '23:59:59', 'Any'),
(49, 2, '國賓影城@中和環球購物中心', '新北市中和區中山路3段122號4樓', '(02)2226-8088', '「國賓影城@中和環球購物中心」位於新北市中和區主要幹線中山路三段，交通便利並有充裕的停車位。 新北市中和區首座結合購物中心的豪華娛樂影城新地標！寬敞挑高的電影走廊，結合經典影片元素設計，營造出好萊塢式炫麗、繽紛、摩登的時尚影城風格。', 4.2, '10:00:00', '23:00:00', 'Any'),
(50, 2, '國賓影城@林口昕境廣場', '新北市林口區文化三路一段402巷2號4樓', '(02)2608-0011', '「國賓影城@林口昕境廣場」擁有八個國際級影廳，配備Dolby® Atmos™ 杜比®全景聲音響系統‧環境音場震撼清晰、無與倫比，感受全新立體音感。\n尊爵席配備舒適寬敞的人體工學沙發座椅，可調整為橫躺的舒適設計，貼心尊榮的禮賓服務，讓看電影不僅是單純的娛樂，更昇華為享受。', 4.3, '10:00:00', '23:00:00', 'Any'),
(51, 2, '國賓影城@新莊晶冠廣場', '新北市新莊區五工路66號3樓及4樓', '(02)8521-6517', '「國賓影城@新莊晶冠廣場」位於新北市五股區與新莊區交界，未來有雙捷運線通過，結合了餐飲、休閒娛樂等指標性購物商場。2座金鑽貴賓廳配備舒適寬敞的人體工學沙發座椅，可調整為橫躺的舒適設計，貼心尊榮的禮賓服務，讓看電影不僅是單純的娛樂，更昇華為享受。', 4.1, '10:30:00', '23:00:00', 'Any'),
