(97, 4, '新光三越台北天母店B館', '台北市士林區忠誠路二段200號', '(02)2875-6000', '新光三越台北天母店位於台北素有國際社區之稱的天母地區，因當地環境恬靜清幽又富異國文化風情，故以異國精緻休閒及全客層百貨為主要規劃方向；新光三越台北天母店結合時尚流行、生活娛樂及當地人文特色，使消費者的休閒購物生活更年輕化。 新光三越台北天母店的加入，勢必使台北顧客的消費生活帶來更完整而多樣化的選擇。新光三越台北天母店共分A、B兩館，B館為「生活娛樂」、「人文科技」的年輕化百貨，除了親切真心的服務，優質的商品更是您休閒購物的最佳選擇。\nB館1F 服務台\n◆ DM地址變更 ◆ DM地址變更 ◆ 購物及活動諮詢 ◆ 尋人播音服務 ◆ 外賓翻譯服務（英、日語） ◆ 免費停車券兌換 ◆ 顧客意見受理 ◆ 嬰兒車及輪椅租借\nB館1F\n◆ 外幣中心 ◆ 外幣兌換（美金、日幣、港幣、新加坡幣、澳洲幣、歐元） ◆ 禮券、商品禮券銷售 ◆ 兌換零錢 ◆ 換開三聯式發票 ◆ 外籍旅客退稅申請Tax Refund Shopping', 3.9, '11:00:00', '21:30:00', 'Any'),
