(99, 4, '新光三越台北信義新天地A9館', '台北市信義區松壽路9號', '(02)8780-5959', '台北信義新天地A9館位於A11館旁、威秀影城正對面，以國際精品及多國料理餐廳為主題的精緻化百貨公司，A9館將扮演高感性都市生活者及流行情報創造者的角色，B2更有法雅客，以複合式概念經營，並結合文化與3C科技，提供消費者豐富的體驗與選擇，是一時髦優質的購物天堂。\n1F 服務台\n◆ DM地址變更 ◆ 購物及活動諮詢 ◆ 尋人播音 ◆ 外賓翻譯服務（英、日語) ◆ 停車優惠兌換 ◆ 顧客意見受理 ◆ 嬰兒車歸還服務\nB1 外幣兌換中心\n◆ 禮券、商品禮券銷售 ◆ 兌換零錢 ◆ 換開三聯式發票 ◆ 外籍旅客退稅申請Tax Refund Shopping ◆ 外幣兌換（美金、澳幣、港幣、歐元、日元、人民幣）', 4.2, '11:00:00', '21:30:00', 'Any'),
(100, 4, '新光三越台北信義新天地A8館', '台北市信義區松高路12號', '(02)8780-9966', '台北信義新天地A8館位於捷運板南線出口，與A9館、A11館相比鄰，為滿足全客層消費需求的大眾化購物商場。多樣化且完整的商品規劃，滿足都會家庭的生活所需，而A8館與A11館、A9館結合成一都心型水平式購物中心，提供市民最優質的休閒購物環境。\n1F 服務台\n◆ DM地址變更 ◆ 購物及活動諮詢 ◆ 尋人播音 ◆ 外賓翻譯服務（英、日語) ◆ 停車優惠兌換 ◆ 顧客意見受理 ◆ 嬰兒車、輪椅租借\n7F 台新銀行新光三越卡友服務中心\n◆ 新光三越信用卡申請 ◆ 台新銀行信用卡掛失 ◆ 相關卡務諮詢及變更(若顧客要查詢信用卡資料，須親自臨櫃且攜帶身分證)', 4.2, '11:00:00', '21:30:00', 'Any'),
(101, 4, '新光三越台北信義新天地A4館', '台北市信義區松高路19號', '(02)8789-5599', '將個人優質生活作為購物規劃的主旨，再將身心靈衍生出來的人類五覺的需求，融合而提供食、衣、住、行、育、樂各種商品的購物環境，1F有CHANEL、Dior、GUCCI等時尚大店，本館為精品大道的起點，引領時尚名媛進入體驗精緻生活的新天地，品牌形象及全系列商品的完全展現，並且以天橋與其他A8館、A9館、A11館相互連結，提供您舒適的購物新體驗，完美新優質生活！\n3F 貴賓中心\n◆ 禮券、商品禮券銷售 ◆ 兌換零錢 ◆ 換開三聯式發票 ◆ 外籍旅客退稅申請Tax Refund Shopping ◆ 外幣兌換（美金、澳幣、港幣、歐元、日元、人民幣) ◆ 外賓翻譯服務（英、日語) ◆ 貴賓卡申辦 ◆ DM地址變更 ◆ 購物及活動諮詢 ◆ 尋人播音 ◆ 停車優惠兌換 ◆ 顧客意見受理\nB2 超市寄物台\n◆ 寄物服務 ◆ DM地址變更 ◆ 購物及活動諮詢 ◆ 尋人播音 ◆ 外賓翻譯服務（英、日語) ◆ 停車優惠兌換 ◆ 顧客意見受理', 4.1, '11:00:00', '21:30:00', 'Any'),
(102, 4, '環球南港車站店', '台北市南港區忠孝東路七段371號', '(02)2789-3289', '於2016年7月開幕，是Global Mall全臺第7家開幕店，也是全台第三家位於車站內開設的百貨商場，是Global Mall與台鐵合作的車站型商場。營業樓層：地下一樓夾層～地下二樓。由於位於南港車站大樓內，位處高鐵、台鐵及捷運要衝，因此擁有大面積之外食區，除一般購物外，並提供租車等便捷服務，深獲旅客及在地居民的好評。Global Mall一直秉持著「顧客至上‧服務‧創新‧效率」的經營理念，不斷地提升服務品質，期許每位員工及專門店服務人員，都能以熱情真誠的態度，服務每一位顧客，讓每位顧客體驗、感受到我們的用心，快樂地在Global Mall度過每一刻！！', 4, '11:00:00', '22:00:00', 'Any'),
(103, 4, '環球新北中和店', '新北市中和區中山路三段122號', '(02)7731-7999', '於2005年12月開幕，是Global Mall第1家開幕店，也是日本永旺購物中心技術輸出的第一個海外據點。電影院由國賓影城進駐。由於位於新北市中和區中心內，周邊社區住宅眾多，並兼具娛樂、休閒、親子、購物、美食、健身等功能，因此成為當地居民的購物首選，並成為顯著地標，深獲在地居民的好評。Global Mall從2001年11月成立以來，一直秉持著「顧客至上‧服務‧創新‧效率」的經營理念，不斷地提升服務品質，期許每位員工及專門店服務人員，都能以熱情真誠的態度，服務每一位顧客，讓每位顧客體驗、感受到我們的用心，快樂地在Global Mall度過每一刻！！', 4.2, '11:00:00', '22:00:00', 'Any'),
(104, 4, '環球板橋車站店', '新北市板橋區縣民大道二段', '(02)8969-9888', '於2010年4月開幕，是繼Global Mall新北中和後第2家開幕店，也是全台第二家位於車站內開設的百貨商場，是Global Mall首次與台鐵合作的車站型商場。營業樓層：地上二層～地下一層；營業面積6000多坪。由於位於板橋車站大樓內，為處高鐵、台鐵及捷運要衝，提供往來旅客與在地居民購物便捷服務，深獲旅客及在地居民的好評。Global Mall從2001年11月成立以來，一直秉持著「顧客至上‧服務‧創新‧效率」的經營理念，不斷地提升服務品質，期許每位員工及專門店服務人員，都能以熱情真誠的態度，服務每一位顧客，讓每位顧客體驗、感受到我們的用心，快樂地在Global Mall度過每一刻！！', 4, '11:00:00', '21:30:00', 'Any'),
(105, 4, '環球林口A9店', '新北市林口區文化三路一段2號', '(02)2606-9668', 'Global Mall 林口A9，位於全新啟用的機場捷運林口站，將於2017年第二季進駐開幕，成為全台第五間車站型據點，同樣擁有與捷運相連的地利之便，並串聯週邊新興商圈與住商大樓，Global Mall 林口A9將成為顧客每日生活中便利友善的最佳補給站。\n林口A9營業樓層包含1F~4F，賣場佔地面積將近1500坪，共計有39櫃位，其中40%為全台商場及新北地區獨家櫃位，以美好食光為主軸，引入多元獨家的商品，提供通勤族、週邊住戶及捷運利用者豐富需求的補給，為鄰近居民與流動商辦人士帶來新的服務與享受。Global Mall從2001年11月成立以來，一直秉持著「顧客至上‧服務‧創新‧效率」的經營理念，不斷地提升服務品質，期許每位員工及專門店服務人員，都能以熱情真誠的態度，服務每一位顧客，讓每位顧客體驗、感受到我們的用心，快樂地在Global Mall度過每一刻！！', 4, '11:00:00', '22:00:00', 'Any'),
(106, 4, '統一時代百貨', '台北市信義區忠孝東路五段8號', '(02)2729-9699', '由統一集團百分之百轉投資的「統一阪急台北店」於2010年10月開幕誕生，並自2016年3月起更名為「統一時代台北店」，運用集團行銷資源整合及零售業經驗結合，全力拓展美麗事業，帶給消費者全方位美的體驗。座落於台北市信義商圈的黃金三角樞紐位置：忠孝東路及基隆路口的市府轉運站，有效結合捷運、巴士轉運站及國際級飯店，從地下2樓到7樓營業面積約8,000坪，其中地下2樓賣場與市府捷運站相通，1樓則緊鄰巴士轉運站，8樓到31樓是全球頂級設計飯店W Hotel。', 4.1, '11:00:00', '21:30:00', 'Any'),
(107, 4, '明曜百貨', '台北市大安區忠孝東路四段200號', '(02)2777-1266', '明曜百貨秉持著「貼近顧客需求，實現購物新樂趣」的經營理念，致力為每位來店的顧客提供更優質的購物空間與貼心服務。\n2011年，春天，明曜百貨全面封館進行長達7個月的改裝，同年秋天，全新的明曜百貨終於在各界引頸期盼中亮麗的登場了，嶄新的明曜百貨在商品組合、館內裝潢與大樓外觀上均有大幅度的改變！希望您會喜歡明曜百貨的改變！期望為您帶來更多愉快的購物體驗，並創造您專屬的簡單時尚生活！', 3.9, '11:00:00', '21:30:00', 'Any'),
(108, 4, '大葉高島屋', '台北市士林區忠誠路二段55號', '(02)2831-2345', '以郊區型新優樂生活百貨公司為目標，提供消費者舒適、悠閒、寬敞的購物空間與最佳服務給顧客。', 4.1, '11:00:00', '21:30:00', 'Any'),
(109, 4, '大都會廣場', '新北市淡水區中山路8號', '(02)2623-9501', '大都會廣場是一間位於臺灣新北市淡水區的百貨商場，營業樓層為地下第一層至地上十一層，營業面積約為3000坪，其前身為名統百貨。', 3.6, '11:00:00', '22:00:00', 'Any'),
(110, 4, '麗寶百貨廣場', '新北市板橋區縣民大道二段3號', '(02)8969-9566', 'HiMall位於板橋車站、捷運、高鐵板橋站三鐵共構新金脈，商圈商機無限。\n麗寶百貨廣場鄰新板誠品、環球購物中心與大遠百商圈的人潮區域，透過空橋連結形成暢行無阻的環狀購物休閒園地。\n麗寶的營運宗旨是要讓每位進店的顧客都能「看得喜歡買得起」，用心成就「讓消費也能成為一種享受！」的幸福目標，結合購物、娛樂、影城、餐飲四大元素，延攬年輕活力之潮牌及符合親子育樂的活動空間進駐，滿足時下年輕人與親子客群對時尚生活、休閒育樂的追求!! ', 3.6, '11:00:00', '22:00:00', 'Any'),
(111, 4, '瀚星百貨', '台北市文山區景興路188號', '(02)8931-1788', 'ÉDORA PARK 品味　創意　新趣處\n瀚星百貨 永遠和你心連心', 3.7, '11:00:00', '21:30:00', 'Any'),
(112, 4, '比漾廣場', '新北市永和區中山路一段238號', '(02)8231-5555', '比漾廣場  人文 經典 好生活\n比漾廣場位於新北市永和區，2014年6月開幕，來到比漾，除了擁有UNIQLO、無印良品、誠品書店等品牌大店，能夠讓您買到滿足生活所需的豐富商品外，館內8家主題餐廳，更是您與朋友家人歡聚的好處所！\n不定時推出的藝文展演活動； 持續引進與流行同步的話題商品 讓您用更簡單的方式，享受更豐富精采的生活\nAn easy way to live in a better life.', 3.9, '11:00:00', '21:30:00', 'Any'),
(113, 4, '欣欣百貨', '台北市中山區林森北路247號', '(02)2521-2211', '全新的欣欣百貨，B1F保留了美食街和全新高檔的Jasons Market place 超市，1-2F進駐了兩層的Uniqlo日系時裝店和美式TGI Friday餐廳，還有數間女性時裝和配件店和兩間餐廳。3-5F是共14廳的欣欣秀泰影城。欣欣百貨雖然面積不大，但可以在同一楝百貨完成購物、吃飯和看電影也是一個不錯的選擇。', 3.8, '11:00:00', '22:00:00', 'Any'),
(114, 4, '美麗華百樂園', '台北市中山區敬業三路20號', '080-088-3456', '結合時尚 娛樂 影城 摩天輪的百貨商城 發現幸福浪漫的百種可能', 4.1, '11:00:00', '22:00:00', 'Any'),
(115, 4, '京站時尚廣場', '台北市大同區承德路一段1號', '(02)2182-8888', '以食的創意│裝的品味│趣的發現│遊的新奇\n包羅各式新奇潮品，全面攻佔消費者的饕癮、購慾、玩心、遊樂，中、西、日、印等多國美食大總匯，聚會約會新據點；各大知名設計品牌總集，走在流行最前端；百貨首創獨特貼心的內衣地熱區，試穿衣物超舒暖；順應潮流的室內單車道，休閒玩樂超自在；環保意識的超Q會員卡，購物享盡優惠好康；消費潮流新興份子，引爆都市生活的美學驚奇，台北上班族的下班第一站就在京站時尚廣場。', 4.1, '11:00:00', '21:30:00', 'Any'),
(116, 4, '京華城購物中心', '台北市松山區八德路四段138號', '(02)3762-1888', '京華城是一座全新的國際級都心型觀光休閒購物中心，它獨一無二的建築設計、國際水準的軟硬體規劃，儼然成為創新市場的領導者、主導新世紀消費文化的時尚重鎮。\n京華城每年可以吸引多達三千六百萬川流不息的人潮，成為國際級的重要觀光景點之一，全世界最流行、最頂級的品牌，都將在此與您相遇。最貼心完善的顧客服務設施、寬敞具設計感的購物大道、明亮舒適的購物環境、尊重人性的先進 科技、引人入勝的娛樂節目等，都將令您流連忘返。\n一次享受Fashion、Food、Life Style、Leisure and Entertainment 前所未有的Total Shopping Experience，盡情享受完美購物體驗就在京華城！', 3.8, '11:00:00', '21:30:00', 'Any'),
(117, 4, '微風廣場', '台北市松山區復興南路一段39號', '080-900-8888', '館內分為A、B兩區。A區為地上九層、地下三層的高樓建築，設有國賓影城（位於8F～9F）以及LV、GUCCI、Dior等多家服飾、精品品牌的大、小專櫃；B2亦設有兼賣進口食品，並設置熟食區與超級市場，後者包括來自法國傳統麵包的Maison Kayser與自有品牌的微風超市。2F有agnès b.旗艦店、Bose音響、寬庭美學生活館、法國百年寢具FRETTE；5F整層皆為紀伊國屋書店微風店的範圍；以生活雜貨為主的台隆手創館與無印良品也分別在6F與3F設有分店，由統一企業出資引進的日本生活雜貨及餐廳Afternoon Tea也進駐3F；UNIQLO則位於4F。\nB區為地上兩層、地下四層的「L」型建築，設有PRADA、Jimmy Choo、Burberry等國際品牌的專櫃；地下樓層皆作為汽、機車停車場使用；建築西南側的地面噴泉廣場，有時亦作為活動舉辦場地。二樓設有介紹黑松企業發展史，並以仿古方式重現1950年代老街景物的「黑松世界」展覽館。', 4.1, '11:00:00', '21:30:00', 'Any'),
(118, 4, '微風南京', '台北市松山區南京東路三段337號', '(02)2175-0999', '微風南京營業面積為5700坪，營業樓層為地上二層、地下四層，主力客層為25歲至45歲的女性族群。全館計有115個櫃位，其中有23個獨家櫃位，並首創於1F設置甜點櫃位', 3.8, '11:00:00', '21:30:00', 'Any'),
(119, 4, '微風信義', '台北市信義區忠孝東路五段68號', '(02)6636-6699', '微風信義全館設有108個專櫃，其中全臺獨家櫃位佔35％，信義區獨家櫃位佔25％，客層定位與微風廣場同為國際精品與流行時尚，特色服務為2F女廁提供廁所咖啡，讓女性能利用梳妝的時間悠閒品嘗咖啡', 4.1, '11:00:00', '21:30:00', 'Any'),
(120, 4, '微風松高', '台北市信義區松高路16號', '(02)6636-9959', '微風松高營業面積約3800坪，營業樓層為地上四層至地下兩層，其主力客層定為16歲到30歲之年輕族群。全館計有126個櫃位，並獨家引進不少國際品牌，如臺灣首間H&M、亞洲首間德州鮮切牛排Texas Roadhouse、臺灣首間日本勝勢豬排等品牌進駐', 4, '11:00:00', '21:30:00', 'Any'),
(121, 4, 'CITYLINK南港店', '台北市南港區忠孝東路七段369號', '(02)2652-9000', 'CITYLINK南港店，位於三鐵共構的南港車站，以「多元發展、接軌國際」為概念，打造多角化經營、成為國際級多元發展轉運站中心，以「Shopping Resort」為概念，提供顧客一個陽光、慢活、駐足、購物的悠雅空間，用心營造出全新型態的購物環境，提供一個集時尚流行、美食休憩、親子娛樂的空間，不但位於重要交通樞紐與國際接軌，並深入融合在地生活圈。未來CITYLINK南港店將滿足民眾生活上所需的各種活動，如交通、購物、旅行、休閒，更進一步成為運輸及當地商業活動中心。', 4.1, '11:00:00', '21:30:00', 'Any'),
(122, 4, 'CITYLINK內湖店', '台北市內湖區成功路四段188號', '(02)7709-6100', '上質生活 日常的好感覺Fresh Sense\n上質男女相當重視生活細節，使用東西時會嚴選產品的品質，而不是只衡量價格，日常生活舉凡像是衣物、鞋履、文具，到選擇美味的餐飲等等，這些看似平凡不過的日常，卻是實實在在品味的象徵。\n上質的物品就像益友，能讓自己變得更好。\n嚴選好物，過濾生活雜質，為每個日常營造好感覺。\n總能不斷帶給自己驚喜與幸福感，找到日常生活的好感覺。', 3.9, '11:00:00', '21:30:00', 'Any'),
(123, 4, 'CITYLINK松山一號店', '台北市信義區松山路11號', '(02)2528-0666', 'CITYLINK松山車站壹號店以「舊地新生、幸福啟程 」為經營理念，用心營造出貼心的購物環境，提供一個集生活便利、美食餐廳、平價流行的復古懷舊設計空間，在旅途中帶給人們感動和回憶，未來，CITYLINK將成為松山商圈新地標，經過這一站的時候，不妨停下腳步享用美食、逛街休憩。', 4, '11:00:00', '22:00:00', 'Any'),
(124, 4, 'CITYLINK松山二號店', '台北市松山區市民大道六段131號', '(02)2528-0115', '製造美好事件發生的據點  有可能是起點，但永遠不會是終點\nThe spot where a CITY LINKs to others.\n甫進入松山貳號店  即以質感生活為開端  藉由種種美好的五感體驗為出發點  嚴選把關  堅持成為美好生活原則的製造機\n在繁忙都市生活中傾聽內在的聲音  呼吸暢快的生活愉悅  用細節豐富你我未來生活的開端  周而復始 未完待續\nThe spot where a CITY LINKs to others. To be continued.', 4.2, '11:00:00', '22:00:00', 'Any'),
(125, 4, '遠企購物中心', '台北市大安區敦化南路二段203號', '(02)2378-6666', '經典時尚、知性時尚、創意時尚、仕女時尚、生活時尚、都會休閒、美食生活', 3.9, '11:00:00', '21:30:00', 'Any'),
(126, 4, 'BELLAVITA 寶麗廣塲', '台北市信義區松仁路28號', '(02)8729-2771', 'BELLAVITA寶麗廣塲的核心原點，來自創立者品嘗美食的喜好，從想開一家輕鬆無拘束的咖啡廳，發展為一時尚溫馨的bar & restaurant a³，希望能帶給來享受美食的客人同時也享受自在的氛圍。BELLAVITA寶麗廣塲擁有全台第一家米其林星級法式餐廳L’ ATELIER de Joël Robuchon及茶點沙龍SALON DE THE de Joël Robuchon，日式輕鬆懷石料理TON(同)28、HO SHABU合鍋物, 結合傳統及現代之義式餐廳Beata té等多國料理，夏威夷酒吧餐廳HALEAKALA，以及結合B2 Oyster Bar生蠔Bar、酒窖等各國風味的新型態美食天地，都將以最用心及特別的風貌，提供大家一個與親朋好友相聚的地方；加上歐、美、日經典及時尚的時裝、珠寶、飾品、水晶等；另外更特別設置藝文展覽演出空間以及廚藝空間，希望帶給消費者多樣化的飲食、悠閒購物的舒適空間，更希望孕育藝術和人文氣息。 ', 4.2, '10:30:00', '22:00:00', 'Any'),
(127, 4, 'ATT 4 FUN', '台北市信義區松壽路12號', '(02)8780-8111', '開幕至今，已成功地吸引新一代的消費者，成為信義區中最受年輕人喜愛的商場。 豐富多樣的娛樂生活與演藝活動更是哈韓哈日族追星的重要據點。 更有別於周邊傳統百貨商場的行銷方式，富有娛樂感的創意活動，深受年輕消費者的喜愛。 \n定位「新一代主題商場」的形象不但耳目一新，更成為國際旅客造訪台北市信義區繼101之後的必訪之地，晉身國際化的商場，結合的「時尚、文創、娛樂、美食」四位一體的購物新地標。 讓信義區成為全球華人時尚的文化重心。以娛樂活動帶動整體商場的人氣與買氣， 讓ATT 不只是一座商場更是一座大型的娛樂城，由內而外，都讓消費者享有獨一無二的全新購物體驗。', 4.1, '11:00:00', '22:00:00', 'Any'),
(128, 4, '台北101購物中心', '台北市信義區信義路五段7號', '(02) 8101-8800', '台北 101 MALL精選國際時尚與精緻美饌，貼心考量消費者的需求，以世界級空間設計規劃，完美凝聚質感、氛圍、與建築藝術，以有形空間開創無限意境，讓購物成為輕鬆舒適的享受台北 101 MALL將和紐約的「第五大道」、巴黎的「香榭麗舍大道」、羅馬的「西班牙大道」等高級精品區劃上等號。', 4.3, '11:00:00', '21:30:00', 'Any'),
(129, 4, '南山威力購物廣場', '新北市中和區中山路二段291號', '(02)2249-5969', '座落於新北市三條最重要的道路交叉點上(景平路、中山路、連城路)，四通八達的交通，具備優越的立地條件。「南山威力購物廣場」結合全國最具規模的大型量販主力店、健康俱樂部、名品Outlet折扣店、主題商店、休閒餐飲等，標榜「一次購足 One Stop Shopping」，並為消費者提供台灣第一座最具規模知名量販品牌結合的購物廣場。寬闊的商場購物空間、並結合餐飲休憩場所，完整呈現多元化的購物空間。館內設有室內停車位，為消費者提供舒適購物及方便的停車空間。', 3.7, '09:00:00', '23:00:00', 'Any'),
(130, 4, '三井OUTLET', '新北市林口區文化三路一段356號', '(02)2606-8666', '在充滿綠意的美麗南國，人們彷彿尋寶般發現各種驚喜；每一個瞬間都是充滿歡樂、趣味的奇妙時光。\n享受精品購物 ◆ 高品質折扣精品 ◆ 豐富的國際品牌\n滿足休閒娛樂 ◆ 書店/雜貨 ◆ 電影院 ◆ 超市 ◆ 遊戲娛樂\n營造美食天堂 ◆ 規劃四個美食區塊 ◆ 獨家引進10多家日本排隊名店', 4, '11:00:00', '21:30:00', 'Any'),
(131, 4, '昕境廣場', '新北市林口區文化三路一段402巷2號', '(02)2606-8252', '襯著爐火、原木座椅、木屋意象的煙囪與賣場空間，這是一個由品味書香、聆聽音樂、啜飲咖啡所譜寫出的人文生活…. 。\n在這裡，可以帶著漫步在樹林裡的恣意心情，從扶輪公園，踏著石材踏面，穿越挑空區的廣場，開始體驗悠閒的美好生活!\n我們希望打造的不只是一個便利的消費空間；是一個可以與你最親愛的家人享受一整天的生活廣場。一天下來，在昕境廣場所經驗的生活饗宴，可以化為夢中的星光點點，開始讓記憶收藏美好生活的點點滴滴……。\n夜晚，看完電影後，我們的建築逐漸隱退，伴隨你回家的是一條條漂浮在城市中的美麗光帶。', 4, '11:00:00', '21:30:00', 'Any'),
(132, 4, 'iFG遠雄廣場', '新北市汐止區新台五路一段93-99號', '(02)2697-3888', 'iFG遠雄廣場，新北市最大生活休閒廣場，共計200個品牌隆重登場，不僅提供一般商場有的食、衣、住之外，更以創新的經營模式、完整的滿足您7大生活需求，『衣、食、住、知、遊、健、美』，以360°全方位經營模式，提供您全新的購物新體驗。', 4, '11:00:00', '21:30:00', 'Any'),
(133, 4, 'H&M台北站前店', '台北市中正區館前路2號', '(02)7725-8866', 'H&M提供最新服飾，無論大人小孩都能找到屬於自己的時尚', 3.8, '11:00:00', '22:00:00', 'Any'),
(134, 4, 'H&M松高店', '台北市信義區松高路16號', '(02)7729-1310', 'H&M提供最新服飾，無論大人小孩都能找到屬於自己的時尚', 3.9, '11:00:00', '22:00:00', 'Any'),
(135, 4, 'H&M西門亞洲旗艦店', '台北市萬華區漢中街116號', '(02)7726-6666', 'H&M提供最新服飾，無論大人小孩都能找到屬於自己的時尚', 3.9, '10:30:00', '22:30:00', 'Any'),
(136, 5, '新北市立圖書館總館', '新北市板橋區貴興路139號', '02-2953-7868', '休館日期：每月最後一週之週四、國定假日\n週一：8:30-17:00/週二~日：8:30-21:00\n新北市立圖書館更是一棟會呼吸的綠建築，館內所有窗戶都可以打開，讓室內外空氣可以對流。六樓以上可以看到，館中央採挑空煙囪效應，能在非夏季時引進外部氣流，以節約空調。不論是空調系統節能、整體綠覆率、智慧照明系統，它符合綠建築當中八項指標，響應生態環保、低碳節能觀念，成為台灣主推鑽石級綠建築公共圖書館之一。', 4.5, '08:30:00', '21:00:00', 'Any'),
(137, 5, '新北市立圖書館(八里分館)', '新北市八里區舊城里舊城路19號5~6樓', '02-2610-3385', '休館日期：每月最後一週之週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n漂書運動隨著鐵馬漂到八里左岸，八里的民眾也把分館的範圍從館內擴展到了這片河堤的左岸公園。周末假日伴隨著陽光微風的藍天綠地中，整個左岸儼然成了八里人的圖書館。\n緣起於歐洲小鎮閱讀活動的「漂書運動」，是將貼上特定標籤的書本放在公眾場所，讓對書籍有興趣的人自由取閱與分享閱讀樂趣，書本可能是放在咖啡館的小桌子、公園的長凳上；而在八里~卻是打造了創意十足的「鐵馬漂書車」。', 4.2, '08:30:00', '21:00:00', 'Any'),
(138, 5, '新北市立圖書館(三芝分館)', '新北市三芝區淡金路1段37號', '02-2636-2331', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-19:00\n『我們跟這裡的居民都熟，雖然這不是我們的業務範圍，但大家就像家人一樣，誰今天有來，誰今天沒來，或是誰家裡發生甚麼事，其實我們都會關心。』館員表示，偏鄉圖書館最大的特色，就是人情味。', 3.6, '08:30:00', '19:00:00', 'Any'),
(139, 5, '新北市立圖書館(三重五常分館)', '新北市三重區五華街7巷30號2樓', '02-2989-0559', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n如果圖書館有個性的話，五常分館給人的感受就是【溫厚】! \n以地理位置來說，它與三重日照養護中心，為樓上樓下的好鄰居。\n以館藏特色來看，最大藏書量是中藥書籍。', 4.2, '08:30:00', '21:00:00', 'Any'),
(140, 5, '新北市立圖書館(三重田中分館)', '新北市三重區忠孝路3段40巷51號2~4樓', '02-2988-5482', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n三重田中分館隱身在三民公園內，一幢被綠色植被圍繞的老建築內。一樓是里民活動中心，二樓才是圖書館入口。開館二十多年來，它們就是這樣樓上樓下、相互依存著。對當地里民來說，來到這兒就像是回到家一樣。\n田中分館從推出【弱勢家庭陪讀計畫】後，由陪讀媽媽們，帶著孩子寫功課、看書，很多里民更發現，原來，圖書館也可以很有溫度。\n圖書館真正讓人流連忘返的，不會只有建築與書，也有那充滿人情味的小故事。', 4.4, '08:30:00', '21:00:00', 'Any'),
(141, 5, '新北市立圖書館(三重崇德分館)', '新北市三重區仁孝街62號2樓', '02-2973-6987', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n漫步在老樹茂盛、屋舍零星散布的舊街道，踏入一棟外觀不起眼的老建築，沿著一樓的窄斗樓梯上樓，是一家過路客不容易發現的圖書館，但也因此多了一種探險的感覺。這是三重地區最小的圖書館，緊鄰市場、工廠林立的住宅區裡，它用紅磚牆阻隔了外界的熙攘，也因為鬧中取靜的特質，讓附近住戶喜歡來這邊讀書，不論是二樓的書庫，還是三樓的自修室，人總是滿滿的。', 4.2, '08:30:00', '21:30:00', 'Any'),
(142, 5, '新北市立圖書館(三重分館)', '新北市三重區自強路1段158號', '02-2981-4887', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n一進門，視線最先被吸引的就是放在左側一長排的書櫃，上頭的最新書展，總教人有意外的驚喜。選好書，得找個舒適的位子，喜歡明亮開放空間，就選坐中間走道的豎背椅；想要隱密說悄悄話，可以輕步走向沙發區。原來，閱讀不只是關於書本而已，從進入圖書館到找位置坐下，也可以是一趟尋寶之旅。', 4, '08:30:00', '21:00:00', 'Any'),
(143, 5, '新北市立圖書館(三重東區分館)', '新北市三重區溪尾街303號', '02-2857-5270', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n微風吹過，圖書館旁五棵串錢柳，正以它獨特的姿態，向過路人招手。\n串錢柳是這間圖書館的地標，春秋時分，當它由綠轉紅，正是開花時節，非常美。\n『只要一抬頭，就能看見它，它是陪伴我看書的夥伴』從小就喜歡閱讀的洪先生說，這裡的設計很特別，不管是哪層樓，只要望向窗外，就能看見串錢柳。每當看書累時，抬頭一看，就能看見窗外最美的風景，紓解疲勞，串錢柳，對這裡的讀者來說，是特別的存在。', 4, '08:30:00', '21:00:00', 'Any'),
(144, 5, '新北市立圖書館(三重南區分館)', '新北市三重區重安街70號3樓', '02-2976-8729', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n『今天去圖書館買菜好嗎?』咦?這句話聽來奇怪，但對住在三重南區的居民來說，卻是一點就通。原來這裡的圖書館跟市場賣場同一棟，一樓是光明市場，二樓是福利中心，這裡最多的讀者是婆婆媽媽，逛完街買完菜，就會上來三樓圖書館看書小憩，對居民而言，到圖書館買菜，是一種生活型態。', 2.9, '08:30:00', '21:00:00', 'Any'),
(145, 5, '新北市立圖書館(三重培德分館)', '新北市三重區忠孝路2段35號2樓', '02-2984-2179', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n你有多久沒看書了呢?培德圖書館，激發大家踏進圖書館的誘因。館藏八千多冊的漫畫，打造出獨樹一幟風格的「書殿」引誘你入內動手翻書閱讀。每月新進的書多達百本，讓讀者免追書之苦，最大的好處是，可以免費看到飽！\n漫畫堆疊營造出另一個異度空間，讓人一入圖書館就猶如誤闖兒時萬花筒充滿浪漫不羈的異想天地。', 4, '08:30:00', '21:00:00', 'Any'),
(146, 5, '新北市立圖書館(三峽分館)', '新北市三峽區永安街9巷5號2樓', '02-2673-5234', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n走進三峽分館的第一秒開始，驚嘆的感覺從未停止過。\n一進門的第一眼，就被櫃台吸引了目光，由淘汰的書堆疊組合而成的櫃台，讓圖書館的空間變得有趣，也為來分館的民眾帶來了一股視覺上的震撼；鵝黃色的主色調貫穿整個分館，自成一區的兒童區，顯得溫馨又可愛；前往樂齡區的通道上方有著「藍染」門簾，盡顯三峽特色之餘，也有種衝突的美感。', 4, '08:30:00', '21:00:00', 'Any'),
(147, 5, '新北市立圖書館(三峽北大分館)', '新北市三峽區學成路396號3-4樓', '02-8671-5735', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n三峽北大分館位於北大社區「六合一」綜合行政大樓中三樓及四樓，本大樓緊鄰北大特區中難得的綠意瑰寶-龍學公園，創造「讓全齡擁抱公園綠意的鑽石級綠建築」。\n超萌大熊陪讀，孩子每天都想去圖書館！以「家庭」為主軸設計，有超萌的大熊陪讀，也有舒適的座椅讓孩子窩著，就像在家閱讀，4樓是專屬小朋友的閱讀天堂，可隨心所欲變化的移動書架及溜滑梯造型的閱讀角落，創造閱讀的趣味性，以吸引孩子喜歡閱讀。', 4, '08:30:00', '21:00:00', 'Any'),
(148, 5, '大安森林公園', '臺北市大安區新生南路以東、信義路3段以南', '(02)2700-3830', '大安森林公園佔地約26公頃，於民國八十三年三月二十九日啟園。雖位於台北市區中心，但卻是一個草木濃密的生態公園，以「都會森林」的型態成為台北市的都市之肺。公園內除有綠樹成蔭之外，更有花壇處處，每逢花開時節色彩繽紛，令人賞心悅目。公園外人行道則以綠樹與道路區隔，臨建國南路為盾柱木，臨和平東路為樟樹、臨新生南路為白千層、臨信義路則為榕樹，人行道中央還植有楓香樹，呈現多層式綠籬景觀。此外，各種休憩設施如行人座椅、涼亭、音樂舞台、慢跑道……等各種設施相當完善，公園下方並設置有地下停車場以方便開車前來的民眾，已成為台北市民休閒最佳場所之一。', 4.4, '00:00:00', '23:59:59', 'Sunny'),
(149, 5, '南港山系-象山親山步道', '臺北市信義區信義路五段150巷', '無', '象山因外形似象頭而得名，位於臺北盆地東南方的信義區，與虎山地質相同主要由砂岩組成，因造山作用步道中可見黃褐色陡峭的岩壁與巨石，加上自然環境生物、鳥類種類繁多，使得整座山如同一座天然生態樂園般，成為民眾接近淺山、享受戶外綠林悠閒時光的好去處。步道沿線設有解說牌引導民眾參訪，區內各種稜線、岩壁、山坡等不同環境，孕育出多種蕨類植物處處可見，其中又以金狗毛蕨與筆筒樹古老蕨類族群最大，數量居臺北市之冠。\n登高遠眺繁華台北盡收眼底四獸山是距離台北市松山、信義區最近的山頭。象山位在四獸山步道系統中最高點，由於前方無屏障，登高遠望視野遼闊，不僅信義商圈一覽無遺－101金融大樓、世貿中心、華納威秀、新光三越等醒目建築歷歷可數，台北盆地風光也盡收眼底。', 4.5, '00:00:00', '23:59:59', 'Sunny'),
(150, 5, '北投公園', '臺北市北投區中山路2號', '無', '首先映入眼簾的，是98年度完工的入口跳泉，每日固定時間隨著音樂，有著燈光及水泉飛舞，為北投這個具有豐富文化的老台北地區，重新注入一股新生的活力，沿著光明路側，途經白千層及魯花樹等珍稀老樹，為即將滿百歲的北投公園見證他豐富的歷史，旅途中，也會經過由臺北市立圖書館首次建築的綠色圖書館，強調節能省碳，也為北投公園帶來書香氣息，門口的的噴水池更是電影取景之首選，沿著北投溪前進，世界上唯一以臺灣地名命名的「北投石」，即出產於此，雖然現在已不復見。越過小徑拾級而上，來到中山路側，除了北投露天溫泉浴池外，旁邊還有于右任先生提名之「梅庭」歷史建物，目前已由本府觀光傳播局規劃為梅庭遊客中心，以提供遊客最貼心的服務，還有聞名的溫泉博物館，日洋合一的木造窗櫺及紅磚建築體，似乎還瀰漫著濃濃硫磺的特有香味，感受日據時代建築之美感，周邊潺潺溪流及綠蔭搖曳的景緻，置身其中，像是回到舊時的悠悠時光裡。北投公園有說不完的老故事以及各式各樣動、植物群聚，周邊還有地熱谷等著名景點，不妨趁著假日，安排一趟洗滌身心的知性之旅，相信您一定滿載而歸。', 4.2, '00:00:00', '23:59:59', 'Sunny'),
(151, 5, '新北市立圖書館(土城分館)', '新北市土城區中正路18號7樓', '02-2260-2952', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n要尋找土城分館的蹤跡，得多些印第安那瓊斯般的好奇與及冒險心理，穿過狹長巷弄、越過整排壯觀的機車、抵禦一旁菜市場擾嚷熱鬧的誘惑，最後才能在不起眼的角落發現入口。喧囂與靜謐，兩種看似衝突又截然不同的氛圍，和平共處於同一棟大樓中，成了最有意思的對比。', 3.6, '08:30:00', '21:00:00', 'Any'),
(152, 5, '新北市立圖書館(土城親子分館)', '新北市土城區中州路28巷30號4樓', '02-2267-8901', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-20:00\n銀鈴般清亮的笑語從空間一隅響起，為本該靜謐的廊道增添幾分歡樂的氣息，循著聲音而去，兒童遊戲室好幾位童蒙的孩子，正盡興著在滑梯、蹺蹺板間嬉趣。土城親子分館是專為12歲以下孩子打造閱讀的空間，號稱最歡樂的圖書館，透過(親子共讀遊憩空間)的營造，讓小朋自然而然地接觸閱讀、熟悉閱讀、喜愛閱讀。親子館打造各種適合親子互動空間意象與友善設施，同時也提供父母親與小朋友共渡親子互動好地方。', 3.8, '08:30:00', '20:00:00', 'Any'),
(153, 5, '陽明山國家公園', '臺北市士林區竹子湖路1-20號(陽明山國家公園管理處)', '(02)2861-3601', '陽明山國家公園是臺灣離都會區最近的一座國家公園，這裡地貌多變、生態豐富，孕育了許多珍貴的保育類動物，幸運的話，可以在這裏發現台灣特有種鳥類－台灣藍鵲的蹤跡。公園內種滿了梅、櫻、桃、李、杜鵑、茶花等各式花卉，每年春天櫻花盛開，總是吸引眾多人潮上山賞花。櫻花季過後，大約三月中旬竹子湖的海芋接著盛開，到田裡體驗採花的趣味，帶著一束海芋回家，成了遊客的必備行程。公園內最具代表的是一座由各式當季花卉組成的花鐘，來到陽明山，你一定要來這邊拍張照！除了花鐘，陽明山還有小油坑、陽明書屋、冷水坑、擎天崗等熱門景點，如果你喜歡登山踏青，這些景點千萬不能錯過。此外，陽明山一帶擁有豐富的地熱資源，各處溫泉的泉質又有不同，北投地區行義路一帶的溫泉餐廳林立，若你旅經此處，別忘了享受這裡特有的硫磺溫泉！春天賞花，夏天避暑，秋天有芒花與楓葉、冬天泡溫泉，陽明山的四季都有不同的美景、樂趣，等著你來發掘喔！', 4.5, '09:00:00', '16:30:00', 'Sunny'),
(154, 5, '新北市立圖書館(中和分館)', '新北市中和分館中和區南山路236號6樓', '02-2949-2767', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n中和分館主任說，中和的華新街是新北市新住民最集中的地區，因此分館裡處處可見新住民特色，不僅新住民母語書籍頗豐，還時常舉辦親子共讀的講座，更與戶政事務所合作推出「新住民日」，希望能把更多新住民帶往圖書館，讓閱讀成為他們排解鄉愁的方式。', 4, '08:30:00', '21:00:00', 'Any'),
(155, 5, '新北市立圖書館(中和員山分館)', '新北市中和區民享街37號2樓', '02-8221-1152', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n任憑歲月如何更迭，屬於中和員山居民的那份樸實直爽卻是歷久彌新，開闊舒適的空間，暖暖輕拂的書香氣息，帶給了前來的朋友們，身心靈上的滿足。友善的設施、和藹親切的館員，散發著滿滿的人情味，親愛的朋友還在等甚麼呢? 快來加入閱讀的行列。', 3.8, '08:30:00', '21:00:00', 'Any'),
(156, 5, '碧湖公園', '臺北市內湖區內湖路2段175號', '(02)2585-1430', '碧湖公園面積約有13.1公頃，鄰近國立戲曲專科學校，園中有座大埤湖，面積約7公頃，昔日為農業灌溉用的蓄水池塘，76年改建為公園，之後便成為周邊居民休閒場所。園中有中式之涼亭、九曲橋及環湖步道等設施，湖岸周邊植有柳樹、落羽松、白千層、阿勃勒、鳳凰木、扶桑、杜鵑、 矮仙丹，春夏季節有繁花盛開，加上湖光山色的景色，與大湖公園有異曲同工之妙。此外，園中管理中心一樓設有容量約45人座位之閱覽室，可提供民眾進修，另有網球場、游泳池等健身設施，除遊園賞景、運動之外，還可垂釣及登山健行，園中共有6條登山小徑，沿途也設有亭閣可休憩，環境十分清幽。', 4.3, '00:00:00', '23:59:59', 'Sunny'),
(157, 5, '新北市立圖書館(五股分館)', '新北市五股區工商路1號3樓', '02-2293-2114', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n書是傳承知識的工具，讓文明得以世世代代綿延下去，但如果未經整理，很容易被人們忽略它的存在，有些絕版或具有紀念價值的舊書就有可能被埋沒在茫茫書海中。而在五股分館的館員就有『整書達人』之稱，可以讓舊書恢復年輕的樣貌，繼續貢獻它們的知識。\n五股地區的圖書館，從以前開始，就有別的地方所沒有的優點，那就是整書工作做的非常確實，不僅僅照一般書號，還照出版社、書本大小本去排列。還有排書的固定手勢，左手向裡推，右手則是放到書背往前整，所以每本書排的位置一致，整排看過去相當整齊。這就是像日本的職人精神，不論做甚麼都要做到最完美。', 3.5, '08:30:00', '21:00:00', 'Any'),
(158, 5, '新北市立圖書館(五股水碓分館)', '新北市五股區明德路10號4樓', '02-8295-8950', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n不像傳統圖書館制式格局，五股水碓分館空間設計以開放式的閱讀環境為主，讓人一進門就有視野開闊的感受，咖啡色系的原木為主要基底，為圖書館的氛圍增添古典氣息。\n圖書館位在大樓的三樓和四樓，三樓是自修室，四樓則設有書庫以及親子共讀區。兩區的設計大不同，成人書庫以傳統開架式書架陳列為主，而兒童區則是兩個圓形構成同心圓，當孩子們蹲在同心圓內找書，就彷彿進入迷宮一樣。\n圖書館內還有一處粉紅色系的書櫃，跳脫館內的沉穩氣息，這裡是”漫畫區”，是學生的最愛。', 4, '08:30:00', '21:00:00', 'Any'),
(159, 5, '大湖公園', '臺北市內湖區成功路5段31號', '(02)2585-1430', '大湖湖泊面積約10公頃餘，屬區域性公園。其依山傍水，水岸蜿蜒曲折，湖面波光粼粼，視野開闊，拱橋彷彿垂虹，每當山橫春靄，新柳拂水，遠處嵐影，盡入眼簾；亭中小歇、宜眺宜憩，雲水變幻，騁懷遊目，景色秀美；每當夏秋之季，煙雨瀰漫，仿如畫中，在2012年5月登上法國世界報。\n誠摯的邀請您能蒞園一遊，除遠離塵囂、遊園賞景、漫湖岸垂柳步道欣賞湖光山、徜徉落羽松林吸收大自然精華及享受青草香外，同時可進行垂釣、野餐、游泳等各項活動，若能再結合附近山區的健行活動，大湖公園將是進行半日或一日遊的最佳休憩景點。', 4.4, '00:00:00', '23:59:59', 'Sunny'),
(160, 5, '新北市立圖書館(五股成功分館)', '新北市五股區西雲路165號4~5樓', '02-2293-5827', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n五股成功分館，沒有吵雜的人聲交談，來的人不是專注看書，就是敲著鍵盤。風格簡素，沒有矯情的裝飾，是間極適合閱讀，一個人前來的圖書館。\n五股成功分館的館藏特色是”兒童”，定期會舉辦英文故事屋活動，視聽室也會播放親子類的影片，尤其以動畫類居多。', 3, '08:30:00', '21:00:00', 'Any'),
(161, 5, '新北市立圖書館(平溪分館)', '新北市平溪區公園街17號3樓', '02-2495-2422', '休館日期：每月最後一個週四、國定假日\n冉冉上升的天燈，乘載著異鄉人的夢想，也承載著歸鄉遊子的殷殷期盼。經過了許多年在外漂泊的歲月，李先生終於回到故鄉工作，透過圖書館大片透明落地窗眺望外頭的翠綠山嵐，偶爾有幾只天燈飄進視線範圍，靜謐祥和的氛圍，讓這位歸鄉遊子的心徹底得到了撫慰。\n除卻假日的熙來攘往人群，平日的平溪是個安靜的小鎮，隨著青年人口的外移，老年人成了小鎮最多的人口，因此「樂齡」也就成了平溪分館的一大特色，為了讓館內設施更貼近長者，平溪分館做了許多努力。\n為了能讓身長者及拄拐杖的老人家可以輕鬆的瀏覽各書架書籍，不會與其他讀者有必須錯身的尷尬，特地將各書架間距放寬至120公分以上，最下層的書櫃不放置書籍，避免樂齡讀者彎腰取書的困擾；並十分貼心地將樂齡書籍放置在閱讀區附近，且在座椅上設置拐杖放置處，各式想得到想不到的貼心設備這裡都有，還曾經讓來訪的一團日本人讚賞不已。', 4, '08:30:00', '17:00:00', 'Any'),
(162, 5, '新北市立圖書館(永和民權分館)', '新北市永和區民權路60號7樓', '02-2949-5012', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n數百坪大的空間裡，一層一層書籍堆疊出知識的堡壘，書架旁的主題書展區，正展出民眾感興趣的養生與旅遊系列書籍，這個區塊書籍常隨著各種主題更迭，從美食到身心靈都有，民眾不用出國，就可以藉由書展認識各國文化與語言，自然地沉浸於書香世界。', 3.8, '08:30:00', '21:00:00', 'Any'),
(163, 5, '七星山系-天母古道親山步道', '臺北市士林區中山北路7段232巷', '無', '天母古道曾經是金山與天母間重要的連絡要道，自從仰德大道開通後，這條早年的便道就成為名符其實的古道，近年更躍昇為熱門的登山路線，每逢假日遊人如織。天母古道生態景觀天母古道全區海拔高度從約300公尺至120公尺屬於臺灣低海拔亞熱帶闊葉林生態系。從大屯山鞍部吹來的東北季風帶來強風、雨水和低溫，使山腰古道迎風面，呈現暖溫帶闊葉林景致；相反的山腰避風面溪谷陰溼地環境則利於熱帶熱帶闊葉樹種生長，如熱帶板根、幹生花、纏勒等現象。天母古道雖海拔僅300公尺，卻有著熱帶、亞熱帶及暖溫帶闊葉林等不同生態之壓縮型生態系環境，相當難得而珍貴。◎特別提醒山友：步道下切翠峰瀑布的岔路附近，容易看見猴群出沒，當您看見猴群出現時，請不要任意餵食，以免猴兒為爭搶食物，不小心傷害到您喔！', 4.3, '00:00:00', '23:59:59', 'Sunny'),
(164, 5, '新北市立圖書館(永和分館)', '新北市永和區國光路2號', '02-2922-2409', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n永和分館的建築從66年興建至今，是全新北市大型分館中歷史最為悠久的一棟建築，然而即使沒有新穎的硬體設計，這裡依舊每天有著絡繹不絕的人潮，借閱量永遠高居全市前四名。\n特別的是，永和分館十分支持在地藝術家，特地留一整層的展覽櫃給永和在地的藝術家擺放作品，不管是書籍、畫作或一些藝術品，用實際行動提供在地藝術家曝光的機會，希望能撞擊出更多在地的藝術能量及文學氣息。', 3.6, '08:30:00', '21:00:00', 'Any'),
(165, 5, '內溝溪景觀生態步道', '臺北市內湖區康樂街', '(02)2759-3001', '內溝溪源發於標高450公尺的內湖坑頭山，向東南流經內溝溪後，轉向南湖大橋上游約500公尺處流入基隆河，全長6817公尺，流域面積約422公頃，集水區平均坡度約41％，為台北市內頗具山林野趣的區域，且利用塊石疊砌形成孔隙，提供水生動物棲息空間，也增加民眾親近溪水機會。', 4.1, '00:00:00', '23:59:59', 'Sunny'),
(166, 5, '新北市立圖書館(永和保生分館)', '新北市永和區新生路218號5樓', '02-2927-0658', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n緊鄰河濱公園，永和保生分館裡的一大片落地窗猶如一幅大畫框，將窗外的藍天綠地緊緊框住，在館內不時會見到民眾暫時放下書本，或是將眼睛投向窗外的綠意，或是偶爾動一動筋骨，在美景前得到身心的放鬆。\n寬敞明亮的空間佈置，讓保生圖書館深受附近居民的喜愛，館員說，每逢考季這裡常擠滿考生，六樓自修區是升學、求職念書與應試者的最愛，窗外河濱公園的夜景，讓這些考生們得以調劑疲憊的身心。', 4, '08:30:00', '21:00:00', 'Any'),
(167, 5, '新北市立圖書館(石門分館)', '新北市石門區尖鹿里中央路9-3號', '02-2638-1202', '休館日期：每月最後一個週四、國定假日\n如果閱讀時，抬頭便能望見海，會是什麼樣的視覺享受呢?\n位在石門區的石門分館，是最北端且最接近海的一座圖書館，它坐落在全校不到一百人的石門國小內，88年創立至今，已經成為附近居民平時閱讀休憩的中心。\n第一次來到這兒的人，腳步總會不由自主的往圖書館最裡側走去，因為那兒有大片的透明落地窗，窗外的藍，有著兩種不同的層次，那是天空的清藍，還有大海的深邃靛藍，連成一氣的美。\n再往近處看，眼前所及的會是學校操場，一大片紅泥土地的顏色，與大海相互輝映。右前方是港口，可以遠眺停泊在岸的漁船，左前方則是學校專屬的高爾夫球場，偶爾還會傳來孩子們學打高球時的歡笑聲。', 4, '08:30:00', '17:00:00', 'Any'),
(168, 5, '新北市立圖書館(石碇分館 )', '新北市石碇區碇坪路1段65號', '02-2663-1354', '休館日期：每月最後一個週四、國定假日\n石碇分館一隅，一群小學生們圍著桌子端坐，燙壺、倒水、置茶、注水、燙杯……每個泡茶的步驟，都如同一個莊重的儀式，而當金黃的茶湯從茶壺口注出，孩子們臉上全都漾出了笑容。\n這是石碇分館的「小小茶師」活動，由於石碇的居民大多以採茶及製茶為主，分館主任於是有此發想，與當地學校配合一起辦理小小茶師教學，針對國小學做培訓，期望學生們在經由一些茶葉知識、泡茶方式的洗禮之後，能更了解茶農的辛苦，體恤家中長輩的辛勞。\n分館主任說，石碇分館的小小茶師，是提供一個讓孩子練習的空間，學生可到櫃台登記領取茶具，再到二樓的座位學習如何泡茶。藉由小小茶師，可以難得體會在圖書館中書香和茶香同時圍繞的滋味！', 3.8, '08:30:00', '17:00:00', 'Any'),
(169, 5, '新北市立圖書館(汐止分館)', '新北市汐止區新台五路一段268號5樓', '02-2641-5829', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n汐止分館位於汐止區公所大樓內，正對汐止國民運動中心，市民朋友無論來洽公或者運動，不妨散步到汐止分館閱報、看書，讓自己文青一下。生活在汐止，只要願意、全區有七間圖書館、閱覽室，隨時都能徜徉書海裡。\n汐止分館所在地，原是汐止市民代表會，在台北縣升格之後，一度閒置，後來新北市政府重新規劃、裝潢，並將自強分館藏書搬遷至此，重新開張。分館主任指出，與汐止大同分館的親子特色做區隔，汐止分館是以長者作為主要讀者群，因此整體空間配置，處處都可看見專為長者打造的貼心服務。\n諸如，專門的樂齡書區，將養生、健康書籍集中擺放、方便選取；走道、各入口處明顯加寬，全館地面均無高低落差，方便輪椅族群輕鬆移動、自在閱讀。還有圖書館靠窗、視野最好的一整排，全是單人沙發雅座，可以在此看書、曬太陽、遠眺月臺上來來去去的火車，因為太舒服，幾乎隨時都客滿。', 3.4, '08:30:00', '21:00:00', 'Any'),
(170, 5, '新北市立圖書館(汐止大同分館)', '新北市汐止區大同路2段451號', '02-2642-7323', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n對汐止人來說，大同分館集各種大成於一身。距離汐止火車站、步行約5分鐘；灰色低調的館舍，隱身小公園內，周邊有大樹、老鐘、鞦韆、U-BIKE，早晨松鼠在此覓食；後方鄰近寺廟、傳統市場；左邊是新落成的汐止警分局、右邊是消防局汐止分隊，恰好是孩子最崇拜的警察與消防員。\n汐止大同分館藉由極佳的地理位置，力推親子閱讀。全館3萬7千多冊藏書，兒童圖書占1萬冊，超越四分之一。一樓最核心的空間，全都留給孩子，從玻璃窗灑落的陽光，軟墊地板、圓滑矮櫃、隨手可及的繪本，加上插畫家特別彩繪的童心牆，樹枝狀的簍空書架，孩子進到如此魔法空間，怎能不愛上閱讀?\n館員指出，上午常有阿公阿嬤，先將孫子帶到圖書館裡，再去菜市場買菜。快到中午時間，則是陸續出現歇腿休憩的老人家，守著豐收的菜籃車與看書看到不想走的孩子，這是大同分館的每日風景。如果孩子看書累了，就到外頭公園跑一跑，揮灑無窮體力，周邊環境安全、可以放心地玩。', 3.9, '08:30:00', '21:00:00', 'Any'),
(171, 5, '新北市立圖書館(汐止江北分館)', '新北市汐止區汐萬路一段81號2樓', '02-2643-1803', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n汐止江北分館，一棟低矮、外牆黑灰斑剝的建物，位在全汐止交通最繁雜的汐止連絡道旁，每一天，大貨車、小客車來來往往、水車馬龍。絕大多數從汐止開車前往台北、基隆等外縣市民眾，一定都會路過。然而，外頭世界越喧囂，印襯得江北館內更加寂靜，這裡的時光就跟一旁基隆河水一樣，無聲流瀉。\n總共兩層樓的建物，一樓是江北社區里民活動中心，二樓是江北分館。每一周、有兩天上午，活動中心會聚滿朝氣蓬勃的里民在此同樂、跳交際舞，輕快節奏的音樂聲，透過一樓、二樓兩層玻璃門的隔絕，再傳到讀者耳中時，已是悠悠忽忽，遙遠得無法想像就僅隔一層樓的距離。', 3.4, '08:30:00', '21:00:00', 'Any'),
(172, 5, '新北市立圖書館(汐止長安分館 )', '新北市汐止區長興街一段50號3樓', '02-8648-4071', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n這幾年來，或許因為智慧型載具發達，大家滑手機、看電子書，讀者流失很多。臨近新建社區住進的多是青壯人口，每天趕忙著到市區就業、就讀，恐怕還有人不知道這裡有座圖書館。而正對面的長安國小，自從學校擴增內部圖書館之後，孩子對長安分館的需求，也逐漸縮減到只剩寒暑假。\n新書一直來、讀者卻不來，館方人員憂心著。其實，對愛書人來說，不妨逆向思考。在長安分館，借閱熱門書籍、文學小說、童書繪本，完全不用搶，十足充裕供應、可以慢慢挑選，而且嶄新、毫無摺痕，幾乎都可蓋到前三名的還書章。書本啊，一定要有人借、有人讀，生命才會從還書章開始，不斷蔓延。', 3.6, '08:30:00', '21:00:00', 'Any'),
(173, 5, '新北市立圖書館(汐止茄苳分館 )', '新北市汐止區茄苳路225巷35號', '02-8648-3279', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n茄苳分館位在茄苳路225巷底，緊臨一般住家，不是「內行人」很容易迷路、找不到切確位置。因此，對館方來說，最大挑戰就是如何提高使用率。分館館員說，茄苳分館是典型的社區型圖書館，很少外來客，讀者多是茄苳里、崇德里居民，七、八成都是熟面孔。\n雖然區位偏遠，不過茄苳分館空間規劃舒適、四面採光良好，各類藏書充足，是很適合閱讀的環境。分館館員指出，有一位大姐固定會到附近的茄苳瀑布登山，之後再到圖書館稍事休憩、閱讀書報，像是這樣半天左右、同時有益身心的路線，就很適合推廣。', 3.3, '08:30:00', '21:00:00', 'Any'),
(174, 5, '南港山系-虎山親山步道', '臺北市信義區福德街251巷慈惠堂登山口或福德街221巷進入至真光禪寺登山口', '無', '虎山為四獸山市民森林區內之淺山之一，連接區後南港山系構成臺北市東南側的屏障，海拔140公尺，地質屬海相地層之單面山地形，西高東低、視野遼闊，山頂設有一座日昝，可以觀日計時，步道由塊狀砂岩與頁岩交疊而成，因虎山溪流經，山澗型的生態環境同時也是孕育螢火蟲、小綠蛙及蕨類等多元生態的最佳地點，溪岸經整修鞏固及完善水土保持後，虎山溪沿線成為觀賞溼地生態的最佳去處，步道沿線並設置解說牌及路線指標，是郊山健行又可觀賞生態的好去處。四獸山市民森林四獸山步道經過整建後命名為四獸山市民森林，包括虎、豹、獅、象四座郊山，山區自然環境生物、鳥類種類繁多，成為民眾享受戶外綠林悠閒時光的好去處。', 4.3, '00:00:00', '23:59:59', 'Sunny'),
(175, 5, '大屯山系-軍艦岩親山步道', '臺北市北投區陽明大學「動物中心」東側步行約50分鐘抵登山口', '(02)2759-3001', '軍艦岩親山步道  健走軍艦岩親山步道沿途可欣賞珍貴老樹和自然景觀，頂上視野開闊，中研院於山頂設立有地殼變動基準點，作為記錄與研究用。自頂上向右眺望可欣賞士林到北投的稜線、地景風光，向左俯瞰則可欣賞威靈頓山莊安靜祥和的現代化社區，景致開闊好看。', 4.2, '00:00:00', '23:59:59', 'Sunny'),
(176, 5, '新北市立圖書館(坪林分館)', '新北市坪林區國中路3號', '02-2665-7499', '休館日期：每月最後一個週四、國定假日\n走進坪林分館，就進入了茶香世界，館內隨處可見的茶元素，彷彿一翻開書本，就會有迷人的茶香溢出。\n重新打造過的坪林分館，景色美得讓人捨不得眨眼，順著樓梯爬上二樓，大塊透明玻璃鑲嵌著的一片綠意，就以排山倒海之姿迎面而來，讓人只想趕快選本書，在陽光洗禮的玻璃窗前享受閱讀時光。彷彿和遠方碧綠的茶園相呼應一般，二樓館藏特色區蒐集各類茶產相關書籍，包括茶史、茶產業、茶藝、茶文化...等典藏，在茶園環繞中透過閱讀進入浩瀚博大的茶世界，別有一番滋味。', 4, '09:00:00', '17:00:00', 'Any'),
(177, 5, '新北市立圖書館(林口分館)', '新北市林口區忠孝二路55號4~5樓', '02-2609-1417', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n你對圖書館的印象是什麼？還停留在小時候沉悶的書架和制式的椅子嗎？林口分館重新定義圖書館的印象!\n由舊館喬遷至林口區六合一行政園區的林口分館，設在林口行政大樓的四樓及五樓，恰好在三井Outlet對面，享有五百二十坪大的空間。一進入圖書館就被這極簡約裝潢所震懾，它以灰黑白三色為基底，裡頭的桌椅，採用淺原木色調，類似北歐家具風格，營造簡約樸實的居家氛圍。', 3.9, '08:30:00', '21:00:00', 'Any'),
(178, 5, '二格山系-仙跡岩親山步道', '臺北市文山區南港山南側文山區境內', '無', '仙跡岩山勢不高，不但是附近居民可親的「後花園」，全家一起爬山也很適合。雖說一開始要花點力氣先爬完78階的長壽梯，接著再走100階的登仙坡，兩旁濃密樹林喚來的清涼山風，很快就能為你消弭剛才爬坡的疲勞。之後的步道一路平緩易行，沿途又設有多處涼亭可歇腳或觀景，循著新設的小鳥造型指標向前行，就可以好整以暇、輕輕鬆鬆地走完全程。', 4.4, '00:00:00', '23:59:59', 'Sunny'),
(179, 5, '新北市立圖書館(板橋江子翠分館)', '新北市板橋區莊敬路62號', '02-2253-4412', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n來板橋說要找江子翠分館，可能當地人知道的沒幾個，但只要提及『文化中心』，茫然的表情就立刻會換成恍然大悟，順手一指確切方向，『就是議會後面那棟紅色的啊』老江翠人都是這樣向外地人說的。\n儘管改名已久，還歷經多次變革，從原本的文化中心，在民國九十九年台北縣改制後，它就更名為『新北市立圖書館』，繼續維持它自民國六十八年籌備、七十二年開館以來的總館地位，但就在民國一百零四年在貴興路落成新大樓後，它就卸下了將近三十七年的領頭羊重擔，成為新北市眾多分館之一，雖然如此，『紅磚圖書館』在當地人的心裡，它依舊有其無法撼動的地位。\n挑本書找個靠窗的位子坐下，窗外停車場除了偶爾進出的車輛，看不到都市人忙碌的腳步，當下有種錯覺，彷彿紅磚牆為我留住了片刻悠閒寧靜的時光。', 3.9, '08:30:00', '21:00:00', 'Any'),
(180, 5, '新北市立圖書館(板橋分館)', '新北市板橋區文化路1段23號', '02-2966-4347', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n板橋分館是在民國67年借用板橋國小校地興建圖書館，民國101年改建，歷史已經有三十多年，可以算上『資歷頗深』的圖書館，但它一點也不守舊，在館方的推動下，有多項常態性活動，像是中英文彩虹故事列車、電影爆米花，以及各類不定期藝文推廣活動，讓圖書館呈現不同以往的年輕風貌。\n以板橋分館來說，目前館藏量約8.3萬餘冊，館藏特色為建築藝術，包含板橋特色林本源園邸建築及相關建築藝術類書籍。', 4, '08:30:00', '21:00:00', 'Any'),
(181, 5, '新北市立圖書館(板橋四維分館)', '新北市板橋區陽明街168號', '02-2252-1933', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n四維分館運用光影最為巧妙之處，就在星光劇場。雖然它位在地下室的視聽室，光線仍十分充足，白天時，就算是室內完全不開燈，但舞台的亮度彷彿有聚光燈從上方打光下來，型塑出獨特的舞台景致。\n閱讀空間有很多種，你喜歡哪一種?在這裡,「玻璃」躍然成空間主角，圓弧形的落地窗正對著大片空中庭園，阻隔光線直射的刺目，它就像個神秘的魔術表演，依照不同天氣，給你不同的驚喜感受。\n晴天，倚窗而坐，透著折射的光線，柔和而不強硬。\n雨天，慵懶倚窗檯，感受其獨有的詩情畫意。', 4, '08:30:00', '21:00:00', 'Any'),
(182, 5, '二格山系-指南宮貓空親山步道', '臺北市文山區指南路三段33巷', '無', '指南宮貓空親山步道以指南宮步道、大成殿步道及茶展中心步道為主，這條以指南宮為中心主軸的步道位於二格山系西北側的猴山岳山上，是通往貓空、樟湖及二格山區必經之地。從指南路三段33巷循石階拾級而上，經指南宮步道、指南宮、凌霄寶殿、大成殿、大成殿步道、茶展中心步道等，是一條親子級的親山健行路線。指南宮步道沿途有造型典雅的石燈籠分列步道兩旁，加上從步道入口的牌坊、途中的終南亭等，不難發現步道的興建起於日據昭和年間，有著濃郁的日式和風建築風格，極為古樸典雅而珍貴。', 4.1, '00:00:00', '23:59:59', 'Sunny'),
(183, 5, '新北市立圖書館(板橋忠孝分館)', '新北市板橋區國慶路149巷21弄16號', '02-2954-2455', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n搭公車到仁愛新村站下車，走沒多久就看到忠孝分館。正如仁愛新村的眷村風格，圖書館一走進去，簡單的淺色系大書桌，以及整齊擺放的書架，三五個銀髮長者坐在報紙區看報，簡樸的感覺，只有待過眷村的人才能感受到。', 3.8, '08:30:00', '21:00:00', 'Any'),
(184, 5, '大屯山系-貴子坑親山步道', '臺北市北投區秀山路159巷', '無', '位於北投稻香里的貴子坑園區佔地約10,000坪，原為瓷土礦場，後因山坡地闢建為休閒活動場而引來人潮。市府所規劃的第一條親山步道，便是串連捷運復興崗站的貴子坑親山步道，其中還包括捷運綠廊步道直通往貴子坑園區。', 4.1, '00:00:00', '23:59:59', 'Sunny');
INSERT INTO `type_place` (`place_no`, `type_no`, `palce_name`, `addr`, `tel`, `intro`, `net_rate`, `openTime`, `endTime`, `weather`) VALUES
(185, 5, '五指山系-劍潭山親山步道', '臺北市士林區中山北路四段公車劍潭站旁', '無', '劍潭山海拔153公尺，位於臺北市士林區圓山風景區，是圓山飯店後山的北稜，也是臺北市最接近市中心的小山，沿著稜脊步道緩緩前行可抵達其他山岳，走起來幾乎是輕鬆自在，在交通便捷上佔有極大之優勢。劍潭山親山步道登山口位於中山北路四段公車劍潭站旁，這裡曾是軍事管制區與保安林地，因此自然林相與生態植物保存的相當完整；步道兩旁許多人工栽種植被與經濟植物，讓步道充滿盎然的綠色魅力。這條步道已成為市民晨運健身的場所，如位於稜線上「老地方」，就是大家熟知的健身據點。步道沿途可以欣賞圓山飯店、基隆河河濱公園等景致，步道盡頭為大直的通北街165巷、北安路口處，是一條坡緩易行的郊山步道。', 3.9, '00:00:00', '23:59:59', 'Sunny'),
(186, 5, '新北市立圖書館(板橋溪北分館)', '新北市板橋區篤行路二段133號', '02-2687-6738', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n新北市立圖書館板橋溪北分館座落於溪北公園內，樓地板面積約877平方公尺，民國94年開館啟用，提供板橋浮洲及板橋溪崑地區全面、多元的圖書館服務。一樓為書庫區、二樓為自修室，館外溪北生態公園，公園綠意盎然，襯托圖書館舒適悠閒的閱讀環境。\n溪北公園內種植的樹木林立，四季也有不同的花盛開，春季時有春櫻、木棉花可賞，夏季也有阿勃勒花、鳳凰花盛開，讀者看書的視野依著四季，能感受不同風采。', 4, '08:30:00', '21:00:00', 'Any'),
(187, 5, '白石湖吊橋', '臺北市內湖區碧山路24號', '(02)2759-3001', '白石湖吊橋位於內湖白石湖休閒農業區內，吊橋入口位於碧山巖開漳聖王廟的停車場旁，全長116公尺，橫跨忠勇山及大崙頭山系，特別採龍骨意象塑造，從東邊「龍船岩」連接白石湖山、大崙頭山、忠勇山、鯉魚山，至圓覺瀑布而止，從空中俯瞰，就像是一條巨龍盤據，守護著白石湖地區。有別於一般吊橋的高聳橋台設計，特別採直路式設計，打造成一座無懸吊纜繩的隱形吊橋，融入當地的田園美景。通果吊橋後為白石湖社區，百公尺長的春秋步道，可見精心開闢的花卉專業種植區，及當地豐富的農村特色、景觀生態等資源。白石湖吊橋串連起周邊山寺、果園、森林步道、溼地湖泊，置身其中可欣賞到美麗花卉及悅耳的叢林鳥叫聲，為民眾休閒遊憩的好去處。', 4, '00:00:00', '23:59:59', 'Sunny'),
(188, 5, '大屯山系-中正山親山步道', '臺北市北投區登山路143之2號', '(02)2759-3001', '中正山原名彌陀山，也叫十八份山或大竿林山，後來才改成中正山；中正山的登山口有7處之多，這是由其串連出來的步道特多，大都呈放射狀，山頭獨立，廣角視野稱得上一流，十分特別。 中正山親山步道 這條親山步道自登山路起登，幾乎是陡坡石階直上山頂，山友行前須作好體力與腳力的準備，尤其心肺功能須在這條步道行進間，充分發揮其功用。儘管上坡路段耗費體力，但是一路上登可以欣賞北投街區及基隆河全貌景象，讓這條步道還真吸引不少山友前往。尤其抵達山頂觀景樓，視野總讓人驚奇連連，平日不易見到的七星山、紗帽山「近覽」，山際稜線層層分明，難得一見、煞是好看。', 3.9, '00:00:00', '23:59:59', 'Sunny'),
(189, 5, '新北市立圖書館(金山分館)', '新北市金山區五湖里龜子山8號', '02-2498-4714', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-19:00\n在新北市397萬人口母數中，金山區為2萬2千人左右，無論在人口比例、在地理位置，金山都可說是「偏鄉」。尤有甚者，絕大多數青壯年往都會區移動，在台北、新北，上班、上課，留在金山轄內生活的，多是高齡長者及隔代教養的下一代。\n整個金山分館的環境佈設與服務核心，就是圍繞著銀髮族與兒童兩大區塊。', 4, '08:30:00', '19:00:00', 'Any'),
(190, 5, '新北市立圖書館(泰山貴子分館)', '新北市泰山區工專路22號3樓', '02-2904-9389', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n“圖書館”對很多人來說，是習以為常的地方，甚至在生活中很容易被忽略，但有沒有試過，換一個角度來看它，或許你會發現，圖書館會是你從未發現的另外一個世界。\n橘子是隻貓，來這裡的人都認識牠，這樣懶洋洋地趴在樹蔭下乘涼已經是每天的例行公事，不知道哪天牠也會被書的魅力吸引著，進來看書呢？', 4, '08:30:00', '21:00:00', 'Any'),
(191, 5, '新北市立圖書館(泰山分館)', '新北市泰山區全興路212號5樓', '02-2909-1727', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n圖書館對你而言，是個什麼樣的地方?有人說,它是個充滿魔力的地方，翻開每本書，翻開每一頁，轉瞬間就將帶你進入幻想世界。\n橘子是隻整天都想讀書的貓，牠住在市場外頭，不知道哪天，書的魔法會讓牠也愛上讀書的滋味呢。', 4, '08:30:00', '21:00:00', 'Any'),
(192, 5, '南港山系-更寮古道親山步道', '臺北市南港區舊莊街二段122巷', '無', '更寮古道親山步道是早年南港通往深坑和石碇的五條古道中，保存最完整，而且仍在使用中的古道。這條古道不僅是往山豬窟與土庫岳必經的便道，也是探訪古厝遺跡的百年老路。現今古道沿途已鋪上花崗石步階，然而起訖狹窄的路況，仍在在顯現古老粗獷的原始味，部份未鋪設的碎石路段，點綴著日日春小白花，更顯小徑純樸古意未減。', 4, '00:00:00', '23:59:59', 'Sunny'),
(193, 5, '新北市立圖書館(烏來分館)', '新北市烏來區烏來里烏來街34號1樓', '02-2661-6717', '休館日期：每週一、二、每月最後一個週四、國定假日\n「原」味十足的烏來老街，各式原住民小吃吸引著人們的味蕾，幾間溫泉旅館穿插其間，增添了幾分溫暖的原鄉風情。烏來分館就座落在老街裡，彷彿一個安靜的學生，沉默的讓人幾乎忘了它的存在。\n烏來區是台灣分佈最北的原住民山地區，山高谷深孕育出豐富珍貴的自然生態環境，居民以泰雅族為主，地名源自於原住民泰雅族語中的「Ulay」，意為水很燙要小心「Kiluh-ulay」，而這來自地底的天然溫泉，加上冬末春初的山櫻花，也就成了烏來最重要的觀光產業。', 4, '09:00:00', '17:00:00', 'Any'),
(194, 5, '新北市立圖書館(貢寮分館)', '新北市貢寮區真理里仁愛路79號3樓', '02-2490-3203', '休館日期：每月最後一個週四、國定假日\n恬靜質樸的百年漁村，卻有著美麗的水梯田風光；有著最受年輕人歡迎的海洋音樂祭，卻也有著最受爭議、抗爭不斷的核四。貢寮，總是充滿著衝突的印象，卻有趣地總能在衝突中找到彼此不受干擾的平衡。\n而新北圖書館貢寮分館，正是在這樣的衝突中產生的。分館主任指出，當初貢寮分館是因應核四廠而設立，因為當年核四開始動工，貢寮這個小漁村湧進了大批核四員工，為了讓這些員工及眷屬們在小漁村裡有個心靈寄託的場所，才有了貢寮分館的誕生。\n有趣的是，貢寮分館在設定館藏特色時，卻是以海洋音樂祭做為發想，佈置音樂館藏特色區及陳列樂曲書籍、視聽資料，期望營造閱讀音樂氛圍，使讀者得到身心靈的洗滌及養生。雖是因核四而生，但充滿著熱浪、青春、搖滾的音樂祭，早已將貢寮分館變得更貼近大眾，以閱讀的力量弭平了衝突。', 4, '08:30:00', '17:00:00', 'Any'),
(195, 5, '新北市立圖書館(淡水水碓分館)', '新北市淡水區中山北路一段158號6樓', '02-2629-2879', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n如同許多地方的分館一樣擁有兒童區，淡水水碓分館的兒童區卻是十分不一樣，因為在提供借書服務之外，這邊的孩子還可以「借玩具」。負責兒童館的館員說，一開始催生玩具圖書館，是因為當年的淡水鎮長希望有個地方讓孩子有書看、有得玩，因此參考了國外的經驗後在水碓試辦，結果一試之下大受歡迎，從此「玩具圖書館」不僅被保留下來，更逐漸拓展到新北市許多區域。\n館員說，玩具圖書館分成上下午兩個時段，每天只要玩具時間即將到來，就會見到孩子們牽著媽媽的手，在場地外排好隊等待的可愛模樣。目前館內玩具260樣，聲光類的遊戲一直都是小朋友們熱愛的選擇，不過在這裡玩玩具可得照規矩來，不僅要在規定的範圍內玩，且一次最多借兩種，時間到了記得乖乖歸還！', 4, '08:30:00', '21:00:00', 'Any'),
(196, 5, '新北市立圖書館(淡水竹圍分館)', '新北市淡水區民生路27號5樓', '02-2809-7442', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n走進淡水竹圍分館，有種彷彿走進坊間收費昂貴親子館的錯覺，兒童圖書區、玩具區、大肌肉活動區……，貼近各年齡層的小孩，更棒的是這裡完全免費，令人不禁再度讚嘆淡水的孩子的好福利！\n和水碓分館同樣是提供玩具的圖書館，不過竹圍分館多了「大肌肉區」的特色，讓100公分以下的孩子也同樣可以熟悉圖書館的環境。在這裡已服務十六年的館員說，在這裡，玩具和書零距離，也希望孩子和書本像和玩具一樣親近。', 4, '08:30:00', '21:00:00', 'Any'),
(197, 5, '新北市立圖書館(淡水分館)', '新北市淡水區文化路65號', '02-2622-4664', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n以「ENJOY」作為閱讀空間的主題，淡水分館從外觀玻璃帷幕上的彩繪，就可嗅出歡樂的氣息；走進室內，各分齡閱讀區清新溫暖的空間色調，將閱讀變成了一種享受；若嫌不足，還可將書本帶至戶外閱讀空間，讓書香與淡水的山光水色合而為一，充分陶醉在閱讀裡。\n和許多地區的分館不同，淡水分館光是關於淡水的各類圖書、參考用書及文史展示，就整整有一整層樓之多，館員說，五樓這一整層的「典藏淡水」，可充實民眾豐富知識並提供在地文化資源，對於民眾深入了解淡水有極大的幫助。 宜人的風景，無疑是淡水當地最大的資產，分館的戶外區，正擁有著這得天獨厚的景象，天氣好時，淡水河面彷彿被太陽鍍了一層金光，閃閃發亮，即使只是遠眺河面上的渡輪，也讓人心情為之放鬆。', 4, '08:30:00', '21:00:00', 'Any'),
(198, 5, '新北市立圖書館(深坑分館)', '新北市深坑區深坑街10號1樓', '02-2662-3821', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n對館員而言，深坑分館早已如同家一般熟悉，每一個角落幾乎都有著回憶的痕跡，三個小孩曾經在閱讀桌上認真寫功課、在兒童室裡開心看著書、曾經不小心太過喧鬧被她輕聲責備……，深坑分館陪著她的三個小孩一起成長，讓她度過了離婚後獨自養大孩子的艱辛歲月。\n為了吸引更多當地居民走進圖書館，分館主任楊俊生煞費苦心，不僅將主題特色館藏訂為「深坑四寶美食」（豆腐、黑豬肉、竹筍、茶葉），行銷地方文化，也與鄰近的老街做結合，辦理「老街巡禮」活動，更不定期舉辦類似「豆腐DIY」的親子活動，期望讓更多人走進圖書館，善用館內的資源。', 3, '08:30:00', '21:00:00', 'Any'),
(199, 5, '新北市立圖書館(新店分館)', '新北市新店區北新路3段105巷2號3樓', '02-2918-3181', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n一間圖書館裡會隱藏多少動人的故事？新店分館裡就有著這麼一段美麗的記憶。\n今年60歲的林明香，5年前剛從大學畢業，畢業論文報告正是在新店分館裡完成的，而之所以在50多歲才想要進入大學就讀，完全是為了要「陪兒子一起念大學」。 由於兒子有先天性心臟病，各方面發展都發展遲緩，林明香在兒子身上投注了全部的心力，長期擔任志工的她從兒子國中起就帶著他一起到圖書館，希望藉由圖書館的氛圍讓他能安心看書，多認識一點字。\n林明香的努力奏了效，兒子在閱讀上有著不錯的能力，為了讓兒子能持續學習並減輕老師負擔，林明香決定陪著兒子一起上學，從二專到二技，她陪著兒子一起念旅館管理假日班，期中期末考前兩人一起在自習室溫書、帶著兒子在資訊檢索室做報告，教他如何透過電腦找資料完成作業……，新店分館各個角落裡都曾出現她們母子倆的身影。 如今，母子倆雙雙都從二技畢業，林明香持續在圖書館及各醫院擔任志工，兒子除了在台大擔任工讀生外，也跟隨媽媽一起在耕莘醫院當志工。回首這段過去，林明香只有滿心喜悅，她十分感謝並懷念圖書館的這段歲月，在他們母子生命中留下如此深刻的痕跡。\n然而對館員們而言，各種新穎的設備也比不上人們創造出來的溫度，分館每天進出的人次高達1,500位，他們期待藉由館內的設施，能為大家創造出如同林明香母子般，屬於自己和圖書館一份美好的記憶。', 3.7, '08:30:00', '21:00:00', 'Any'),
(200, 5, '花博公園新生園區', '台北市中山區新生北路三段105號', '(02)2585-0192', '新生公園民國67年開闢完成，地處新生高架橋、民族東路、松江路、濱江街交界，占地近20公頃，為目前台北市第二大公園。園內設有多樣設施，包括新生溫水游泳池、棒球場、籃球場、還有一個結合環保理念的「迷宮花園」，提供台北市民一個玩樂休憩運動的好去處。園內還有九座大小不同的雕像散佈公園各角落，分別命名為「悠遊歲月」、「祥和遍大地」、「鶴群」、「希 望」、「欣欣向榮」、「友愛和平」、「阿爸的話」、「春天的走向」及「團結」，為公園增添豐富的人文氣息。新生公園於2010臺北花卉博覽會中選定為四大展區之一，納入鄰近的林安泰古厝，規畫為「夢區(新生公園)」、「茶區(林安泰古厝)」以及銜接大佳河濱公園區，以各式花卉、樹木、竹節架構而成的「花之隧道-綠築曉徑」。除了這些特色園藝景觀之外，還規劃了傳統四合院建築的「花茶殿」、沿用新生公園內原有建築-小白宮的「養生殿」、花博14個展館中唯一展現台灣尖端科技的數位互動展館「夢想館」、以藝術生活為主軸的「天使生活館」，以及展現人類與環境及植物間關係的「未來館」。其中夢想館、天使生活館、未來館更獲得鑽石級綠建築候選證書。', 4.1, '00:00:00', '23:59:59', 'Sunny'),
(201, 5, '大屯山系-關渡親山步道', '台北市北投區中央北路四段18巷', '(02)2759-3001', '成群候鳥飛越關渡綠色平原的姿態真是好看，從山坡上俯視這景象，不失為另一種幸福。放眼望去，淡水河依傍著觀音山、山環水抱臨向關渡平原，而繁華的臺北大都會已在遙遙遠方，整個臺北盆地盡收眼底。\n所以即使從捷運站到天際線還真有點距離，但一路上距離早已不成問題，沿途回首有這般好風景，恐怕只會加緊腳步向前，因為「更上一層樓」之後，視野想必更加遼闊。\n飽覽山色美景之後，由登山口進入天際線，原本開闊的視野突然轉為林蔭山徑，彷彿踏入另一個與世隔絕的世界。行走小徑間，隱密的原始樹林中有錯落的石塊、矗立路旁斷裂的樹幹，林間探險的野趣油然而生。嘿，陡峭坡段還要扶繩通過，不過稍為留意一下腳邊小石塊就沒事了，假日附近居民還會來這練腳力呢。\n一路上坡少說也有2500多公尺，再加上天際線步道有些陡峭路段，不在山頂歇歇腳那怎麼行。來到寬廣的平台，白鷺鷥在大型墓園旁落腳停歇，我們也到一旁長排座椅坐坐。休息過後，就有體力繼續下探後半段路程啦。\n下坡步道一路鋪設石階，方便好走。如果此時玩興正濃，那就在途中轉個彎，看是要向左走還是向右走都好。若是飢腸轆轆，往左走正好到有機農場品嚐有機蔬菜餐，運動健身之後來點新鮮蔬食最是神清氣爽；興之所至，向鑽研氣功多年的園主討教「元極功法」，順便再帶點有機蔬果回家，就能心滿意足踏上回家的路途。\n向右走呢，沿著涼亭旁的步徑到行天宮的「後花園」逛逛，走在林蔭扶疏的小徑最是涼爽。初見都市少見、樹根盤繞的老榕樹聚集會「驚為天人」，但多走幾步路就會發現這景觀在園中實屬稀鬆平常，四處繞繞都有老樹伯伯的蹤影。若是想停下來小歇，園中也有不少涼亭，所以有些香客到行天宮參拜之後也會來這走走。不過小徑路線錯綜複雜，還好有著紅牆瓦的行天宮目標明顯，有這地標作靠山，就不怕找不到回家的路囉！', 4.2, '00:00:00', '23:59:59', 'Sunny'),
(202, 2, '亞運保齡球館', '新北市新莊區化成路338號', '(02)2276-8979', '平日9:30開館\n亞運保齡球館，無論是休閒娛樂、公司聚會、球技練習，是您最好的選擇!\n本館內設有:\n保齡球區，1F共有20個保齡球道 ，2F共有14個保齡球道，每天固定清洗維修2次\n撞球區：撞球桌共12桌，球檯規格採競賽標準設置，另有國家級教練楊要輝、林上義先生駐館維護\n另有設置司諾克臺2桌，開侖球臺2桌\n另外也設置球具部、餐飲部，提供消費者最完善的服務，應有盡有，環境舒適!\n飛鏢區：引進七台最新日本超人氣飛鏢機。\n本館也提供免費Wifi無線上網!  歡迎前往玩樂!', 4.1, '08:30:00', '23:59:59', 'Any'),
(203, 2, 'E7PLAY 新莊館', '新北市新莊區民安路188巷5號', '(02)8201-5771', 'E7PLAY最大1500坪的室內運動遊樂空間，是大小朋友都愛E7一起玩(play)的綜合娛樂休閒場館。以「一票玩到底」的＂門票制＂消費方式，提供來館貴賓『SPORT』＆『FUN』多元的主題遊樂。\n館內集結了保齡球區、撞球區、飛鏢區、遊樂場區、桌遊區、MTV包廂區…等各種遊樂設施，出入口皆設置門票安全管制且全館禁煙；每人只要買一張門票進館，所有玩樂設施不必另外再花錢，就能通通玩到飽！\n消費方式： 買1張門票(可選擇3小時或5小時的進館玩樂時間)，店內數十種玩樂設施，不必再另外花錢(包括保齡球鞋使用)***，全部讓您玩到飽！超過500元的玩樂價值，每個人只要1、2佰塊的門票，平均玩一樣不到10元ㄟ！難怪連【食尚玩家】都到E7玩過了呢。', 4, '12:00:00', '23:00:00', 'Any'),
(204, 2, 'E7PLAY 三重館', '新北市三重區中央南路63號B1~B3', '(02)2976-3325', 'E7PLAY最大1500坪的室內運動遊樂空間，是大小朋友都愛E7一起玩(play)的綜合娛樂休閒場館。以「一票玩到底」的＂門票制＂消費方式，提供來館貴賓『SPORT』＆『FUN』多元的主題遊樂。\n館內集結了保齡球區、撞球區、飛鏢區、遊樂場區、桌遊區、MTV包廂區…等各種遊樂設施，出入口皆設置門票安全管制且全館禁煙；每人只要買一張門票進館，所有玩樂設施不必另外再花錢，就能通通玩到飽！\n消費方式： 買1張門票(可選擇3小時或5小時的進館玩樂時間)，店內數十種玩樂設施，不必再另外花錢(包括保齡球鞋使用)***，全部讓您玩到飽！超過500元的玩樂價值，每個人只要1、2佰塊的門票，平均玩一樣不到10元ㄟ！難怪連【食尚玩家】都到E7玩過了呢。', 4.1, '00:00:00', '23:59:59', 'Any'),
(205, 5, '五指山古道', '新北市汐止區新北市汐止區汐萬路三段380巷', '無', '五指山古道位於汐止的五指山南麓，是早期住在頂坪、半嶺及下坪地區的居民往返汐止與五指山之間的聯絡要道，自從汐萬公路開通之後，古道逐漸沒落，近幾年區公所和地方人士改善路況、設置指標、鋪設土階，已成為兼具自然與人文之美的登山步道。\n大多數山友會選擇交通便利的柯子林茶莊為出發點，經過一段產業道路後抵達天然游泳池旁的登山口，由此進入一段竹林幽幽、流水潺潺、古意盎然的山徑；途中除了可以發現先民拓墾的遺跡，如：五福宮的原址、駁坎、青苔石階及和古橋之外，還會經過日式特色餐廳、柯子林石磐瀑布、以及昔日稱作「過火埔」的友蚋山南峰，再行約十分鐘即來到汐萬路三段380巷的出口，若盛夏前來走古道，回程時可在重柔橋下的溪水或登山口旁的泳池中消除一些暑氣。', 3.9, '00:00:00', '23:59:59', 'Sunny'),
(206, 5, '杏花林', '台北市文山區老泉街45巷30號', '(02)2939-4866', '台北位處盆地，山林野外隨處可看見春天的芳蹤。以茶聞名的木柵貓空， 就有一片正值花季廣達二甲的杏花林，置身其中觸目所見，青鬱蒼蔚間斑斕翻飛，仲春二月，品春茗、賞春花，正是時候。前往貓空爬山者，不乏茶道中人，殊不知山道、茶道與花道原可異途同歸，三合一盡得春遊之樂，杏花林即堪稱典型。  沿著木柵走木新路二段轉恆光街至老泉街口，已是山坡地，進入老泉街不久，就有櫻花及杏花兩側夾道，號稱北台灣最大的杏花園區 - 貓空杏花林。', 3.8, '09:00:00', '19:00:00', 'Sunny'),
(207, 2, '高手庭園保齡球館', '新北市板橋區三民路一段99號', '(02)2963-1899', '高手庭園保齡球館位於板橋的三民路一段上，有附機車與汽車的停車位，這間保齡球館可以說客人非常多，原因很簡單就是他凌晨12點後每局只要15元起，這價位可以說誇張便宜，而且也不限你買的局數，體力夠一次打10局也可以、也不限有沒有會員、更重要的假日也可以。另要注意的是，凌晨12點未滿18歲是不能進場的，所以入口處會檢查證件，打凌晨時段的記得要帶證件。', 3.8, '00:00:00', '23:59:59', 'Any'),
(208, 5, '南港山系-南港山縱走親山步道', '台北市南港區研究院路三段(中華科技大學端)', '(02)2759-3001', '南港山位於臺北盆地東郊，因與四獸山等支稜相連，而成為熱門的登山健行路線。從象山親山步道入口的靈雲宮牌樓進入，沿途石階完備平整，並有步道指引圖，沿線景觀以相思林為主，步道旁多處早覺會闢建的涼亭及坐椅設施，供山友休憩使用，可串連象山、虎山及麗山橋口親山步道同走。', 4.4, '00:00:00', '23:59:59', 'Sunny'),
(209, 5, '南港山系-麗山橋口親山步道', '台北市南港區研究路四段(麗山橋口端)', '無', '從捷運昆陽站搭小12麗山橋站就是登山口，在南港福德祠匯集從中華大學登山來此的路線，左轉一路直上登頂九五峰和南港山，若由信義路五段150巷下山接捷運象山站全程約3小時，也可以前往中華科技大學登山口結束旅程', 3.6, '00:00:00', '23:59:59', 'Sunny'),
(210, 5, '碧山露營場', '台北市內湖區碧山路6-26號', '(02)2794-9435', '內湖「碧山露營場」位於內湖區大崙尾山麓之碧溪產業道路上，是一處可容納250人露宿的露營場，是臺北市僅有的2處露營場地之一，也是全國少有的免費露營場。碧山露營場大致分為三個區域：森林步道、露營區和遊憩活動區。碧山露營場森林步道區內，有長約1公里的棧道，來回行程約半小時，徜徉在碧山蒼翠的樹林內漫步，閒雲野鶴的樂趣，是一大幸福。\n碧山露營場因山區光害少，是臺北觀星最好的地方，山上夜景更是美麗，可遠望觀音山及士林北投夜色。內行人和一些鐵馬族多利用通往此區之金龍產業道路騎遊，一面賞景一面涼風吹來，是一趟美麗的路程。\n(一)活動使用時間：申請核准當日下午2：00 至結束當日下午1：00。\n(二)週二至週日開放申請使用，週一進行環境整理（如遇國定連續假日順延一日)。\n(三)每次申請使用以2天1夜為限。\n(四)場區如遇舉辦大型活動或進行環境整理時，局部區域將暫停開放(屆時以公告為準)。\n(五)專案申請人數達150人以上舉辦大型活動請於活動日前60日向管理單位大地工程處申請。\n(六)春節假期自除夕起至初二止，露營場暫停申請使用。', 4.2, '00:00:00', '23:59:59', 'Sunny'),
(211, 5, '大崙頭尾山親山步道', '臺北市內湖區碧溪產業道路上，屬於「內雙溪森林自然公園」園區', '(02)2759-3001', '通往森林的路徑是寬敞舒適的枕木棧道。全段架高在樹木層中，不但可避免對地表岩石和植物造成傷害，也方便遊客觀察自然；每走一小段路就出現的解說牌，引領我們更了解四周的地質和生態環境。\n共享自然，大家都歡喜。森林中的「原住民」能保有生活空間，所以依然悠遊自在，蟲鳴鳥叫不絕於耳，時常也見松鼠跳躍林間。儘管一路上都在爬坡，豐富的生態不免讓人放慢腳步，或駐足欣賞，或對照解說牌，所以走完全程只覺輕鬆愉快，不會氣喘吁吁。\n若是中途還是想歇歇腳，時常拐個彎，路旁就有枕木平台，可觀景也可歇息。難得在都市的近郊，有長約一公里的天然枕木可踩踏，「識貨」的登山客多半赤腳體驗這舒暢身心的森林之旅。', 4.3, '00:00:00', '23:59:59', 'Sunny'),
(212, 5, '新北市青少年圖書館', '新北市新店區安康路2段151號', '02-2212-8905', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n在圖書館玩密室脫逃？你沒看錯，新店青少年圖書館是全國第一座以青少年為主題規劃設計的圖書館，讓圖書館不僅是兼具知性與人文的閱讀空間，還有著趣味及娛樂，更貼近青少年朋友的心靈。\n發現青少年館在六日會舉辦好多活動！舉凡像是電影播放和講座，以及各種有趣的主題展覽和活動，都十分適合小孩前來體驗，前一陣子展出的「推理小說」主題，不僅介紹多本推理小說，現場還有海巡署鑑識科人員來教小朋友使用鑑識工具，還有因應主題辦近來很夯的密室脫逃遊戲……，讓現場所有年齡層的孩子都玩得相當開心。\n青少年圖書館在推動館內符合青少年的特色方面十分用心，為了讓學生們在溫書之餘能一起討論做報告，這邊規劃了其他館都沒有的「互動討論區」；為了讓青少年們揮灑用不完的體力，還設置了半戶外空間的「街舞區」，只要憑借書證就可免費借用。不能不提的還有四樓親子共讀區，色彩明亮的空間裡，隱藏許多讓孩子看書的秘密基地，兒童的區塊在青少年館同樣也被仔細照顧到。', 4, '08:30:00', '21:00:00', 'Any'),
(213, 5, '新店文史圖書館', '新北市新店區北新路一段92號', '02-2911-5534', '休館日期：每週一、二、國定假日\n新店文史館其實有個更為文青的名字，稱為「玖貳故事巷」。名字的由來是因地址位於92號，而雖隸屬於圖書館管轄，裡頭卻沒有任何書籍，有的是與新店區有關的歷史人文和地理環境，每一部分拆解開來，都是一段值得細細訴說與聆聽的故事。\n身為全國第一座地方文史館，新店文史館有著極為重要的歷史價值，新北市文史學會理事長夏聖禮說，文史館內分為常設展與主題特展，其中常設展重點式提到新店的歷史發展過程，並展示一些由民眾提供的古文物；主題特展則是每年有個固定主題，像是：新店步道、新店水圳……等等，由志工們花半年的時間採訪調查，然後進行撰寫，一字一句都是志工們的努力，和對新店在地的濃濃情感。', 4, '08:30:00', '17:00:00', 'Any'),
(214, 5, '新北市立圖書館(新莊中港分館)', '新北市新莊區中港路350號1、5~8樓', '02-2991-2053', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n中港分館是民國六十八年開館，為新莊區最早的一間圖書館，由於新莊早期特色就在新莊廟街，所以館藏特色定為『傳統藝術』。此館也不負這樣的主題特色，在圖書館中心處，設置方形柱展覽櫃，陳列布袋戲人偶、鈴鼓、紙傘等傳統藝術品。館方人員還用心的用圓形竹簍，貼上”傳統藝術”字樣，點出主題特色。\n中港分館是功能完整的圖書館，占整體建築物的一、五、六、七、八共五個樓層。一樓設有還書箱，最主要的藏書空間則是在五樓、七樓，六樓劃分為兒童閱覽區，最後是八樓的自修室，擁有兩百六十六個座位，也有提供筆電使用的座位。', 3.8, '08:30:00', '21:00:00', 'Any'),
(215, 5, '新北市立圖書館(新莊福營分館)', '新北市新莊區四維路9號3~5樓', '02-2203-7877', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n福營分館位在下新莊最大的市場-四維市場，它坐落在福營行政大樓的三到五樓。圖書館結合當地特色，推出『菜籃漂書』，由館員用菜籃裝著書籍，主動走出圖書館，到市場或是同棟福營行政大樓辦公樓層，贈書給民眾。而這書也不是隨意送，館員會做不同的推薦，比方看到媽媽帶著孩子，就會推薦育兒方面書籍，若是學童，則送繪本，還有阿公阿嬤的話，會推薦健康養生書籍，依照需要，給予民眾不同的書。\n從事圖書館工作長達二十五年的館員，歷經圖書館的多次變遷，她說都市人住公寓大廈多，加上網路時代，缺少人際交流，她說在圖書館反而是最好的交流平台，有很多媽媽帶孩子每天來這邊看書，久了互相都認識，小孩可以一塊看書，大人也可以彼此交流育兒心得，館員說圖書館其實是最有人情味的地方。', 4, '08:30:00', '21:00:00', 'Any'),
(216, 5, '新北市立圖書館(新莊分館)', '新北市新莊區中華路一段2號5~6樓', '02-8992-9009', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n新莊分館，位在捷運共構大樓的五六樓，從新莊捷運站一號出口出來即可到達，是交通最便捷的圖書館。它的空間設計時尚感十足，一踏進新莊圖書館感覺顏色很繽紛，天花板以紅藍黃橘綠色塊所組成的。四周大片落地窗，將都市景色全納入眼簾。這間分館以環保綠意為設計概念。\n最特別的造景就是貫穿兩層樓中心的大樹， 旁邊交錯的樹枝不光是擺飾，嵌入的長型日光燈，更照亮周遭的亮度，這棵樹變成圖書館的舞台中心，讓人不注意到它也難。讀者李維斌說坐在這兒閱讀，就像行光合作用一樣，可以吸收知識的氧氣，排出內心雜亂資訊的二氧化碳，『在這裡看書會讓我特別平靜。』', 3.2, '08:30:00', '21:00:00', 'Any'),
(217, 5, '新北市立圖書館(新莊西盛分館)', '新北市新莊區西盛街216號', '02-2203-5574', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n臺灣島嶼最初的主人就非原住民莫屬了，而在新北市新莊擁有的原住民人口就超過五千多人，是新北市原住民人口最多的前三名，僅次居於樹林區。因此位在新莊的西盛分館，就特別以原住民為館藏特色，讓各族原住民文化可以在這裡『原汁原味』的呈現。  一進西盛分館，就感覺進到原住民的部落，服務櫃台用漂流木風格打造。門口兩個人型模特兒，穿著原住民的傳統服飾，展示櫃裡各種文物，突顯了館藏特色的用心。', 4, '08:30:00', '21:00:00', 'Any'),
(218, 5, '新北市立圖書館(新莊聯合分館)', '新北市新莊區自由街1號', '02-8992-4732', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n『媽咪妳看！天花板也有梯子耶！』媽媽順著孩子目光抬頭看，圖書館天花板的日光燈嵌在木製版上，剛好形成梯子的圖樣，從門口一路通往親子閱覽區整體看過去，宛若一座巨型天梯通向雲中世界，令人驚艷。\n讀者郝佳說，新莊聯合分館不似舊式圖書館的樣子，設計感讓人很願意親近，帶孩子來就彷彿進入夢幻世界，令人想像力開始馳騁。\n兒童圖書室為提供親子互動的遊憩空間，特別增設「玩具」服務設施，與中華民國遊戲協會合作，提供符合「融合遊戲認證標章」玩具，包括：視障、聽障、自閉症、多重障礙、銀髮與親子六項，希望增進讀者對不同群體的尊重、包容和同理心，拉近人與人之間的距離。', 3.4, '08:30:00', '21:00:00', 'Any'),
(219, 5, '新北市立圖書館(新莊裕民分館)', '新北市新莊區裕民街136號4~5樓', '02-2901-9047', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n裕民分館在新建館舍後，採用通用設計，給人通透舒適的閱讀空間，設計主題是以童話世界為主。四樓的中央是『漫畫主題區』，呈現圓弧狀的秘密空間，孩子總愛稱這裡是他們的秘密基地。在閱讀區特別的是它的座位，設計感十足，像是色彩鮮豔的圓球狀的椅子，『書報雜誌區』則用橘色北歐風格的座位，讓人使用起來，感覺氣質也不同。', 4, '08:30:00', '21:00:00', 'Any'),
(220, 5, '大屯山系-忠義山親山步道', '臺北市北投區中央北路四段18巷', '(02)2759-3001', '忠義山又叫小八里分山，石階攀登、林蔭密佈是其最大特色，慢步攀登、享受林間涼爽，是極佳的有氧運動場地。忠義山親山步道位於臺北藝術大學後山，沿途林木密集，路徑遮陽率在百分之九十以上，是一條原始幽靜的步道，對怕晒的山友來說，這裡是最佳之選的路徑；只不過沿途多處石階，尤其是登頂前盡是上坡石階，須不錯的腳力和體力才能勝任，呼吸的節奏更應適時調整，否則會走得氣喘吁吁、上氣接不到下氣。', 4.2, '00:00:00', '23:59:59', 'Sunny'),
(221, 5, '新北市立圖書館(瑞芳分館)', '新北市瑞芳區中正路1號', '02-2497-2980', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n庭院中，一棵雙色吉野櫻靜靜佇立，等待著一歲一次的綻放，以「一期一會」的姿態渡過了十多年的歲月。每當冬末春初，滿樹的芳華總吸引了路人的目光，也吸引了許多人進到庭院中用相機框住這份美麗，儼然成了瑞芳分館的象徵。\n對館員來說，這裡也是她們最愛駐足的地點，在繁忙的圖書業務中，為櫻花樹澆水的時光儼然成了一種小確幸，尤其一陣微風吹下櫻花雨的剎那，彷彿自己成了偶像劇女主角般，油然而生出一股久違的浪漫情懷。', 4, '08:30:00', '21:00:00', 'Any'),
(222, 2, '大魯閣保齡球 土城館', '新北市土城區青雲路152號', '(02)2264-1977', '棒球只是我們的起點，大魯閣目前為全台灣最大連鎖經營之運動休閒企業，至今全台總計設立共「10間棒壘球打擊場」、「4間五星級保齡球運動館」、「全亞洲最頂尖的卡丁車場」及「2間獨家引進澳洲頂尖設備的星際戰場」，我們秉持著致力於台灣運動發展為企業宗旨，透過專業化的經營與服務，提供國人更完善、安全、優質的運動休閒空間。', 4, '11:00:00', '23:00:00', 'Any'),
(223, 5, '新北市立圖書館(萬里分館)', '新北市萬里區瑪鋉路221號4樓', '02-2492-4490', '休館日期：每月最後一個週四、國定假日\n「無敵海景」、「香醇咖啡」，光這兩個關鍵字，就可從新北市102間市立圖書館中，找到唯一符合條件的萬里分館。\n萬里分館具有很好的地理優勢，從館內就能望見北海岸的湛藍海洋、黃金沙灘，以及翱翔天空的滑翔翼，打破「圖書館不能飲食」的既有框架，在館舍內有一部投幣式咖啡機，每杯咖啡20元，如此一來，讀者就能一邊啜飲咖啡、一邊飽覽廣闊海景，更添閱讀時的悠閒氛圍。', 4, '08:30:00', '17:00:00', 'Any'),
(224, 5, '新北市立圖書館(樹林分館)', '新北市樹林區中山路二段80號3樓', '02-2675-7321', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n緊鄰鐵道旁的地緣關係，南來北往的火車行駛聲，劃過靜謐的圖書閱覽空間，讀者沉浸於書香同時，伴隨著火車輪衝擊鋼軌發出的「哐噹、哐噹」撞擊聲，抑或參與動態人文的研習推廣課程，藉由圖書館與生活互動！走進樹林分館，將帶給您一場豐富的閱讀饗宴。', 4, '08:30:00', '21:00:00', 'Any'),
(225, 5, '五指山系-忠勇山親山步道', '台北市內湖區碧山路24號', '(02)2759-3001', '忠勇山、鯉魚山親山步道起點位於內湖大湖山莊站旁，沿線經過數個著名的寺廟有碧山巖、金龍寺、圓覺禪寺等，而景致優美的圓覺瀑布也在其中，步道居高臨下、眺望臺北市街景，視野及景觀極佳。沿著步道緩步上行，會聽到大溝溪淙淙的溪水聲，循著大溝溪木造長廊前行，溪谷與山林襯映，一路走來格外清新舒暢。越往裡走步道林相越顯茂密，綠蔭遮天、小花伴隨，偶而還可聽見五彩羽鳥鳴聲高唱，讓人興奮不已。步道盡頭為內湖路三段的金龍禪寺所在，在路旁十八羅漢相送之下，這一段親山步道行程即將畫下據點。\n忠勇山的最高點有座蔣公銅像，若從金龍寺方向往上走，沿途的石階又多又陡，像是在爬好漢坡一般，是條較不省力的反向登走。置身忠勇山頂，幾乎可見大半個臺北市區景象，這也見證了過去忠勇山曾是內湖舊八景之一。', 4.1, '00:00:00', '23:59:59', 'Sunny'),
(226, 5, '五指山系-金面山親山步道', '台北市內湖區環山路二段', '(02)2759-3001', '金面山親山步道位於內湖環山路德明財經技術大學旁，步道自起點開始就可見幾近垂直的大岩壁，沿途盡是古樸的砂岩石階，隨著坡度漸漸上升，石階路改由直徑超過100公尺以上的大岩壁取代，登上半山腰，有一處清代採石場的石堡瞭望台，是明顯的地標，山頂巨岩間當然是一處眺望臺北市景、基隆河沿岸的最佳駐腳點。而步道沿線向東再經過小金面山不久便來到內湖路三段金龍禪寺附近，也是這段親山步道的尾聲。', 4.5, '00:00:00', '23:59:59', 'Sunny'),
(227, 5, '內雙溪自然公園', '台北市士林區至善路三段150巷27號', '(02)2841-4705', '位於士林區東南角之內雙溪自然公園，占地104公頃，為臺北市最大的森林自然公園，以豐富的生態與地形等特色，媲美溪頭的風貌，所以又稱『臺北小溪頭』。臺北市政府大地工程處斥資整建，規劃並建置登山步道、觀景台和產業道路，串連起內湖及士林兩區的內雙溪山區，並整合內雙溪森林、自然公園、碧山露營場、白石湖農村社區及周邊景觀生態等資源。\n※六日一公休', 3.9, '09:00:00', '17:00:00', 'Sunny'),
(228, 5, '五指山系-白鷺鷥山親山步道', '台北市內湖區成功路五段35巷', '無', '白鷺鷥山親山步道為內湖大湖公園旁，這條步道因左彎右拐、蜿蜒繞行而上，因此又叫五十彎步道，通常走至半途就已分不清東西南北方向了，所以指北針在這時是相當好用的。白鷺鷥親山步道谷地古老的蕨類植種類豐富，像是筆筒樹、觀音座蓮，其他如相思樹、江某樹也都長得頭好壯壯，能散發出令人心曠神怡的芬多精。', 4.1, '00:00:00', '23:59:59', 'Sunny'),
(229, 5, '碧湖步道', '台北市內湖區內湖路三段60巷32號', '(02)2759-3001', '碧湖步道連結內湖路三段60巷12弄與大湖街131巷間，總長1,327公尺，當地動植物資源相當豐富，沿途可見台灣藍鵲、大冠鷲、赤腹松鼠、緣點白粉蝶等棲息出沒，且當地氣候、水文、土壤條件適合，相思樹林、大葉楠、蕨類、原生耐陰性植物等皆生長茂密。且因省轄時期，當地煤礦業興盛，林區特於1k+000處規劃一處復舊礦坑意象景點，包括礦坑隧道、軌道、及裝滿煤渣的礦車等，題名為「新福本坑」，供民眾了解其地方歷史及文化產業之脈絡。周邊鄰近忠勇山、鯉魚山、圓覺寺登山步道、圓覺瀑布、大湖公園等熱門景點，是民眾早晚健行、週末休閒的好處。', 4.1, '00:00:00', '23:59:59', 'Sunny'),
(230, 5, '擎天崗大草原', '台北市士林區菁山路101巷246號', '(02)2861-5404', '擎天崗草原又稱太陽谷，其位於大屯山群彙的中央，及竹子山、七股山與頂山，磺嘴山之中間按部，地勢平坦，源於竹篙山熔岩所形成的階地。日據時期日本人就在此設置大嶺峙牧場，作為種茶、放牧用途。台灣光復後政府依據原大嶺峙牧場中擎天崗、冷水坑一帶的規劃設置了陽明山牧場。台北市改制為院轄市以後，此牧場即歸屬台北市農會經營。現在在擎天崗可看到放牧的牛隻，是北投、士林，金山等地的農民所寄養的。擎天崗地勢平坦，又有連綿的草原，綠草如茵，是觀察草原景觀最佳的自然教室。青綠綿延的草坡與渾圓矮生的樹叢步道是令人印象深刻，也成為陽明山國家公園中最受民眾歡迎的踏青去處。', 4.5, '00:00:00', '23:59:59', 'Sunny'),
(231, 5, '新北市立圖書館(雙溪分館)', '新北市雙溪區太平路50號3樓', '02-2493-3768', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-19:00\n兒童室裡分成兩個區塊，靠窗木質地板的區域，一群小小孩正拿著繪本專注閱讀；另一邊，小學生正在為孩童身高訂做的桌椅上寫著功課，恍然間，圖書館彷彿搖身一變成了安親班教室。\n在雙溪，這個身處偏鄉地區的圖書館其實不單單是提供書報閱讀而已，還兼具多樣性功能，分館主任說，這裡的館員常常得要幫忙民眾照顧小孩、幫忙保管從樓下市場提上來的菜、接家長打來尋找孩子的電話、偶爾還得教孩子寫功課……，而濃濃的「人情味」始終是貫穿這所有功能的重點。', 4, '08:30:00', '19:00:00', 'Any'),
(232, 5, '新北市立圖書館(蘆洲永平分館)', '新北市蘆洲區永平街1號3樓', '02-2847-9964', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n蘆洲永平分館藏書近四萬冊，光兒童區就有一萬冊。館藏原本以自傳類居多，現在各類都很平均。設置樂齡專區，以健康養生類書籍居多，為了服務老人家，書櫃最下方不放書，這是考量到很多長者膝蓋不好，不易蹲下，另外也附有放大鏡，貼心舉動讓長者覺得窩心，另外報紙區，不同於一般圖書館只有當日報紙，館方特別放置大型書櫃，供讀者查閱一個月內的舊報紙。', 3.4, '08:30:00', '21:00:00', 'Any'),
(233, 5, '花博公園', '台北市中山區玉門街1號', '(02)2182-8886', '花博公園為2010臺北國際花卉博覽會會場，目前轉型為都市公園。園區包含圓山園區、美術園區與新生園區，規劃作為一般的公園使用，並利用原花博展覽館，提供各項活動場地使用。在博覽會後保留了立體植栽花牆、造型花牆、七道彩虹、特展區、地景花海、精緻花卉及果樹園區等展示區域，也規劃種植多年生觀花觀葉植物、草皮為主，以期保留部分花博意象與豐富度，留予民眾開闊且綠意盎然的視覺空間，同時還可提升休憩環境品質，更因鄰近捷運圓山站享地利之便，適合作為活動展覽用地。', 4.2, '00:00:00', '23:59:59', 'Sunny'),
(234, 5, '新北市立圖書館(蘆洲長安分館)', '新北市蘆洲區長安街96號3樓', '02-2847-5873', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n位在蘆洲的長安分館，民國102年7月整修完畢，大門入口以及服務檯皆以太空艙為意象。館內的設施規劃以自然天文科學為主題，空間設計活潑互動性高，是一座兼具休閒性、娛樂性與教育的主題圖書館，進入圖書館就像是進入太空世界，可以一站一站的探險。\n長安分館的館藏特色就是自然科學，兩萬多本館藏，光科學類就八千冊，是新北市圖書館中科學類藏書量最多的一館。放著藏書的十五個書架，以飛碟為中心，向外呈現放射狀，讓讀者在圖書館內任何一個角度，都有置身太空中的錯覺。', 4, '08:30:00', '21:00:00', 'Any'),
(235, 5, '新北市立圖書館(蘆洲集賢分館)', '新北市蘆洲區集賢路245號4樓', '02-8283-1792', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n有人說，生命要浪費在美好的事物上，對蘆洲市民來說，待在圖書館就是一種生活態度。\n走在一幅幅畫像前，三三兩兩的人，駐足欣賞。這樣的場景，出現在圖書館，是不是多了些文青味道? 沒錯! 在圖書館內也能欣賞藝術，這是集賢分館的特色。\n集賢分館位在行政大樓內，旁邊又有菜市場跟公園，本身使用率極高。圖書館占大樓的兩層樓，四樓是書庫，七樓是藝文中心。書庫藏書驚人，超過十萬冊，是蘆洲境內圖書館，書籍最多的一館。\n而藝文中心有近60坪的展場空間，每年辦理至少8檔視覺藝術類展覽，每檔展期約23~30天不等。它是蘆洲唯一設有藝文中心的圖書館，一個月使用人次約一千人，館方推動藝文方式是與在地文化藝術做結合，目前最高紀錄在新北市藝術家聯展，當月展場人次就達到一千五百人次。\n整體而言，集賢分館在民國104年國家圖書館評鑑，在講座規劃安排以及場地上，民眾滿意度高達百分之九十六的佳績，也讓館方人員有信心繼續推出新活動。', 4, '08:30:00', '21:00:00', 'Any'),
(236, 5, '新北市立圖書館(蘆洲兒童親子分館)', '新北市蘆洲區集賢路221巷11號2~3樓', '02-2288-8294', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n蘆洲兒童親子分館是新北市占地最大的親子圖書館，位於重陽公園內，整體建築三層樓，圖書館在二樓以及三樓。此館自民國九十九年開幕，館藏特色是親子，館藏含期刊和漫畫超過兩萬冊，以兒童繪本的數量最大。二樓的書籍適合幼稚園到小學以上孩子，三樓則適合0-6歲的親子閱讀區，人氣最高的玩具區就在這樓層。\n玩具圖書館，就是將原本應該陳列在架上的圖書換成玩具，依照圖書館的方式來整理、保管、借閱玩具。三樓的玩具區就擁有這樣的功能，玩具超過一百二十組，整齊的放置在櫥櫃，由館方人員定時清潔消毒。另外設有親子互動區，供親子在這區域遊戲，孩子們去租借玩具同時也可借一張軟墊，打造專屬親子間的小小空間。', 3.9, '08:30:00', '21:00:00', 'Any'),
(237, 5, '新北市立圖書館(鶯歌分館)', '新北市鶯歌區中山路150號', '02-2678-0220', '休館日期：每月最後一個週四、國定假日\n週日~一：8:30-17:00/週二~六：8:30-21:00\n自從地下一樓兩百多坪的兒童玩具室開幕後，鶯歌分館搖身一變為最受小朋友歡迎的圖書館。孩童們的歡聲笑語、因興奮顯得紅撲撲的臉蛋、甚至因不想離場大哭的模樣，也成了鶯歌分館每天必定重複出現的景象。\n「兒童玩具室是鶯歌分館最大的特色與驕傲。」分館主任說，這是全新北第九個兒童玩具室，也是最大的一個，不僅像其他玩具室提供出借玩具服務，還有：學齡前兒童遊戲區、遊戲球池、親子磁鐵拼圖區、桌上遊戲區、故事劇場區、影音區、家長休憩區，幾乎是坊間收費昂貴的親子館規模，相當受到民眾的歡迎，甚至許多桃園的民眾也都時常帶著小孩過來，感受玩具室的驚人魅力。', 4, '08:30:00', '21:00:00', 'Any'),
(238, 3, '國立故宮博物院', '台北市士林區至善路二段221號', '(02)2881-2021', '國立故宮博物院於1965年在外雙溪落成，中國宮殿式的建築，一至三樓為展覽陳列空間，四樓為休憩茶座「三希堂」，藏有全世界最多的中華藝術寶藏，收藏品主要承襲自宋、元、明、清四朝，幾乎涵蓋了整部五千年的中國歷史，數量達65萬多件，國立故宮博物院擁有「中華文化寶庫」的美名。國立故宮博物院除了展覽品豐富以外，提供中、英、法、德、日、西、韓等七國語言專業導覽，並定期舉辦各類文物研習課程、專題演講及巡迴展出活動，出版百種以上的刊物及專輯，實為世界的文化寶地，國立故宮博物院是來臺灣旅遊的必訪之地。', 4.5, '08:30:00', '18:30:00', 'Any'),
(239, 5, '國家圖書館', '臺北市中山南路20號', '(02)2361-9132', '國家圖書館負有「完整保存國家圖書文獻」的歷史使命，收藏當代國內出版品最為完整，又以善本古籍、台灣出版書刊、政府出版品、博碩士論文為特色。全館提供約1,100個閱覽席位，以提供多元化服務，滿足讀者使用需求。\n休館日：每個星期一及國定假日停止對外開放。', 4.5, '09:00:00', '17:00:00', 'Any'),
(240, 1, '新莊國民運動中心', '新北市新莊區公園路11號', '(02)7728-8898', '1F：游泳館、體適能館、綜合教室、運動用品店\r\n\r\n2F：羽球館、攀岩館、桌撞球館、韻律教室、多功能教室、棋藝區\r\n\r\n3F：飛輪教室、室內慢跑道、兒童遊戲室、高階訓練室、閱覽區\r\n\r\nR1+R2：戶外休閒廣場、綠屋頂步道、景觀平台\r\n\r\nB1：街舞廣場、溜冰場\r\n\r\nB2+B3：停車場\r\n\r\n景館樓+二館：舞蹈教室、戶外籃球場、樂活健康促進中心', 4.3, '06:00:00', '22:00:00', 'Any'),
