(278, 2, 'Flip Out 跳跳床樂園', '台北市中山區中山北路二段59巷45號B2', '(02)2567-6768', '還在煩惱假日出遊地點嗎？\n全台唯一,第一家 Flip Out 彈翻床是你最佳的選擇\n五六日9:30開門\n人頭計費\nPay by people\n250元/1小時\n250NTD/1hr\n400元/2小時\n400NTD/2hr\n3小時只要580元！\nOnly 580. NTD for 3 hours!!!', 3.9, '10:30:00', '21:00:00', 'Any'),
(279, 4, '台北花市', '台北市內湖區新湖三路28,36號', '(02)2790-9729', '台北花市為全台規模最大的花卉零售批發市場，各式鮮切花、葉材、盆花，及花卉相關資材應有盡有！', 4.3, '04:00:00', '12:00:00', 'Any'),
(280, 4, '台北市建國假日花市', '台北市大安區建國南路一段', '(02)2702-6493', '在週末走訪建國南路，總是會有愉快的感覺，原本高架橋下冷冰冰的停車場，到週末假日搖身一變，成為花園、草原、針葉林、闊葉林等不同面貌。各家園藝老闆帶著自己精心挑選的植物，讓假日花市就像是都市的花園，每週吸引2, 3萬的人潮來逛花市。假日花市占地8000餘平方公尺，約兩百多個展售位，提供各式各樣的盆栽花卉、鮮花、苗木，茶葉、種子、肥料、園藝資材，應有盡有，還可以跟商家請教相關的花卉知識與寶貴經驗。不管是休閒、賞花、買花、品茗等，到此一遊必有斬獲。\n此外偶有街頭畫家，在此人像素描，一筆一畫中，吸引人們的目光，也算是花市裡特殊的人文景觀。不定時舉辦的DIY親子教學活動，讓爸爸媽媽可以跟孩子們一起同樂，想上一堂植物的寶貴課程嗎？假日時不妨來這裡走走吧！', 4.2, '09:00:00', '18:00:00', 'Any'),
(281, 4, '台北花卉村', '台北市士林區延平北路七段18-2號', '(02)2810-1969', '你能想像嗎？約一萬坪的灰色砂石場，也能變身為充滿花草園藝的快樂天堂!台北花卉村原本是個塵土飛揚的砂石場；在2003年，經過種花、植樹，以及愛心灌溉與用心經營，才成為花香四溢、綠光閃爍的美麗花園。\n現在，人們到台北花卉村可以悠閒自在地親近各種花卉香草園藝、享受庭園精緻美食、快樂踏騎單車、盡情嬉遊氣墊遊戲、動手創意DIY陶藝…。台北花卉村更用心規劃各式講座、展覽，讓現代人輕鬆品味生活。\n※週一公休', 4, '09:00:00', '19:00:00', 'Any'),
