(287, 3, '新北市立十三行博物館', '新北市八里區博物館路200號', '02-2619-1313', '十三行位於新北市八里區淡水河海口交界處的南岸，1957年地質學者林朝棨在這裡確認發現史前的煉鐵遺跡後，將它定名為十三行遺址。之後陸續有多位考古學者在此進行發掘，出土陶器、鐵器、墓葬等各類豐富的遺物。經研究得知，十三行人生活在距今1,800～500年前，屬於臺灣史前的鐵器時代，是目前確定擁有煉鐵技術的史前居民之一。\n至於十三行人為什麼在這裡生活了一千多年後突然消失，仍然是個謎，只是從一些證據看來，十三行人很有可能是平埔族凱達格蘭人的祖先。\n至於為什麼將它命名為「十三行遺址」呢？根據考古學習慣，史前遺址的命名大多採用發現地的最小地名，而十三行遺址之得名，就是因為遺址所在地，新北市八里區頂罟里的別名為「十三行庄」，又相傳在清朝時，這裡曾經是重要的貿易商港，有多達十三家行郊在此經商，所以大家就將這裡稱做「十三行」，但也有學者主張「十三行」應是原住民地名漢語音譯的結果。\n一般開放時間\n➲週一至週日 09:30－17:00\n夏季延長開放時間（4月至10月）\n➲週一至週五 09:30－18:00\n➲週六至週日 09:30－19:00\n休館時間\n每月第一個星期一（若適逢國定假日照常開放，隔日休館）', 4.1, '09:30:00', '19:00:00', 'Any'),
(288, 3, '新北市立淡水古蹟博物館 紅毛城', '新北市淡水區中正路28巷1號', '02-2623-1001', '淡水紅毛城其實指的是紅毛城園區，園區裡有荷西時代、清領時期以及日據時代的建物，主要參觀的建築有兩棟。一為荷蘭人於1644年興建的四方形城堡，當時城堡以荷蘭的亞洲總督安東尼•范•帝門（Antonio van Diemen）之名，命名為「安東尼堡」（Fort Antonio），為今日我們所稱的紅毛城。 1860年代英國租借紅毛城作為領事館使用。自淡水港貿易額大增後，英國商務拓展，領事館的業務也日漸龐雜，地位變得越來越重要。因此，英國領事於紅毛城東側增建洋樓，作為領事生活居住處所。\n開放時間：(閉館前30分鐘不再售票)\n週一至週五 9:30—17:00\n週六至週日 9:30—18:00\n夏季延長開放時間（4月至10月，僅戶外區）：\n週一至週五 9:30—20:00\n週六至週日 9:30—20:00\n休館時間：\n每月第一個星期一（逢國定假日照常開放，翌日休館）', 4.2, '09:30:00', '20:00:00', 'Any'),
(289, 3, '新北市立淡水古蹟博物館 滬尾礮臺', '新北市淡水區中正路1段6巷34-1號', '02-2623-5390', '制高的地理位置與堅固的建材，打造出的宏偉砲台，可說是十九世紀戰爭與駐軍的最佳軍事堡壘，也是清代臺灣現代化的重要海防設施。 滬尾礮臺位於淡水五虎崗的第一崗，位於至高處，過去可直接遠眺淡水河口及關渡大橋，今日則為樹木遮蔽。滬尾礮臺坐北朝南，西側為新北市忠烈祠，東側為臺灣高爾夫球場，北側為雲門舞集。\n開放時間：(閉館前30分鐘不再售票)\n週一至週五 9:30—17:00\n週六至週日 9:30—18:00\n休館時間：\n每月第一個星期一（逢國定假日照常開放，翌日休館）', 4.1, '09:30:00', '18:00:00', 'Any'),
(290, 3, '新北市立淡水古蹟博物館 小白宮', '新北市淡水區真理街15號', '02-2629-2865', '前清淡水關稅務司官邸位於昔稱的「砲臺埔」地區，為淡水河口數來第二個山崗位置的至高處。1860年代淡水開港通商，這裡成為洋人在淡水經商、貿易、居住的主要地區，當時興建許多異國風貌的建築，而小白宮即為其中的一棟，屬於殖民地式建築。\n殖民地式建築之特徵有抬高地基、四周有類似迴廊之 Verandah（涼台）的設置、落地門窗、煙囪等等。在地人習慣由房屋外觀的顏色為西式建築命名，由於前清淡水關稅務司官邸室內外皆漆成白色，因而被在地人暱稱為「小白宮」。\n開放時間：(閉館前30分鐘不再售票)\n週一至週五 9:30—17:00\n週六至週日 9:30—18:00\n休館時間：\n每月第一個星期一（逢國定假日照常開放，翌日休館）', 4.1, '09:30:00', '18:00:00', 'Any'),
(291, 3, '新北市立淡水古蹟博物館 淡水海關碼頭', '新北市淡水區中正路259號', '02-2623-1001', '海關碼頭園區位於淡水紅毛城下坡的低矮平台上，視野良好，可遠眺淡水河口及關渡大橋，四周景觀盡收眼底。淡水海關碼頭在臺灣近代史上一直扮演著重要地位。\n一百五十公尺的淺水碼頭共分三段，由觀音石或唭哩岸岩交丁相砌而成，工法精純，以及洋樓與兩座歷史悠久的港務倉庫，均是淡水港埠時代的見證物。\n開放時間：週一至週日\n室內 9:30—19:30\n戶外：全天開放\n休館時間：\n每月第一個星期一（逢國定假日照常開放，翌日休館）', 4.2, '09:30:00', '19:30:00', 'Any'),
(292, 3, '新北市立淡水古蹟博物館 得忌利士洋行', '新北市淡水區中正路316號', '02-2629-9522', '淡水老街中正路末段，舊稱「烽火段」，早年淡水河水深足以停泊大型船隻，且靠近東側漢人街市，產業運輸補給較為便利，成為淡水開放通商口岸後非常重要的港埠區域，洋行林立。「道格拉斯洋行」（Douglas Lapraik & Co.），清末文獻檔案稱「得忌利士洋行」，為淡水前五大洋行之一，目前僅存兩棟，前棟為「第一檢查場」，後棟為「輸入品倉庫」。較特別的是「得忌利士洋行」除具備一般洋行的貿易功能外，航運更是其主要業務，曾獨佔臺灣航路三十年之久，不僅見證淡水開港後的蓬勃發展，也在臺灣重要歷史事件中留下痕跡，包括馬偕博士來台所搭乘的就是「得忌利士洋行」旗下的「海龍號」輪船。\n開放時間：\n週一至週五 9:30—17:00\n週六至週日 9:30—18:00\n休館時間：\n每月第一個星期一（逢國定假日照常開放，翌日休館）', 3.9, '09:30:00', '18:00:00', 'Any'),
(293, 3, '新北市立淡水古蹟博物館 淡水藝術工坊', '新北市淡水區中正路298號', '02-2628-2610', '淡水藝術工坊（Tamsui Art Gallery,TAG）於2011年啟用，不僅是新北市首座公共綠建築，更被評選為臺灣「鑽石級」綠建築。其基地原址於日治時期是一座四連棟形式的日式警眷宿舍，建物本身保留了原址拆除的瓦片，運用於新建築物室內裝修上，保留歷史的記憶，亦透過高聳的煙囪形體，創造明顯地標性標的，吸引著走在中正路或淡水河岸的人們的目光。', 3.5, '11:00:00', '21:00:00', 'Any'),
(294, 3, '新北市立淡水古蹟博物館 滬水一方', '新北市淡水區觀海路91號3F', '02-2805-0308', '本空間完整結合了觀光旅遊、休閒活動、藝術展演、與商業創意四大面向，透過完善的展場規劃與主題策展的呈現，促進國際藝術交流並讓藝術深入居民生活，行銷淡水河口藝遊網及北海岸藝文發展；將地區的觀光功能再升級，賦予淡水漁人碼頭嶄新的生命與能量，交織出新北市精緻豐富的商業、人文與藝術空間。\n開放時間：\n週一至週五 10:30—17:00\n週六至週日 10:30—18:00\n休館時間：\n每月第一個星期一（逢國定假日照常開放，翌日休館）', 3.7, '10:30:00', '18:00:00', 'Any'),
(295, 3, '新北市立淡水古蹟博物館 公司田溪程氏古厝', '新北市淡水區新民街1段138巷7號', '02-2805-6610', '清乾隆年間，程耀事由晉江縣來臺定居，為淡水程氏家族殖業起家之始祖。古厝的創建年代已不可考，據學者專家的研判應在1884年清法戰爭之前，當清法戰爭滬尾之役時，清軍曾於此駐兵並圍剿法軍致勝。\n本宅第為一典型的三合院農舍，周遭有竹葦環繞、渠水流過，可為在地傳統農宅之典範。五間火庫起雙護龍式建築，屋脊採用金型馬背，牆身則使用在地盛產之安山岩配合土埆磚砌築，明間防禦性銃孔（抵禦當時盜匪用）以及外側山牆穿瓦衫（保護土埆磚避免雨水潤濕），為淡水地區同類型建築中少見，充分展現古建築之美及前人智慧。\n開放時間：\n週二至週日 11:00—17:00\n休館時間：\n每個星期一、每月第一週週二', 4.1, '11:00:00', '17:00:00', 'Any'),
(296, 3, '新北市立黃金博物館', '新北市瑞芳區金瓜石金光路8號', '02-2496-2800', '本館的規劃概念，出自生態博物館（Eco-Museum）。所謂生態博物館，就是在一個有著完整生活、文化圈的地域範圍內，以它本身的自然及文化資源作為博物館的主體，並由地域內的居民們參與其中。參觀者可以藉由參觀幾個核心館所，加上和地區內的居民接觸、互動，而對這個地域內的人文、生態有多面向且立體、實際的了解，達到「參觀博物館」的目的。博物館知性之旅，在這樣的概念下，呈現的是過去與現在的礦山故事，豐富的心靈之旅，是體驗與發現金瓜石特殊的自然生態以及歷史人文之美，期盼這裡的人、事、物一同走向更美好的未來，在這片土地上實踐夢想及留下美好的黃金足跡。\n開館時間：週一～週五09:30~17:00，週六，週日及國定假日09:30~18:00\n休館時間：每月第一個星期一(若適逢國定假日照常開放，隔日休館)', 4.1, '09:30:00', '18:00:00', 'Any'),
(297, 3, '新北市立鶯歌陶瓷博物館', '新北市鶯歌區文化路200號', '02-8677-2727', '新北市立鶯歌陶瓷博物館於2000年11月26日正式開館啟用，是臺灣第一座以陶瓷為主題的專業博物館，致力於臺灣陶瓷文化之調查、收藏、保存與維護，從事研究、典藏、展示及教育推廣工作，也積極促進國際交流合作，開放國際藝術家駐村並加入國際博物館協會、與德國及西班牙博物館簽訂姊妹館，更取得「2018國際陶藝學會世界年會」主辦權，將臺灣陶藝之美遠播國際，展現臺灣陶瓷文化與當代陶藝創作的活力。\n參觀時間\n平日：09:30-17:00 \n假日：09:30-18:00\n休館時間\n每月第一個星期一 (若遇國定假日或連續假期照常開放，實際休館日期依當年公告為主)', 4.3, '09:30:00', '18:00:00', 'Any'),
(298, 3, '坪林茶業博物館', '新北市坪林區水德里水聳淒坑19-1號', '02-2665-6035', '文山包種茶的產製和銷售，為坪林區最重要的經濟資源，當地居民80%以上為茶農，茶園面積近千公頃，讓坪林具有獨特茶區特色，是一個充滿豐富資源與觀光潛力的美麗茶鄉。\n於民國86年成立的坪林茶業博物館，坐落於坪林區北勢溪畔，佔地近3公頃，是一座閩南安溪風格的四合院建築，以婉約深遂的江南庭園之美，結合當代建築語彙，架構這座雅致沉靜的茶文化殿堂。\n博物館內含展示館、體驗館、茶藝教室等空間，並由館方定期辦理各式茶相關主題特展，帶領國人認識臺灣茶產業與中、外茶文化，同時舉辦豐富有趣的教育推廣活動，重新演繹「茶」在當代的無限可能， 述說一心二葉嫩芽下的無數動人故事，帶領大家在茶香中發現自然與人文的美好，看見茶鄉中最美的文化風景。\n開放時間：\n週一至週五 09:00—17:00\n週六及週日 09:00—17:30\n(閉館前30分鐘停止售票)\n休館時間：\n每月第一個星期一（若適逢國定假日照常開放，隔日休館）', 4, '09:00:00', '17:30:00', 'Any'),
(299, 3, '林本源園邸', '新北市板橋區西門街9號', '02-2965-3061', '板橋林本源園邸，是目前臺灣僅存最完整的園林建築。古時候的豪門富商，為了追求居住的生活享受，或是希望利用精緻的園林建築來招待官家或生意往來的巨賈，往往不惜鉅資，興建精緻優美的園林庭園。但是由於天災或戰亂，以及時代的遞移，這些中國式園林庭園現在多已殘破不堪，有的早已消失，僅存於文人筆墨或歷史紀錄之中。何其有幸的是，板橋的林本源園邸，從民國三十八年後屢遭破壞而日益傾頹，歷經多位文物專家根據考據，多次整飭修建，現在恢復了昔日的部分舊貌。板橋林本源園邸可以說是先人所遺留下來的珍貴歷史遺產，是一座認識臺灣歷史與傳統建築的寶庫。\n由入口進來是可觀賞風景的觀稼樓，緊接著是三落大厝及方亭以及書庫汲古書屋，再往前走有讀書觀戲的方鑑齋，可遠眺景色的來青閣，再往前走幾步有橫虹臥月和可觀賞花木的香玉簃，再往前走有賞月的月波水榭及可宴客的定靜堂，最後在出口外有榕蔭大池。\n開放時間\n每日 09：00 — 17：00\n每週五夜間延長開放至19:00 (為了遊客安全，榕蔭大池夜間暫不開放)\n休館時間\n每月第一個星期一 (若適逢國定假日照常開放，隔日休館)', 4.3, '09:00:00', '17:00:00', 'Any'),
(300, 3, '新北市客家文化園區', '新北市三峽區龍埔里27鄰隆恩街239號', '02-2672-9996', '新北市客家文化園區經營內容多樣，包括歷史、文化及語言，且著重教育與推廣功能之目標，透過精緻的傳統客家文物蒐集、保存、展示，細膩的融合傳統文化與現代創意思維，使新北市客家文化園區具備觀光、教育與休閒的功能，深層感受客家文化之美，達成發揚客家與推廣文化旅遊的目的。\n開放時間\n週一至週五　9:00-17:00\n週六、日　9:00-18:00\n休館時間\n每月第1個星期一休館，倘休館日遇國定假日，以順延1週辦理休館', 3.8, '09:00:00', '18:00:00', 'Any'),
(301, 3, '新北市烏來泰雅民族博物館', '新北市烏來區烏來街12號', '02-2661-8162', '烏來泰雅民族博物館規劃朝生活博物館的營運方式，展示內容除傳統泰雅歷史文化與生活器物資料展示外，並包含整個烏來地區的自然生態與文化資源，擴及社區居民的共同參與，結合部落帶動原住民文化觀光發展，市府期盼透過烏來泰雅民族博物館的有效經營，活化泰雅傳統文化，並重建民族自信心，拓展民族視野，再創烏來泰雅的新象。烏來泰雅民族博物館規劃朝生活博物館的營運方式，展示內容除傳統泰雅歷史文化與生活器物資料展示外，並包含整個烏來地區的自然生態與文化資源，擴及社區居民的共同參與，結合部落帶動原住民文化觀光發展，市府期盼透過烏來泰雅民族博物館的有效經營，活化泰雅傳統文化，並重建民族自信心，拓展民族視野，再創烏來泰雅的新象。\n開放時間\n週一至週五9:30-17:00\n週六及週日9:30-18:00\n免費入場\n休館時間\n每月第一個星期一', 4.2, '09:30:00', '18:00:00', 'Any'),
(302, 3, '泰山區娃娃產業文化館', '新北市泰山區楓江路26巷26號4樓', '02-8531-1406', '娃娃博物館中除了將介紹歐、美、日各國不同脈絡的娃娃文化之外，並提供各地到泰山參觀的娃友各式娃娃的資訊，以及一個交流切磋的空間。緊接著迎目而來的，便是娃娃展示區。這裡所展示的每一個姿態萬千的娃娃，都是種子教師運用家中剩餘的布料，靠著心中的巧思，一針一線縫製而成的精心創作。同時，本區也有也有娃娃以及娃衣、材料包的銷售，讓參觀的嘉賓有機會擁有泰山社區精心設計製作的娃衣，有心的人，更可以體驗一下DIY手作娃衣的樂趣\n開放時間：週二至週日9:30~17:00，週一及國定假日休館。', 4, '09:30:00', '17:00:00', 'Any'),
(303, 3, '世界宗教博物館', '新北市永和區中山路1段236號7樓', '02-8231-6118', '世界宗教博物館希望藉由博物館的典藏、展覽、活動、研究、出版等等，呈現出宗教的力量，增進觀眾對世界宗教共同的認識，同時表現每一宗教力量的獨特之處。本宗教博物館的宗旨，在於促進所有人種和宗教彼此間的敬重，以應對現代社會逐漸複雜的各項挑戰。本館尊重每一傳統的珍貴遺產，以及各傳統皆視如珍寶的精神教誨，並希冀它們與不同的文化和世代互動時，能夠更深入地了解這些無價的訓示，觀眾在觀察和賞析世界各主要宗教發展的過程中，將可從各宗教的藝術表現、文獻經典、音樂、宗教儀式和建築特色裡，拓展他們個人或文化的經驗。我們希望經由本館，不同宗教信仰的人們能夠一同努力提昇世界和平、增進人類的福祉。本館讚揚對人類共同真理信念的覺醒，以及各信仰與傳統獨一無二的特質。這是一座人類靈性的博物館。\n開館時間\n開放時間：每週二至週日10:00-17:00\n休館日：每週一、除夕、大年初一～五', 4.3, '10:00:00', '17:00:00', 'Any'),
(304, 3, '朱銘美術館', '新北市金山區西勢湖2號', '02-2498-9940', '朱銘是一位極度重視原創力的藝術家，在他的美學系統裡，「種子」是非常核心的意象，他認為，將藝術的種子，種活在心田，當種子活了，藝術便主宰了創作者，創作者於是成為藝術的使者。藝術的種子如何具備生機活力？別無他法，唯有透過「修行」的方式。\n開館時間：\n5月～10月：10:00-18:00（17:00停止售票）\n11月～4月：10:00-17:00（16:00停止售票）\n5月到10月為草坪開放期，歡迎您於其上活動；11月到4月為草皮保養期，請勿踐踏。\n休館日：\n每週一休館，逢國定假日則照常開放', 4.3, '10:00:00', '18:00:00', 'Any'),
(305, 3, '李梅樹紀念館', '新北市三峽區中華路43巷10號', '02-2673-2333', '紀念館設立之宗旨在紀念前輩畫家李梅樹先生。於三峽（三角湧）土生土長的李梅樹先生（1902-1983），生前致力於藝術創作，美術運動，一輩子堅持以東京美術學校習得的寫實路線，擁抱台灣鄉土之美，被稱為台灣美術運動中的「萬里長城」。\n本館除了展出李梅樹先生不同時期的畫作，另一方面，李梅樹生前的書信文件，畫具和畫稿等，也於館內的文物陳列室一一展出。\n期盼透過本館的展覽，不僅使參觀者得以體會藝術家創作生涯的心路歷程，更能進一步明瞭，李梅樹的一生正是台灣美術走向本土化的縮影。\n開放參觀時間:每週六、日，10:00AM ~ 05:00PM', 4.3, '10:00:00', '17:00:00', 'Any'),
(306, 3, '三峽歷史文物館', '新北市三峽區中山路18號', '02-8674-3994', '歲月的洪流帶走了許多再也無緣一見舊時景象。透過老照片與文物、模型展示等，一一帶領我們回到舊時場景中。為免參觀流於走馬看花，建議不妨參加假日時的定時導覽，透過解說能獲得更多老照片背後的精彩故事。這裡是閱讀三峽的起點，每年暑假期間也是三峽藍染節的重要舉辦場域，藍染節有靜態展覽、也有動態活動、表演、市集、DIY及課程等，未來更將把地區產業特色規劃後納入場館中當作展覽，讓來訪者既能參觀、也能認識在地特色、以及提供悠閒休憩的好地方。\n開放時間：週二至週日09:00~17:00\n休館時間：週一及國定假日休館', 3.9, '09:00:00', '17:00:00', 'Any'),
(307, 3, '華梵大學文物館', '新北市石碇區豐田里華梵路1號', '02-2663-2102', '華梵文物館座落於華梵大學內，融合大崙山的自然美景，營造出大自然的林園氣氛。館內收藏華夏五千年歷史文化文物，也包含了佛教兩千年思想所融匯的藝術寶藏，以及許多名家的書畫。館區現分為中華文物區、佛教文物區、名人書畫區及特展區，其中尤以書書區創辦人曉雲法師的禪畫最為獨特，更是展示的一大特色。\n開放時問：週一至週五 08:00~16:30〔例假日休館〕', 3.5, '08:00:00', '16:30:00', 'Any'),
(308, 3, '李天祿布袋戲文物館', '新北市三芝區芝柏山莊芝柏路26號', '02-2636-9174', '「布偶是有靈魂的，你看它看仔細，看5分鐘，他的性情就進去你腦中，是忠厚是奸巧，統統都知道。」布袋戲大師李天祿如是說。\n李天祿布袋戲文物館是由已故的國寶級布袋戲大師李天祿先生所創建，李老師自十四歲起即踏入布袋戲的表演行列，在他一甲子的演藝生涯裡，嚐遍了傳統布袋戲的興衰起落。民國六十七年，李老師毅然地宣佈「亦宛然」封箱退出職業表演，並轉而投入傳統布袋戲的文化耕耘工作。 \n歷經二十年的教學和推廣，李老師深刻體認到薪傳工作之不易，單憑一人之力實難以為繼，於是在民國八十五年發起成立「財團法人李天祿布袋戲文教基金會」，同年底座落於新北市三芝區的「李天祿布袋戲文物館」也正式落成啟用。伴隨李老師大半歲月的尪仔，終有機會於世人眼前再現其絕世風華，傳統藝術的薪傳火苗也於此再度燃起。 全館規劃有布袋戲展區、傀儡戲展區、特展區、藝師展區、演藝廳、體驗區及禮品區等。館內另設有多處影音播放裝置，可以從動態影像來更加認識布袋戲。\n開放時間：週末例假日10:00~17:00(其餘時間需預約參觀)\n每星期一休館', 3.5, '10:00:00', '17:00:00', 'Any'),
(309, 3, '淡江大學海事博物館', '新北市淡水區英專路151號', '02-2623-8343', '海事博物館展示 古今中外各類的船艦模型， 從十五至十七世紀的大航海時代到未來超導體電磁推進的各國船隻模型近六十餘艘； 本館中所有的船隻模型，皆照原船結構比例縮小，以手工製作、打造，細緻而真實，艘艘具有特色，各有緣由，值得您慢慢的觀賞，仔細的玩味。淡江大學海事博物館是一處兼具教育與知性的寶庫，一趟海事博物館之旅，定能豐富您的生活！\n參觀時間：週一至週六 09:00-17:00\n休館日：週日及國定假日', 4.4, '09:00:00', '17:00:00', 'Any'),
(310, 3, '臺灣藝術大學有章藝術博物館', '新北市板橋區大觀路一段59號', '02-2272-2181', '國立臺灣藝術大學於1955年建校至今，為臺灣歷史最悠久、系所結構最均衡的藝術大學。2004年黃光男博士擔任校長，提出以博物館凝塑本校特色、提升學術發展並建構國際文化交流平台的想法。經幾年籌備後，2008年3月24日，藝術博物館正式開館。2011年，廖有章先生家屬廖黃香女士捐贈新台幣1億元贊助藝博館新館的興建，為感念廖有章先生之貢獻，本館定名為「有章藝術博物館」。\n開館時間:10:30-17:00\n休館時間:星期日至星期一', 4.3, '10:30:00', '17:00:00', 'Any'),
(311, 3, '新平溪煤礦博物園區', '新北市平溪區新寮里十分寮新寮村頂寮子5號', '02-2495-8680', '館內設置模擬坑道，完全依照實際比例條件建造，從煤炭的形成、分布、開採到運送，讓您如同置身於坑道中。\n週邊豐富的生態資源亦是園區一項特色，春夏交替時更可見滿山遍野的油桐花、山百合，園區還有一處水生植物區，夏日黃昏夜裡螢火蟲將其點綴非常繽紛。\n館內保留台灣煤礦業相關文物、歷史資料與開採工具；為讓參觀遊客了解礦工作業情形。\n獨眼小火車是台灣第一部電氣化運煤火車，亦是台灣目前僅有在行進的小火車。由載運煤礦的台車改裝成現在的園區觀光列車，它是鐵道迷的最愛，也是最具歷史價值的展品之一。\n來到本園區一定要搭乘體驗。\n營業時間AM9:30-PM5:00售票至PM:4:00，每週一休園', 4, '09:00:00', '17:00:00', 'Any'),
(312, 3, '菁桐礦業生活館', '新北市平溪區菁桐里菁桐街117號', '02-2495-2749', '平溪地區是黑金傳說的起始點，堪稱為臺灣煤礦的代表，\n菁桐的石底煤礦品質優良甚至被稱為「臺灣煤」的代表，\n菁桐小鎮依著這樣的地理環境，繁華了一世紀。\n菁桐礦業生活館，保留下過往石底煤礦場的輝煌歷史，紀載這黑金山城裡的點點滴滴。\n開放時間：週二至日09:30~17:00\n休館時間：週一及國定假日休館。', 4.1, '09:30:00', '17:00:00', 'Any'),
(313, 3, '台灣電力公司北部展示館', '新北市萬里區野柳里八斗60號', '02-2498-5112', '為促進社會各界對核能發電之了解，消弭對核電之疑慮，台電公司於民國73年參考核能先進國家之作法，籌建核能展示館，經派員至歐、美、日實地參訪，並於台北公賣局球場對面先建小型先導型之「台北電力展示館」，展開初期之核電宣導作業，74年由日本博報堂公司負責北部展示館(簡稱為北展館)整體規劃，75年由日本乃村公司作展示品細部設計，日商守谷商會負責展示設備施工，建築本體由中華工程公司負責，79年10月竣工，80年5月2日正式開放供各界參觀。\n開放時間\n星期二至星期日08:20~16:20\n星期一休館', 4.2, '08:20:00', '16:20:00', 'Any'),
(314, 3, '府中15-新北市動畫故事館暨記錄片放映院', '新北市板橋區府中路15號', '02-2968-3600', '紀錄片放映院：\nB1，依據放映時間，詳閱當期節目單及官網。\n\n動畫故事館：\n3F~5F，2F-5F展覽室 9:00-18:00 8F影音閱讀館 9:00-21:00 （每月第一個週一休館）', 4.4, '09:00:00', '22:00:00', 'Any'),
(315, 3, '新北市藝文中心', '新北市板橋區莊敬路62號', '02-2253-4412', '原為臺北縣立文化中心，主要呈現各縣市的鄉土文化而設立的地方特色博物館。升格後重新調整為新北市藝文中心，為集合演藝廳、展覽廳、市立圖書館及黃龜理紀念館等多元的藝文空間。為求有效使用其展覽及演藝空間，為給民眾優良且舒適的環境，重新規畫展覽空間、改善舞台燈光音響設備等，整體設施修繕及空間功能定位調整而整建。\n開放時間\n週一至週日9:00-17:00（每月第一個週一及國定假日休館）', 4.2, '09:00:00', '17:00:00', 'Any'),
(316, 3, '新莊文化藝術中心', '新北市新莊區中平路133號', '02-2276-0182', '新莊文化藝術中心座落於本市『公八』公園預定地，建築面積為二七九七平方公尺，建築外觀以紅磚為主體，搭配淺青色與淡灰色磚石，造型方圓兼具，內外融合，是都會城市中的一抹火紅熱情。文藝中心整體建築計地上三層、地下一層，空間規劃有演藝廳、藝術廳、期刊室、閱覽室以及布袋戲文物館與典藏室等。多功能、多元化的空間設計，持續無限延伸藝文的版圖。\n週二至週六9:00-21:00 週日、週一9:00-17:30 （每月第一個週一及國定假日休館）', 4.1, '09:00:00', '21:00:00', 'Any'),
(317, 3, '美麗永安生活館', '新北市中和區中和路390號', '02-2929-8830', '新北市美麗永安生活館於100年1月23日開館，隸屬於新北市政府文化局，展館位於捷運永安市場站2樓，總面積為286坪，展場面積占約 120 坪，大約每2至3個月會有不同主題的展覽展出，活動教室約40坪，會搭配展覽舉辦課程或講座，公共空間含閱覽室、休憩室、茶水間、洗手間、哺乳室等。\n鑑於中和、永和區為臺灣人口密度最高的地區，境內居住大量通勤人士，所以本著「家的延伸」理念，辦理生活美學之展覽、活動與課程，與居民探討生活美學理念，邀請社區居民參與，建立民眾美感意識。此空間除具有展示、研習、推廣、交誼等功能外，更提供都會人口一個可放鬆身心的美學場所，營造一個於忙碌都會中多方位的文化生活場域。\n週一至週日11:00-19:00 （每月第一個週一休館）', 4.3, '11:00:00', '19:00:00', 'Any'),
(318, 3, '新板藝廊', '新北市板橋區漢生東路166號3樓', '02-2950-9750', '新板藝廊位於國鼎大樓3樓，隸屬於新北市政府文化局，是隱身於高樓林立之板橋區的城市藝文空間。\n透過新板特區多條空廊的串連，連結市府、大遠百，讓市民朋友在穿梭城市生活空間，偶遇藝術家精采創作，塑造獨特城市藝術氛圍及美好生活。\n週一至週日10:00-18:00 （每月第一個週一休館）', 4.2, '10:00:00', '18:00:00', 'Any'),
(319, 3, '水源劇場', '臺北市中正區羅斯福路四段92號10樓', '02-23625221', '水源劇場位於水源大廈(水源市場)十樓，原為北市兵役局大禮堂。臺北市政府透過推行公館水岸整合計畫，將該禮堂整修成500席次之專業表演場地，自100年11月底啟用，為臺北市政府文化局自行營運管理之展演場館，受理展演團隊申請檔期辦理展演活動。\n此外，水源劇場持續以場地贊助之角色，扶植展演團隊辦理長銷式節目演出計畫，盼能培育藝文產業營運人才、建構有利藝文環境、厚植臺灣表演藝術產業能量，並串連寶藏巖、自來水園區與公館夜市為大臺北地區之文化觀光亮點。\n開放時間依展演而定', 4.4, '00:00:00', '23:59:59', 'Any'),
(320, 3, '草山行館', '臺北市北投區湖底路89號', '02-28622404', '草山行館位於陽明山國家公園花鐘立體停車場旁，通過一條小徑後即可見，臨近有花鐘、陽明公園等知名景點，向下可俯瞰絕鄰近北市景觀，環境清幽、視野開闊。草山行館佔地共四二七五平方公尺，其中包括主行館及四幢建物。建物本身採用陽明山當地木石材，以檜木為主、杉木為輔，建物風格為1920年代日式風格，亦具備著與鄰近同期建物相同的「外石砌、內為木製材質」之形式風格。門前有兩棵年齡逾百的相思樹和楓香，綠意盎然。在此一會，總有時光流逝、遙想當年之感懷。\n展覽時間：週二~日 10:00-17:00\n週一公休', 4, '10:00:00', '17:00:00', 'Any'),
(321, 3, '台北二二八紀念館', '臺北市中正區凱達格蘭大道3號', '02-23897228', '台北二二八紀念館於1997年2月28日，二二八事件發生50週年時正式開館。本館設立宗旨在求公布史料，安慰受難者家屬，希望透過興建紀念館的方式，讓臺灣人民走出二二八陰影，將苦難提升為進步或再創造的力量，使臺灣社會重建健康心靈，愛和寬恕得以成為和諧生活的命運共同體，並冀能促進族群的共榮 共和，社會、文化的建全發展。\n開放時間\n週二至週日 10:00-17:00  (每週一及國定假日次日休館)', 4.1, '10:00:00', '17:00:00', 'Any'),
(322, 3, '紀州庵文學森林', '臺北市中正區同安街107號', '02-23687577', '「紀州庵」初建於1917年，原為平松家族經營的日式料亭，因緊鄰新店溪畔，景色宜人，成為城南居民的生活重心。1950 年代，戰後的紀州庵轉為公務人員眷舍，小說家王文興曾居於此，《家變》的部分場景便源於此地。1970 年代起，純文學、爾雅、洪範、遠流等出版社也不約而同的在城南建立。\n2004年，紀州庵遺址在臺大城鄉所與城南水岸文化協會努力下，被定為臺北市市定古蹟。\n「紀州庵文學森林」目前涵蓋一棟透天獨立三層主建築，與修復完成的古蹟相互輝映。已舉辦千場以上的藝文活動，成為台北的文學基地。\n【新館開放時間】\n週二～四、日：10:00-18:00\n週五、六：10:00-21:00\n【茶館營業時間】\n週二～四、日：10:30-18:00（供餐到 17:00）\n週五、六：10:30-21:00（供餐到 20:00）\n【古蹟開放時間】\n週二～日：10:00-18:00\n週五：10:00-21:00\n週一公休', 4.2, '10:00:00', '21:00:00', 'Any'),
(323, 3, '臺北琴道館', '臺北市中正區齊東街53巷11號', '02-23917536', '古琴是中華民族最早的彈絃樂器，「琴棋書畫」四藝以「琴」為首，其歷史久遠、內涵廣博精深，為中華傳統文化之瑰寶。2003年11月更被聯合國教科文組織指定為第二批人類非物質口頭文化遺產。\n臺北琴道舘由社團法人中華古琴學會經營，致力於古琴文化推廣與傳承，以琴道為中心，結合書、畫、茶、香、花、拳等經典人文內涵，以傳統文化樹立當代雅集風格，提供國人領略聆賞精緻高雅的古琴文化。\n開放時間：週三至週日 10:00-18:00 (入場至17:00)\n一二公休', 4.2, '10:00:00', '17:00:00', 'Any'),
(324, 3, '臺北書畫院', '臺北市中正區金山南路一段30巷12號', '02-23916737', '原齊東街日式宿舍群，約建於1930年代，為日治時期興建之日式傳統住宅，初為幸町區職務官舍群，光復後編為台銀宿舍群，建築內、外部空間保有日式宿舍建築特色，具當時都市住宅群落特徵。經臺北市古蹟暨歷史建築審查委員會，及齊東文史工作室多方努力配合下，以文化資產保留整體聚落型態。\n於2010年由臺北市政府文化局修復，訂為臺北書畫院，為市定歷史建物。\n週三～週日10:00-18:00 (入場至17:00，請著襪入內)\n一二公休', 3.8, '10:00:00', '17:00:00', 'Any'),
(325, 3, '孫運璿科技人文紀念館', '臺北市中正區重慶南路二段6巷10號', '02-23112940', '坐落於台北城南的「孫運璿科技˙人文紀念館」，是孫運璿先生任行政院長時的宅邸，運璿先生於1980年遷入，至2006年辭世，在此共居住26年之久。\n運璿先生任行政院長期間，諸多重要決策及施政方針皆在此構思。運璿先生去世之後，因感念其對台灣之貢獻，又因此宅邸表現1920年代極為流行的和、洋式混合建築特色，2006年經臺北市政府文化局指定為市定古蹟，並委託孫運璿學術基金會進行研究、規劃、經營管理，期讓古蹟充分再利用。\n週二至週日，上午10:00～下午17:00（週一休館）', 4.4, '10:00:00', '17:00:00', 'Any'),
(326, 3, '袖珍博物館', '台北市中山區建國北路一段96號', '(02)2515-0583', '袖珍博物館尋訪世界各地網羅一流袖珍藝術大師作品，擁有排名世界級的收藏規模，包羅萬象的袖珍精品經過組合佈置後，主題作品目前展出約兩百餘件，主要有呈現整座建築內外佈置的娃娃屋（Dollhouse）、各種房間精緻寫照的夢幻屋盒（Roombox），趣味創意的主題作品等。從兩千年前羅馬遺跡一窺當時羅馬帝國的壯闊景緻到90年代美國百萬公寓裡感受紳士名媛的舒適享受；義大利水都威尼斯的浪漫風情；極盡豪華的英國女王白金漢宮、倫敦東郊的貧民窟；童話世界中的白雪公主，漫步袖珍博物館如同進入異國風情的時光隧道。\n週二～週日 10：00～18：00(售票至17：00止)\n週一休館', 4.2, '10:00:00', '18:00:00', 'Any'),
(327, 3, '錢穆故居', '臺北市士林區臨溪路72號', '02-28805809', '「素書樓」為國學大師錢穆先生生前居所。民國五十六年，錢先生及夫人自港返台覓地建屋，得外雙溪今址。為紀念母親生養之恩，錢先生以無錫七房橋五世同堂故居裡，母親居所之「素書堂」作為隱居終老處所之名，素書樓庭院內的一磚一石、一草一木都是主人多年的心血，夾步道而迎的楓樹、房舍後方挺立的竹子，庭園裡的茶花等是夫人親手植栽。\n開放時間：每週二至週日9:00-17:00，每週一及國定假日休館', 4.3, '09:00:00', '17:00:00', 'Any'),
(328, 3, '西門紅樓', '臺北市萬華區成都路10號', '02-23119380', '1908年西門紅樓興築完成迄今已屆百週年，這棟民國前的建築，歷經日本、上海、西洋等多元文化的洗禮，最早是常民生活的公有市場，40、50年代有來自大陸各樣文化產業的聚合，60年代成為西方文明思潮的吸納窗口，集文化、商業、歷史並陳的多元熔爐，百歲的西門紅樓始終有著承載前衛、摩登、新式、多樣的豐饒意象。\n週二至週日11:00-21:30，週五、週六延長至22:00（週一休館）', 4.1, '11:00:00', '22:00:00', 'Any'),
(329, 3, '剝皮寮歷史街區', '臺北市萬華區廣州街101號', '02-23362798', '穿梭在臺北市萬華區的老舊巷弄中，有一處名為「剝皮寮」的老街區，這裡依然延續著百餘年前清代街道的風貌，紅色的磚牆、拱型的騎樓、雕花的窗櫺，呈現典雅樸實之美。\n剝皮寮歷史街區位於龍山寺旁，康定路、廣州街及昆明街口，街區內保存有相當完整的清代街型、清代傳統店屋，其建築空間見證了艋舺市街的發展，擁有獨特之歷史文化和建築特色。\n開放時間:週二至日9:00-17:00 週一公休', 4, '09:00:00', '21:00:00', 'Any'),
(330, 3, '芝山文化生態綠園', '臺北市士林區雨聲街120號', '02-88666258', '芝山文化生態綠園原是軍事情報局彈藥庫，釋出後經由臺北市政府文化局自民國91年起陸續整修園內建物，並規劃為教育展示、休閒遊憩空間，現委由台北市野鳥學會芝山岩管理處經營。於民國94年12月31日正式開放。\n芝山岩經內政部於民國82年核定為二級古蹟。「芝山文化生態綠園」是我國第一座文化生態公園，園區內各項設施皆在突顯本地豐沛的文化、生態資源：園區所在為全國唯一一處擁有七個文化層的地方、台北地區唯一現存『芝山岩文化層』遺跡之所在。另外，此地地質是2000〜2200萬年前所形成之大寮層，清朝及日據時期封為保安林和天然紀念物，擁有台北近郊難得一見的巨木景觀，是台北都會中珍貴的休閒綠地及森林寶庫。\n開放日期:週二至週日：9:00-17:00（16:30停止售票入園）\n休園日：每周一及春節假期', 4.2, '09:00:00', '17:00:00', 'Any'),
(331, 3, '牯嶺街小劇場', '臺北市中正區牯嶺街5巷2號', '02-23919393', '在清朝時期往來臺北城與古亭庄，會經過牯嶺街。日據時期為了紀念第5任總督佐久間左馬太而稱此地為佐久間町，後來日本戰敗，被迫遣返的日本人，到此賣書籍、字畫換錢回日，成為牯嶺街舊書攤的前身。後大陸人來臺，仿效日本人，成立舊書及古董字畫販售地攤，牯嶺街舊書的名氣也就這樣傳開了，命名為牯嶺，是用來替換掉佐久間町，將殖民的色彩除去。\n牯嶺街小劇場的大門開向西北，是日本人為了在此做為監控之用，掃視著平原區可能出現的威脅，所以建築物不同於鄰近屋舍格式。國民政府依舊讓這棟房子繼續負起監控的任務，作為警察局，象徵國家權力。\n中正2分局搬遷到了南海路，此建築物成為小劇場的展演空間，發展藝文活動。空間規劃為辦公室及服務台、文宣品區、實驗劇場、拘留室、會議室、藝文空間、視聽室、排練室。這兒不時有各種活動演出，在臺灣小劇場發展史上佔有重要的位置。\n開放時間：週二~日10:00-22:00 每周一館休。', 4.2, '10:00:00', '22:00:00', 'Any'),
(332, 3, '撫臺街洋樓', '臺北市中正區延平南路26號', '02-23148080', '撫臺街洋樓位在北門郵局對面，是座兩層樓石木混合構造建築，整體裝飾簡潔而不複雜，質樸中不失細緻，深受歐陸古典風格的影響。\n建物的一樓以厚重石材疊砌建造，形成典雅騎樓式拱廊，拱廊為四柱三間，拱圈是梯形唭哩岸石塊組合成，騎樓天花板則有木材拼組成的圖案。二樓及屋架均為木造，覆以複折式屋頂，面鋪石棉瓦片，外觀特色為立面上有陡斜屋頂與老虎窗及石造拱廊柱，屬仿文藝復興式樣的建築，也是碩果僅存的日據時期獨棟洋樓店鋪。\n開放時間:週一~週六 10:00-18:00 週日公休', 4.3, '10:00:00', '18:00:00', 'Any'),
(333, 3, '市長官邸咖啡廳', '臺北市中正區徐州路44、46號', '02-23969398', '1994年以前的歷任市長，除吳伯雄之外，包括高玉樹、張豐緒、林洋港、李登輝、邵恩新、楊金欉、許水德、黃大洲等，大多任內都居住於官邸內，因此具有深刻的紀念價值。幾乎每任市長上任時，都會依自己的八字，將房子內外做些改變。直至陳水扁時代首度開放給民眾參觀，從此「市長的邸」成為「全民的家」。\n民眾可以自在走進台北市長官邸，散步在綠蔭圍繞的前庭廣場上，欣賞由自然景觀及裝置藝術共譜的和諧篇章；生活藝術館提供台灣藝術家良好的發表平台，讓創作者與消費者找到最無礙的溝通方式；日式迴廊、心型水池、綠竹造景，紀念著舊官舍的美好歲月；走訪市長官邸藝文沙龍的人們，成為見證老屋過去與創造宅邸未來的一份子。\n民眾可以自在走進台北市長官邸，散步在綠蔭圍繞的前庭廣場上，欣賞由自然景觀及裝置藝術共譜的和諧篇章；生活藝術館提供台灣藝術家良好的發表平台，讓創作者與消費者找到最無礙的溝通方式；日式迴廊、心型水池、綠竹造景，紀念著舊官舍的美好歲月；走訪市長官邸藝文沙龍的人們，成為見證老屋過去與創造宅邸未來的一份子。\n民眾可以自在走進台北市長官邸，散步在綠蔭圍繞的前庭廣場上，欣賞由自然景觀及裝置藝術共譜的和諧篇章；生活藝術館提供台灣藝術家良好的發表平台，讓創作者與消費者找到最無礙的溝通方式；日式迴廊、心型水池、綠竹造景，紀念著舊官舍的美好歲月；走訪市長官邸藝文沙龍的人們，成為見證老屋過去與創造宅邸未來的一份子。\n開放時間9:00-22:00 除春節外全年無休', 3.8, '09:00:00', '21:00:00', 'Any'),
(334, 3, '光點台北(臺北之家)', '104臺北市中山區中山北路二段18號', '02-25117786', '外觀為白色的2層樓西洋建築，廊柱為希臘柱式，風格似美國南方殖民風格，美國大使藍欽、莊萊德、柯爾克等人皆以這棟建築物做為官邸。1979年中美斷交後，最後一任大使離臺，建築物正式關閉。\n閒置多時的建築物，於內政部在1997年2月20日指定為第三級古蹟，有了新的轉機，臺北市文化局委託臺灣電影文化協會經營，成為以電影文化為主的「臺北之家」。', 4.1, '11:00:00', '23:00:00', 'Any'),
(335, 3, '糖廍文化園區', '臺北市萬華區大理街132-10號', '02-23067975', '歷經多年努力，保存糖倉古蹟且無償取得公園土地，文化局續爭取中央擴大內需修繕經費。修復三棟糖倉古蹟，初期透過譽揚的優秀團隊入駐，活化再生古蹟空間，創造萬華文化觀光新亮點。於98年2月20日召開社區說明會，明華園獲當地民眾支持，期望該團賦予糖廍文化園區嶄新面貌，讓舊傳統醞釀出新活力。糖廍文化園區定位為傳統戲曲的人才培育及傳藝後製人力的培養園地，增強萬華這老台北的多種文化面貌與特質。\n開放時間:週二~日10:00-17:00 週一公休', 3.9, '10:00:00', '17:00:00', 'Any'),
(336, 3, '臺北當代藝術館', '臺北市大同區長安西路39號', '02-25523721', '台北當代藝術館的館舍建築，落成於西元1921年，原為日治時期專供日本人子弟受教育的「建成小學校」。1945年後，台灣進入中華民國時代，原建成小學校舍被轉用為台北市政府辦公廳舍，直至1994年台北市政府遷入信義區的新市政中心為止。在這五十年當中，這棟紅磚建築體，正是驅動台北市政及各類軟硬建設的神經中樞。\n每週二至週日(Tue-Sun)，10:00-18:00，17:30 停止售票（Tickets sold until 17:30 p.m）\n每週一休館 Closed on Mondays。', 4.4, '10:00:00', '18:00:00', 'Any'),
(337, 3, '臺北市市定古蹟萬華林宅', '台北市萬華區西園路一段306巷26號', '(02)2302 5857', '林宅興建之前，日本政府公告市區改正計畫，林家因為考慮預定將於昭和20年（1945）左右實施之都市計畫，會因西園大橋之開闢而將林宅分為東西兩段，因此決定順應計畫道路來興建林宅，以避免造成日後必須拆房子的命運。林家遂將林宅之正面朝向都市計畫道路，平面並因而呈斜梯形狀，在當時看來，卻形成林宅之正向入口朝向街廓內側的奇特現象。\n\n \n\n二次大戰後，國民政府基本上依據日治時期之都市計畫觀念，林宅因早就考慮到未來新闢的道路，至今終於正面面向大道，又因為目前306巷的部分原本為西園大橋，後來西園橋拆除改為西園路一段，原本鐵路的部分因為鐵路地下化而成為艋舺大道，使得林宅三面臨路，更引人注目。在林家最興盛之時曾約有50人左右住在此棟建築物內，可以想見當時林宅人聲鼎沸的情景。\n1、2樓星巴克全年無休\n3、4樓駐點導覽每周一、二、四14:00-16:00，14:20停止入場', 4.4, '14:00:00', '16:00:00', 'Any'),
(338, 3, '蔡瑞月舞蹈研究社', '臺北市中山區中山北路二段48巷10號', '02-25605724', '提供場租空間、舞蹈課程、劇場表演的多功能場地', 4.1, '10:00:00', '17:00:00', 'Any'),
(339, 3, '臺北市中山堂', '臺北市中正區延平南路98號', '02-23813137', '1928年日本人為了紀念日皇裕仁登基，並作為施政紀念事業重要建設項目之一，拆除了清末布政使司衙門及欽差行臺，並將欽差行臺部分建築物移到植物園陳列，而在原址開始籌劃興建「臺北公會堂」。\n1945年（民國34年）抗戰勝利台灣光復，台灣省受降典禮便在公會堂舉行，當時場面極為盛大，受降典禮由臺灣省行政長官公署長官陳儀代表中國戰區最高統帥受降，日方投降代表則由臺灣總督兼第十方面軍司令官安藤利吉等人代表出席，行此以後被日本人統治51年的臺灣，正式重返祖國懷抱。\n光復後「公會堂」更名為「中山堂」並由臺北市政府接收，內部的「大集會場」、「大宴會場」「普通集會室」也同時改為「中正廳」、「光復廳」、及「堡壘廳」。其後中山堂的主要功能之一即為召開國民大會之場所，並且成為政府及各界舉辦重大集會之空間。', 4.1, '09:30:00', '21:00:00', 'Any'),
(340, 3, '臺北市電影主題公園', '臺北市萬華區康定路19號', '02-23123717', '「臺北市電影主題公園」座落於台北市萬華區武昌街與康定路口，原址為日據時代昭和九年（西元1934年）成立之「台灣瓦斯株式會社」。民國90年完成公園簡易綠化，台北市煤氣有限公司於閒置34年之後終於變身為西門町最大一塊的公園綠地，興建宗旨不但要保存舊時煤氣公司廠房、煙囪、煉焦爐等設施之歷史建物，讓老建築得以再利用，創造一個藝術文化與周邊電影、咖啡文化、青少年文化結合的大型休憩性空間。', 3.8, '00:00:00', '23:59:59', 'Any'),
(341, 3, '臺北市藝文推廣處', '臺北市松山區八德路3段25號', '02-25775931', '本處係一綜合性之藝文推廣機關，轄下現有5個場館，除八德路藝文大樓及側邊之城市舞台提供戲劇、舞蹈、音樂等專業演出及校園推廣外，位於年貨大街迪化街的大稻埕戲苑，以發展推廣傳統戲曲及校園推廣傳承為主軸；景美捷運站旁的文山劇場，主要定位是兒童戲劇及親子藝文活動；在市政大樓2樓的親子劇場是綜合型劇場，配合市府各機關學校的表演與集會活動需求，辦理場地檔期租借演出與各項活動。\n週一公休', 4, '08:30:00', '17:30:00', 'Any'),
(342, 3, '大稻埕戲苑', '臺北市大同區迪化街1段21號8.9樓', '02-25569101', '大稻埕戲苑，座落於永樂市場8、9樓，為臺北市立社會教育館的分館之一。1908年前原為一座花園，日治時期改建為市場，昔日匯集近千家布行，為全臺灣最大的布料中心，而大稻埕更是傳統戲曲的孕育搖籃，有「戲窟」之稱。大稻埕戲苑以演出、推廣、保存傳統戲曲為宗旨，九樓劇場辦理各項傳統戲曲如歌仔戲、京劇、南管、北管、客家戲、說唱…等演出，八樓曲藝場則規劃常態性布袋戲、南管、說唱節目、一樓廣場安排「遊於戲」藝文活動；本苑春、秋兩季皆開設文化藝術研習班辦理戲曲、茶藝、布藝等課程、另亦安排免費藝文講座、戲曲影片播放等服務；八樓廊道展示區規劃布袋戲常設展及不定期之特展，團體滿十人以上即可預約導覽服務；各排練室、多功能簡報室亦提供藝文團體租借使用。\n週一公休', 4.2, '09:00:00', '22:00:00', 'Any'),
(343, 3, '臺北市立美術館', '臺北市中山區中山北路三段181號', '02-25957656', '台北市立美術館肩負推動臺灣現當代藝術的保存、研究、發展與普及之使命，掌握全球趨勢、建立多元交流管道，提升普羅大眾對現當代藝術的認知與參與，促使臺灣現當代藝術發展臻至蓬勃，全民藝術涵養更加豐沛，以期形成具有美感修為及文化思辨力的當代社會。\n週一公休', 4.4, '09:30:00', '17:30:00', 'Any'),
(344, 3, '臺北數位藝術中心', '臺北市士林區福華路180號', '02-77360708', '臺北數位藝術中心自今年4月，由社團法人台灣視覺藝術協會（視盟）承接營運，視盟團隊以深植的藝術資源與經驗，思考如何補齊中心與在地應有的連結，以成為更務實的能量平台。重啟之際，臺北數位藝術中心的物理性空間被打開、中心與環境關係被探索、中心與數位藝術對話加入新的可能，面對環境的改變、現實的考量，本中心期盼以「再、更、新」的概念，來貼近多元需要的方式，更新的深度服務品質，讓中心再次，重新出發。\n日一公休', 3.9, '11:00:00', '19:00:00', 'Any'),
(345, 3, '北投溫泉博物館', '臺北市北投區中山路二號', '02-28939981', '北投溫泉博物館的展示配合古蹟再利用的空間使用，一樓規劃為「北投溫泉浴場展示區」、「北投石展示區」以及「溫泉北投展示區」；二樓規劃為「北投溫泉鄉發展史展示區」、「望樓展示區」、「榻榻米活動大廳展示區」、「多媒體視聽室展示區」、「北投產業展示區」、「台灣好萊塢展示區」與「進北投特展室」。\n週一公休', 4.2, '09:00:00', '17:00:00', 'Any'),
(346, 3, '李國鼎故居', '臺北市中正區泰安街2巷3號', '02-23935991', '故居興建於1935年，原日據時期總督府交通局遞信部部長宿舍，戰後改為臺灣省政府財政廳長宿舍。1972年李國鼎先生任財政部長時遷入居住直至辭世。各界追思故人發起募捐，臺北市政府於2003年公告故居為市定古蹟，並運用捐款在其側新建展示館，前段為先生文物及言行政績陳列區，後段為彈性活動區；故居全館於2010年5月31日對外開放參觀迄今。\n日一公休', 4.3, '10:00:00', '16:00:00', 'Any');
INSERT INTO `type_place` (`place_no`, `type_no`, `palce_name`, `addr`, `tel`, `intro`, `net_rate`, `openTime`, `endTime`, `weather`) VALUES
(347, 3, '臺北服飾文化館(西園29服飾創作基地)', '108臺北市  萬華區西園路二段 9 號', '02-23367599', '位處富文化特色的艋舺地區，「西園29服飾創作基地」過去是大家所熟知的臺北服飾文化館；現在，這裡以服裝產業創意新地標之姿，加上周邊的艋舺服飾商圈（大理服飾商圈）為腹地，打造為一座3層樓的時尚基地。\n整棟外觀為磚紅色的大樓，館內整體設計以「樹」的概念為設計主軸，期待化身為一棵創意之樹，吸取萬華地區的歷史文化風貌，培育臺灣服飾設計人才，並開枝散葉滋養艋舺服飾商圈，媒合艋舺商圈業者及駐基地設計師，建立示範性的設計案合作案例，振興臺灣服飾及服飾設計產業、打響臺灣品牌與設計力的名聲，更將之推向國際舞台。', 4.1, '10:00:00', '19:00:00', 'Any'),
(348, 3, '永安藝文館', '臺北市文山區木新路2段156-1號', '02-29393088', '永安藝文館-表演36房為臺北市政府文化局與優人神鼓共同打造的藝術人文空間，也是專業表演人才的培育搖籃。本館與景文高中合作開辦的優人表演藝術班是沒有圍籬和框架的學習場所，提供青少年自主學習和探索自我的機會，建立自信和正面的價值觀。這裡也是文山地區居民最佳的心靈休憩空間，透過藝文講座、工作坊、推廣課程補充藝術能量。歡迎各界喜愛表演藝術、文化活動的朋友到此交流，體驗在地文化與國際藝術交融的生活美學。\n開放時間：週二至週六 09:00～21:00、週日 09:00～18:00\n週一公休', 4.6, '09:00:00', '21:00:00', 'Any'),
(349, 3, '臺北偶戲館', '臺北市松山區市民大道五段99號2樓', '02-25289553', '憑藉著對偶戲藝術的熱情，臺原藝術文化基金會董事長林經甫先生，將數十年來個人收藏的戲偶捐出，希望臺北市政府能為它們成立一處永久保存、展覽的處所。經過臺北市政府文化局的縝密規劃，這批珍貴文物終於在「威京集團京華城社區回饋計畫案」中找到歸宿。兼具戲偶展出、演出、教學、典藏功能的「台北偶戲館」，於2004年八月正式開館。 \n台北偶戲館以「愛耍創意、愛耍偶」為訴求，劃分為「袋袋相傳-布袋戲區」、「絲絲入扣-傀儡戲區」、「影影約約-皮影戲區」、「偶戲萬花筒-互動體驗區」四個單元、以及「戲偶DIY課程」。介紹臺灣傳統與現代偶戲的歷史與發展，鼓勵大家多發揮創意，運用生活素材創造出自己的布袋戲偶、皮影戲偶、懸絲偶等各種現代偶。接續傳統及現代，結合東方與西方偶戲藝術，台北偶戲館成為國內外朋友認識偶、欣賞偶、把玩偶的最佳公共場域。\n週一公休', 3.7, '10:00:00', '17:00:00', 'Any'),
(350, 3, '紫藤廬茶館', '臺北市大安區新生南路三段16巷1號', '02-23637375', '紫藤廬是一個茶館，卻不只是茶館，它是全台灣第一處市定古蹟，也是台北市第一處以人文歷史精神及公共空間內涵為特定而指定的活古蹟：「其為台灣民主運動、反對運動及自由學者的聚場所，所散發的人文氣息，具有教育、文化、政治等功能及特色，並強烈展現市民生活文化意義，具有保存價值。」', 4.1, '10:00:00', '22:00:00', 'Any'),
(351, 3, '臺北故事館', '臺北市中山區中山北路三段181-1號', '02-25875565', '1913 年建造的英國都鐸式建策， 2003 年由陳國慈女士贊助成立「台北故事館」，古蹟蛻變為介紹台灣生活文化與古蹟再利用的迷你型博物館。\n\n從此古蹟有了屬於她的新生命， 12 年來透過多樣的藝文活動和展覽的舉辦，讓三百多萬的民眾看到她的美和光芒。\n週一公休', 4.1, '10:00:00', '17:30:00', 'Any'),
(352, 3, '林語堂故居', '臺北市士林區仰德大道二段141號', '02-28613003', '「林語堂故居」座落陽明山腰，興建於民國五十五年，由語堂先生親自設計，是先生生前最後十年定居台灣的住所。本建築是以中國四合院的架構模式，結合西班牙式的設計取向，兼具東、西方風格，融合了現代感與古典美。藍色的琉璃瓦搭配白色的粉牆，其上嵌著深紫色的圓角窗櫺，意境典雅精緻。從西式拱門走進，穿過迴廊，可見透天中庭，西班牙式螺旋廊柱被和煦的陽光輕輕地拉長身影。\n語堂先生愛竹、愛石，所以他刻意在中庭一角，由翠竹、楓香、蒼蕨、藤籮等植物，與造型奇特的石頭，營造出可愛的小魚池，他常坐在池邊的大理石椅上，享受「持竿觀魚」之樂。\n週一公休', 4.3, '09:00:00', '17:00:00', 'Any'),
(353, 3, '士林官邸正館', '臺北市士林區福林路60號', '02-28836340', '士林官邸有精緻的庭園造景設計，蟲鳴鳥叫、景色秀麗，是休閒遊憩的絕佳場所。當年因為緊鄰著中山北路，佔據極佳的地理位置，可快速直達總統府，加上後有福山做為倚靠，優越的地勢，所以成為蔣故總統官邸。\n1996年，官邸首度開放市民觀賞園藝與休憩使用。玫瑰園，是蔣夫人最喜愛的花園；西式庭園中浪漫美好的風光，是新人婚紗照最常取景的地方；中式庭園裡的拱橋、曲池、流水等東方庭園造景，則令人彷彿置身古代中式庭院。\n其他如園藝館、新蘭亭、凱歌堂等等，都是十分具有特色的建築。後來增設的露天音樂台，經常舉辦各種藝文及音樂相關活動，已經成為市民休閒的新去處。\n週一公休', 4.4, '09:30:00', '17:00:00', 'Any'),
(354, 3, '台北國際藝術村', '臺北市中正區北平東路7號', '02-33937377', '做為「國際藝術村」得以成立的基礎，除了經濟要件，當然用文化形塑城市所衍伸出來的城市閱讀做出了一種嘗試。\n如果你到達一個異鄉城市，走進藝術村可以看出一個城市的模樣。藝術村不是高藝術殿堂。它是一個根植於真實生活的場域，更具體一點說，住進藝術村，你的視線會常常在「在地觀」和「國際觀」之間來回對焦。這樣的對焦就是從日常點滴裡萌芽茁壯，用藝術文化創造了城市的高度及厚度。同時，在這裡的集體經驗召喚出一個以自由和開放交流的共通感。\n臺北國際藝術村，並非只是具展演功能的展館，而是藝術家的「聚落」。有別於僅呈現作品的各式展演場所，除了辦公室與三個多功能展演廳，更規劃了十三間藝術家創作及生活的工作室、舞蹈室、鋼琴室及暗房等，提供不同類型的駐村藝術家使用。\n週一公休', 3.8, '11:00:00', '21:00:00', 'Any'),
(355, 3, '寶藏巖國際藝術村', '臺北市中正區汀洲路三段230巷', '02-23645313', '做為「國際藝術村」得以成立的基礎，除了經濟要件，當然用文化形塑城市所衍伸出來的城市閱讀做出了一種嘗試。\n如果你到達一個異鄉城市，走進藝術村可以看出一個城市的模樣。藝術村不是高藝術殿堂。它是一個根植於真實生活的場域，更具體一點說，住進藝術村，你的視線會常常在「在地觀」和「國際觀」之間來回對焦。這樣的對焦就是從日常點滴裡萌芽茁壯，用藝術文化創造了城市的高度及厚度。同時，在這裡的集體經驗召喚出一個以自由和開放交流的共通感。\n寶藏巖國藝術村設有14間藝術家工作室，做為國、內外駐村藝術家工作及生活的空間。除此之外，也規劃了排練室、展覽室及戶外展演空間。從聚落下方臨河岸邊的綠地眺望，整片的斷垣殘壁綿延成為歷史斷面，更形成了閱讀寶藏巖豐富的歷史紋理與具歧異多義的空間結構的線索。\n週一公休', 4.2, '11:00:00', '22:00:00', 'Any'),
