(364, 4, '寧夏夜市', '台北市大同區寧夏路', '無', '豬肝湯、蚵仔煎、魷魚羹、蒸餃、豆花、胡椒餅、蛋黃芋餅、蛋包蝦仁湯、知高飯、飯糰、麻糬冰', 4.1, '17:30:00', '23:59:59', 'Sunny'),
(365, 4, '大龍街夜市', '台北市大同區大龍街', '無', '位於孔廟、保安宮等歷史古蹟旁的大龍街夜市，早晚皆有不同的美味小吃，早晨有多家販售燒餅豆漿、炸蛋餅及飯、麵、粥等各種臺式早餐的攤販商家，到了夜晚，則有許多傳統特色老店，有得過獎的滷肉飯、香濃不甜膩的甜品、大排長龍的鵝肉，以及肉圓、鹹酥雞、炒飯等人氣小吃，來一趟大龍峒歷史城區，探訪歷史古蹟之餘，順便享受夜市小吃的獨到魅力吧！', 3.7, '16:00:00', '23:59:59', 'Sunny'),
