(368, 4, '雙城街夜市', '台北市中山區雙城街', '無', '雙城街夜市幾乎都是老字號的攤位，賣了30多年的小吃比比皆是，因為實在太美味了，一傳十十傳百，即使刮風下雨，許多舊雨新知都會自動來報到。夜市的規模雖然不大，整齊劃一的橘紅色招牌，井然有序，成為臺北市第一個區域性示範夜市，加上這附近也有蠻多pub，所以有些國際友人也會來這裡，這些攤位的生意好的不得了，不去不知道，無論如何非得來嚐鮮不可 。 好吃的嘉義雞肉飯，美味可口又下飯；道地的水煮鵝肉，香噴噴的鵝肉高湯，滿足挑剔的嘴；魯肉飯也是知名，黃記魯肉飯，與嘉義雞肉飯同樣獲得臺北市的魯肉飯競賽佳作，好吃自然不在話下，以蹄膀，豬腳一起滷的魯肉，更濃醇卻不油膩。最後別放忘了這裡的甜品，阿嬤的古早味米苔目、愛玉冰，懷念的臺灣小吃，超乎想像的好吃！', 3.9, '00:00:00', '23:59:59', 'Sunny'),
(369, 4, '遼寧街夜市', '台北市中山區遼寧街', '無', '海產熱炒、居酒屋', 3.8, '16:00:00', '23:59:59', 'Sunny'),
(370, 4, '石牌夜市', '台北市北投區石牌路二段90巷20號', '無', '真味肉圓、阿秋甜不辣、阿財鍋貼水餃專賣店、美鮮牛肉麵、臭媽媽手工臭豆腐、老潘酥烤蔥油餅、洪記上海生煎包、粉味脆皮車輪餅、哈日壽司。', 3.8, '07:00:00', '23:59:59', 'Sunny'),
