(378, 4, '興南夜市', '新北市中和區信義街', '無', '興南觀光夜市緊鄰捷運南勢角站，步行約3分鐘即可抵達，交通非常方便。夜市範圍以信義街、景興街410巷為主，攤商大多為小吃、服飾等生活雜貨零售，是一處以在地人需求為主的小型夜市。興南夜市的推薦美食包括台灣豆花、黃家大腸蚵仔麵線、招牌特製脆腸、唐老鴨滷味等都是人氣小吃。而距離捷運南勢角站約15分鐘腳程的華新街，大多數人又它為「緬甸街」，這裡匯集了包括緬甸、越南、雲南、印度等東南亞料理，各家餐廳的料理各具特色、美味又平價，是許多人到中和會走訪的美食街。（由於大多數店家在下午三、四點後便關門休息，想嘗鮮的朋友記得提早出門。）', 3.5, '15:00:00', '23:59:59', 'Sunny'),
(379, 4, '樹林興仁花園夜市', '新北市樹林區保安街二段70號', '無', '北台灣最大夜市\r\n一二四公休', 4.1, '17:00:00', '23:59:59', 'Sunny'),
(380, 4, '樹林夜市', '新北市樹林區博愛街', '無', '筒仔米糕、腿庫飯', 3.8, '16:30:00', '23:59:59', 'Sunny'),
(381, 4, '新莊廟街夜市', '新北市新莊區新莊路', '無', '新莊夜市，最膾炙人口的美食區新莊路214巷，短短的巷道之間，左一口香Ｑ的油飯，右一口赤肉鹹圓仔湯，飽腹之後再來點綠豆湯、冷凍豆花，已覺心滿意足。至於保證吃得到的美食，還有新莊路上武聖廟旁的香菇赤肉羹。別看小店的坪數不大，卻是三代相傳的老店，口感紮實的肉羹堅持以整塊的素肉為材料，外層沾些蕃薯粉增添滑嫩感，肉羹咬在口中保有絕對的彈性與咬勁，令人百吃不膩。  此外，同樣位在新莊路上的蝦仁羹，以及紅燒麵、滷味，都各自有擁有死忠的擁護者，老闆的手藝也都是經過千錘百鍊的考驗，不怕貨比貨。另外特別值得一提的是，此外，就跟許多與廟宇相隨的夜市一般，新莊夜市中的慈祐宮與武聖廟，也都具有數百年的歷史，是國家認證的三級古蹟，它不但庇佑了老街小吃攤販的生計，更見證了新莊的百年興衰，逛夜市之餘不妨順道捻柱香，祈求闔家平安，諸事大吉。', 3.8, '16:00:00', '23:59:59', 'Sunny'),
(382, 4, '西盛夜市', '新北市新莊區西盛街', '無', '僅週五開業', 4, '17:00:00', '23:00:00', 'Sunny'),
(383, 4, '蘆洲廟口夜市', '新北市蘆洲區湧蓮寺附近，成功路中山二路口至忠孝路口-得勝街上', '無', '切仔麵', 4, '15:00:00', '23:00:00', 'Sunny'),
(384, 4, '淡水英專夜市', '新北市淡水區英專路', '無', '正宗牛肉店、老三水煎包、龍門東山鴨頭、稻草人香雞排、ㄙㄨㄚˋ嘴鹽水雞、營養沙拉船、半坪屋50年老牌糯米腸、淡水滬尾豆花店、胡記青蛙撞奶。', 3.9, '18:00:00', '22:30:00', 'Sunny'),
(385, 4, '淡水沙崙夜市', '新北市淡水區沙崙路201巷', '無', '五、日營業', 3.7, '17:15:00', '23:30:00', 'Sunny'),
(386, 4, '集應廟夜市', '新北市淡水區登輝大道上，淡金路三段義山社區集應廟內', '無', '三、日營業', 4, '18:00:00', '22:00:00', 'Sunny'),
(387, 4, '三芝夜市', '新北市三芝區淡金路二段93號', '無', '四、六營業', 3.8, '18:00:00', '23:00:00', 'Sunny'),
(388, 4, '南雅夜市', '新北市鶯歌區國光街6號', '無', '鶯歌區的南雅夜市，離陶瓷老街及火車站都不算遠，在遊玩鶯歌半日之後進入黃昏，剛好可以到夜市裡吃晚餐，夜市路標就在電信局大門口對面。夜市裡有一家開了三十年以上的水煎包，堅持皮薄餡實在而美味的特色水煎包，餡料裡的豬肉，也是老闆精挑細選，使用山上的黑豬肉，與堅持選用帶有油脂的三層肉，意外發展出這滷肉水煎包的特色。水煎包攤沒有店名，別忘了仔細搜食。許多美食節目都曾介紹採訪，是值得推薦給大家的鶯歌美食！   『南雅夜市搖搖冰』雖然時代變遷，但仍保有其三十年來精心獨特的口味，雖然成本比較高，但為讓消費者喝的安心，堅持全程使用天然水果與逆滲透純水製作，水果現場壓搾，絕對新鮮。保有古早味又健康無負擔的搖搖冰，別忘了暢飲一夏喔!', 3.7, '15:00:00', '23:59:59', 'Sunny'),
(389, 4, '林口夜市', '新北市林口區中山路近佳林路一帶', '無', '木瓜牛奶、麻油雞油飯、QQ球、烤魷魚、牛排\r\n三、六營業', 3.9, '18:00:00', '23:59:59', 'Sunny'),
(390, 4, '八里渡老街', '新北市八里區渡船頭街', '無', '交通便捷的八里，可以從淡水搭渡船，也可以沿淡水河岸騎腳踏車抵達，大片的綠地、露天咖啡座和造形獨特的博物館，讓八里脫胎換骨，搖身成為新北市的休閒新左岸。  在改造工程之後，老街的面貌也不同於以往，原本雜亂無章的街道，重新鋪石整建後蛻變為整齊的畫面，紅瓦白牆的小店家則襯出臺灣鄉村渡口的奇特風味，餐廳和小吃也顯得更加有魅力了，鹹蛋、胡椒餅、雙胞胎、蝦捲、吻仔魚、炸花枝丸等讓，你一上岸就可以大快朵頤。   在近年重新整頓下，「八里老街」不僅有了大片綠地、露天咖啡座，還有了造型獨特的博物館，蛻變成有法國文藝氣息和台灣原味的景點。這裡最有名的特產是「孔雀蛤(又稱淡菜)」，在料理師傅的巧手下變化出一道道料理，香氣逼人味道鮮美。其他像是宋記油心鹹蛋、姐妹雙胞胎、胡椒餅、蝦捲、枝仔冰、吻仔魚、魚丸、炸花枝丸、黑糖麻糬等，也都是在地老字號值得一試的好滋味。 ', 4, '11:00:00', '23:00:00', 'Sunny'),
(391, 4, '深坑夜市', '新北市深坑區北深路一段慈聖宮（深美橋旁）對面空地', '無', '二、五營業', 3.7, '18:00:00', '23:00:00', 'Sunny'),
(392, 4, '瑞芳美食街夜市廣場', '新北市瑞芳區民生街35巷2號', '無', '瑞芳美食廣場位於瑞芳火車站正對面，為交通樞紐，鄰近於歷史悠久的瑞芳老街，是遊客們觀光的重要景點。該市場成立已50餘年，從傳統市場轉型為著名的美食街，想吃到最正港的瑞芳小吃，來這裡準沒錯！市場內各類特色美食應有盡有，香氣十足口感酥脆的福州胡椒餅、堅持用黑毛溫體豬製成又大又美味的肉羹麵、特選大塊半肉半筋燉煮鮮濃的牛肉麵、用鮮肥飽滿的蚵仔搭配新鮮蔬菜做的蚵仔煎…等，都令消費者流連忘返。', 4, '10:30:00', '21:00:00', 'Sunny'),
(393, 4, '瑞芳老街', '新北市瑞芳區瑞芳街', '無', '從瑞芳火車站三號出口出來後，即可到達瑞芳老街，這裡可以看到一些著名的古厝，如清朝廖厝(廖建芳商行)遺址、林牙醫診所日式分駐所遺址及義方商行；往岳王路走通過瑞濱古道可到鹿仔寮山及秀崎山，喜歡登山的朋友可以到這邊走走；老街上還有許多不可錯過的美食，如保雲芋圓、碳烤三明治及天然手作冰淇淋等。', 3.7, '00:00:00', '23:59:59', 'Sunny'),
(394, 4, '汐止觀光夜市', '新北市汐止區鐵路高架橋下（黃昏市場末）', '無', '汐止觀光夜市通風明亮，靠近交通便利且人潮眾多的汐止火車站，且觀光夜市旁緊鄰汐止黃昏市場，讓傍晚至市場採買的消費者，可順道至觀光夜市逛逛享受美食。其中有菜色鮮美的灶飯食堂 、平價的剉冰女王、大嫂健康飲料，以及強調健康養生的統神滷味…等，許多深藏不露的小吃，等著你嚐嚐哦！', 3.6, '17:00:00', '23:30:00', 'Sunny'),
(395, 4, '汐止弘道街夜市', '新北市汐止區弘道街10號（南港水廠後面停車場）', '無', '碳烤、滷味、脆腸、烤玉米\n二、五17:00-23:00、日一全天營業', 3.6, '17:00:00', '23:59:59', 'Sunny'),
(396, 4, '汐止樟樹夜市', '新北市汐止區樟樹二路樟樹國中旁', '無', '三、六、日營業', 3.5, '17:00:00', '23:00:00', 'Sunny'),
(397, 5, '臺北市立動物園', '台北市文山區新光路二段30號', '02 2938 2300#630', '生命會以各種不同的形態出現 可能是大象、是麻雀、是人、是蝶\n逛動物園不只是找尋快樂、探索知識 還要知道 人類不是地球的主人\n這座碑用來禮讚生命 用來紀念所有曾在動物園裏逝去的生命\n也用來讓我們 想一想 在我們分分秒秒流逝的生命裏\n是否曾經 給過自己掌聲 給過他人溫暖\n給過其他生命一點疼惜 給過承載我們的地球一絲絲的感恩\n溫馨．和諧．臺北動物園 地球美麗因為她有生命\n動物園溫馨因為她展示生命 我們的心靈和諧因為尊重生命', 4.5, '09:00:00', '17:00:00', 'Sunny'),
(398, 4, '迪化街', '台北市大同區迪化街一段', '無', '這兒是大稻埕的一部份，見證了臺灣國際貿易與商業的發展史。大稻埕的貿易活動從清末到日據初期，以南北雜貨、茶行為主，光復後則為南北貨、中藥和布匹批發商集中地，至今迪化街仍大致維持原貌，沒有太大改變。\n每當年節來臨，這裡總是摩肩擦踵、人潮絡繹不絕。2008年政府預計將迪化商圈擴大，納入民生西路和南京西路沿線至市民大道、以及寧夏夜市與後火車站附近，讓商家及商品更加多元化，今後要辦年貨，將能有更多的選擇。', 4.2, '00:00:00', '23:59:59', 'Sunny'),
(399, 4, '艋舺老街', '台北市萬華區貴陽街二段', '無', '順著龍山寺沿著廣州街來到康定路口，一座紅磚式的拱形騎樓呈現在眼前，這裡就是艋舺電影主要的拍攝場景「剝皮寮」，電影中geta的家、太子幫基地、許多街道一景都是在此拍攝。  剝皮寮保存著清代典雅樸實的傳統街廓，也是台北唯一一條清代街道，剝皮寮紅色磚牆，外頭的牌坊上有著精美的雕花與姓氏的泥塑、充滿傳統的亭仔腳拱形騎樓與樸實紋理的老街，一再流露出剝皮寮的典雅美。', 3.9, '00:00:00', '23:59:59', 'Sunny'),
(400, 2, '臺北市兒童新樂園', '台北市士林區承德路五段55號', '02 2833 3823#105', '臺北市立兒童新樂園(以下簡稱兒童新樂園)前身為位於圓山的臺北市立兒童育樂中心，在95年4月11日兒童育樂中心全園區納入國定遺址範圍，因所處地理位置受航高、文化資產保存法、水利法等諸多限制，於原址進行開發、更新及營運等受到相當大的影響及限制。\n為改善與突破此一侷限，96年10月市府規劃於士林區興建臺北市立兒童新樂園(約5公頃)，與鄰近的臺北市立天文館、國立科學教育館、美崙公園、雙溪水域整體規劃，並將「建構臺北兒童新樂園」納入市政白皮書工作重點，期許打造一座兼具教育、休閒遊憩與文化功能的都會型親子休閒園地，提供市民戶外活動的新選擇。', 4.4, '09:00:00', '17:00:00', 'Sunny'),
(401, 4, '齊東老街', '台北市中正區齊東街', '無', '富有味道的日式老舊宿舍，散步在街頭，彷彿穿越時空到古人所描繪的詩畫裡。在這裡放下心中煩惱，感受與城市交錯的平行時空，優閒的享受不同於以往的自己與下午。', 3.3, '00:00:00', '23:59:59', 'Sunny'),
(402, 4, '淡水老街', '新北市淡水區中正路', '無', '「淡水老街」不僅早已是全台知名熱門景點，同時也吸引不少外國人慕名而來。這裡街道兩旁林立熱鬧商店，有濃濃古早味的餅舖、雜貨店，也有賣潮流服飾、玩具，當然還有最吸引人的人氣美食如阿給、魚丸，另外還有古蹟可參觀，怎麼玩都不會膩。淡水老街分成外側靠淡水河岸的部分(金色水岸步道)與內側的老街，四處可見此區著名的古早味現烤蛋糕、烤魷魚、阿婆鐵蛋、魚酥、巨無霸冰淇淋還有淡水魚丸等等，都是來到此地必吃不可的美食。 ', 4.2, '11:00:00', '20:00:00', 'Sunny'),
(403, 4, '鶯歌陶瓷老街', '新北市鶯歌區尖山埔路', '無', '陶瓷藝術，是東方人的文化瑰寶。從中國到日本、台灣，而鶯歌正是台灣的景德鎮，我們的陶都。這條古街道，早在200年前，就因為尖山埔一帶居民，以具有黏性的田土，加上容易取得的柴薪雜草、煤礦資源，還有不斷發展的水路交通，與日據時期的設窯生產，使得鶯歌窯業從此註定為台灣的陶藝文化，帶來恆遠的影響。鶯歌尖山埔街、育英街與重慶街所形成的街廓，不僅成了名符其實的老街，也曾是李登輝擔任總統期間，設定的三大產業商圈之中，最為成功的一個代表。\n臺灣景德鎮、陶瓷最佳代言詞 ，非鶯歌莫屬。鶯歌老街不論是街景塑造、路口意象的設計或交通指示系統的再設計，都在在凸顯商圈的特有氣息。', 4.1, '00:00:00', '23:59:59', 'Sunny'),
(404, 4, '九份老街', '新北市瑞芳區基山街', '無', '與日本動畫大師宮崎駿電影場景相似的「九份老街」，街道由「三橫一豎」等四條道路為主，被許多階梯圍繞，別具特色。孤懸在山丘上的九份山城，以能鳥瞰基隆嶼山海險峙，霧雨迷濛的美景而聞名。在九份老街可逛逛特色紀念品店，及品嚐在地美食，沿路上充滿懷舊的建築也讓人不禁駐足欣賞，若是想暫時遠離熙嚷的街道，不妨走入九份的茶屋，九份的茶屋各具特色，除了品茗之餘，包括陶瓷茶具的捏製巧思、來自臺灣產地的各式茶葉、茶的烹煮方式與茶道、茶屋的設計與生活美學、精緻茶點餐飲及四季晨晚各異的山城景緻，駐足在此泡上一壺好茶，享受悠閒的時光，欣賞專屬的山城美景。夜晚的九份，商家燈火鼎盛的美麗景象，別有一番風味，不妨在此留宿一晚，感受有別於白日的不夜風情。', 4.1, '00:00:00', '23:59:59', 'Sunny'),
(405, 4, '石碇老街', '新北市石碇區', '無', '石碇老街是石碇地區最早發展的區域，以石砌橋墩所搭成的萬壽橋劃分成東西兩街，西街發展較早，早期以製造及買賣大菁、茶葉為主，房屋以當地石頭為主要建材所建築石頭屋；東街傳說則是乞丐的聚集住所，素有乞丐寮之稱。但目前東街的人口比例漸比西街多，並逐漸取代往日的西街，為石碇區較繁榮的地方。這裡的百年豆腐店、特殊的吊腳樓建築以及不見天街，都是遊客必到的景點。老街裡的百年老鐵舖，叮叮噹噹的打鐵聲，則為老街更添一份古樸的風采。', 3.8, '08:00:00', '17:00:00', 'Sunny'),
(406, 4, '三峽老街', '新北市三峽區民權街37-147號', '無', '走在三峽老街，就好像進入時光隧道，相連不斷的紅磚拱廊、古色古香的建築，令人油然而生思古情懷，留連忘返。三峽老街以民權街、和平街、仁愛街和中山路保存最完整，而民權街是昔日繁華時代的老商業街，至今仍保留完整日治時代以來的商業街屋，許多物資、貨品都在街上交易買賣。於日治時代，市街經過改正，道路也做了一番整頓，成為一條整齊光鮮的現代化街道，新洋樓也競相興起，呈現出三峽的風光歲月。經過時間流逝，如今已經擺脫喧囂，只剩一幢幢的紅磚拱廊建築、巴洛克式立面牌樓，寂靜訴說著昔日商業區街屋的繁華。', 4, '00:00:00', '23:59:59', 'Sunny'),
(407, 4, '坪林老街', '新北市坪林區', '無', '老街的石板屋依舊存在，原有的房屋逐漸被一棟棟的華廈大樓取代，但依舊能在老街巷弄中找尋歷史的繁華痕跡。\n從坪林老街起步向前，先是堪稱百年國校的坪林小學、坪林人的信仰重心－保坪宮，緊接著是坪林地標－新建構的坪林生態園區及藍色拱橋，新舊強烈對比，是今日坪林的最佳寫照。特別的是，老街瀰漫著濃厚的茶香，吸引了許多家燕聞香駐留，周圍住家幾乎皆可見到燕巢，甚至已經超越當地的人口，成為名副其實的家燕都市。\n藍色鮮艷的『坪林拱橋』是坪林街區的藍色地標，為遊客爭相留影之處。拱橋下方的河岸綠地設有親水公園、露天表演台、石桌椅等設施，提供你暫歇悠賞的所在。', 3.8, '00:00:00', '23:59:59', 'Sunny'),
(408, 4, '烏來瀑布老街', '新北市烏來區烏來街18號', '無', '大部分的商店都以原住民特色來發揮，所以遊客可以品嚐到原住民風味的山產美食，像是碳烤山豬肉、溫泉蛋、月桃飯、竹筒飯、馬告料理、山蘇、珠蔥等，都是其他地方少見的原住民風味料理，另外，還有小米酒、小米麻糬等特產，也都很適合分送給親朋好友當伴手禮，同時在這裡也可以觀賞到山地歌舞表演，感受原住民的熱情活力。一說到烏來就想到溫泉，其實在泰雅語就是指冒著蒸氣的湧泉，不管是先來的泰雅人，還是後到的漢人、日本人，都愛上可以養顏美容、改善腸胃疾病的溫泉，老街上頭就林立眾多溫泉旅社。泰雅文化也是老街的旅遊重點，走一趟泰雅民族博物館可以了解族人豐富的編織、建築、信仰文化，還可品嘗老街上眾多原住民美食。若想親近自然風光，不妨搭乘烏來臺車，欣賞體驗沿途山林風光，或是登上高空纜車，近距離欣賞瀑布與山嵐。', 3.9, '00:00:00', '23:59:59', 'Sunny'),
(409, 4, '平溪老街(石底老街)', '新北市平溪區平溪街', '無', '平溪老街不像九份、深坑、鶯歌或是三峽老街那樣，整年無論平日、假日，都能邊逛、邊買、邊吃。有著古樸的風味，沿著斜斜的山坡以及鐵道兩旁，依序建蓋著古厝房舍，附近的商家大都多是傳統柑仔店、五金行、小吃店等，可以看出當地居民簡樸單純的生活情形。\n自從採礦業逐漸沒落後，老街也漸漸沉寂下來。偶爾有兩三隻小狗、小貓經過，或者是當地的老人家在街上緩步徐行、遇到熟人時悠哉悠哉地聊聊天，這就是尋常日子裡的老街風情，充滿著閒情逸致。平溪是離臺北市區不遠的世外桃源，能實踐「慢活、慢慢走」的生活情調。\n每當平溪火車通過老街上方的鐵路時，就會傳來轟隆轟隆的聲響，知名的廣告「張君雅小妹妹」，正是在這條有鐵支路通過的平溪老街上拍攝的。鐵道、山林花鳥與昔日採礦遺跡，都是遊賞的好景點，而日據時期所遺留下來的防空洞與觀音巖的八仙洞，也是遊人探險的好去處。', 4, '00:00:00', '23:00:00', 'Sunny'),
(410, 4, '十分老街', '新北市平溪區十分老街', '無', '一般人看到天燈，就會想到平溪。其實天燈的發源地是十分。回溯平溪礦業史，平溪區的十分，堪稱開發最早，也是規模最大的聚落。主要的特色在於這裡的老街是和火車鐵軌並存相連的，「火車門前過」的獨特鐵道風貌，讓不少歌手MV，以及過去侯孝賢導演的電影「戀戀風塵」，都選在十分車站取景拍攝，就算今天造訪十分老街，也能感受到它熱鬧多元的面貌。雖然煤礦已經停採，但老街上的飲食店、天燈工藝品店仍然生機蓬勃，也由於這裡的地名特殊，商家因此靈機一動推出「十分幸福」的明信片，讓遊客可以寄一張祝福，送給未來的自己。不斷有新血注入，客家花布衣、影像明信片等具有創意的商品，也讓十分老街商圈依舊「生意盎然」。', 4.1, '00:00:00', '23:00:00', 'Sunny'),
(411, 4, '深坑老街', '新北市深坑區深坑街', '無', '深坑，一個距離有點遠又不太遠的遠離市區商圈，是個半日遊的好選擇! 因為清澈的水質以及特殊鹽滷製法所製作的豆腐，其炭味口感吸引了許多饕客，成為一般人熟知的「豆腐故鄉」，也因此造就了老街的繁榮。在這好山好水的孕育以及承襲先人早期篳路藍縷的拓墾精神下，深坑四寶：茶葉、豆腐、竹筍、黑豬肉才能始終保持極佳的品質，成為在地著名的特色產業。\n而商圈周邊其實藏有不少驚奇的體驗。例如列入台灣十大名宅之一的深坑黃宅永安居；擁有原始自然風貌的景觀、茶香與竹林交織的古道，以及特色休閒庭園餐飲所在的阿柔洋。另外，不說你不知道，在老街旁的渡口，更是百年前文山地區的茶葉在景美溪所集散的重要轉運站，也是淡蘭古道以及茶路古道通往大稻埕的驛站。', 3.9, '00:00:00', '23:00:00', 'Sunny'),
(412, 4, '菁桐老街', '新北市平溪區菁桐街', '無', '菁桐位於平溪線的終點站，已有80年歷史的木造站房吸引許多旅客前來拍照打卡，體驗古典優雅韻味在樸質的自然環境中交融的美感。早期的菁桐因煤礦開發相當熱鬧，隨著礦坑停採後人潮逐漸流失，後來因鐵道復古風情重新吸引觀光人潮，甚至是在鐵軌旁的小涼亭，掛滿了旅客的祈願竹筒，成為別具特色的新景點。出口附近的老街商圈也重拾往日繁華，販售起雞捲、礦工食堂等特色美食與在地農特產，重新打造出熱鬧菁桐的新面貌。', 4.1, '00:00:00', '23:00:00', 'Sunny'),
(413, 5, '中正老街(林口舊街)', '新北市林口區中正路133號', '無', '今日中正路舊稱「水返腳街」，曾是基隆河沿岸貨物轉運站，也是汐止開發的源頭，素有「汐止第一街」之稱。過往的輝煌留下許多歷史遺跡，如牛稠頭碼頭、公有市場、農倉、教會、隘門遺址等，亦不乏三代經營的老店，包括米店、布商、藥行、香鋪等。沿街建築部分仍保有長條街屋的傳統風格，是汐止寶貴的文化資產。', 3.8, '00:00:00', '23:00:00', 'Sunny'),
(414, 4, '金山老街(金包里老街)', '新北市金山區金包里街', '無', '金山老街即是金包里老街，清朝時曾是繁華的商業大街，已有三百多年的歷史，是金山最古老的一條街。位於金山老街尾端廣安宮前的鴨肉小吃攤，獨步全臺，人氣十足，老街各式特色小吃如卜肉、蚵仔酥、芋餅與烤紅心蕃薯等都相當有名，必買伴手禮有一口酥、阿玉蔴粩等。這裡仍保有許多過去繁華歷史所留下的痕跡，走一趟老街能重溫過去的興盛風貌，細細品味古早味的老街光景。', 3.8, '09:00:00', '18:00:00', 'Sunny'),
(415, 4, '猴硐老街(猴硐貓村)', '新北市瑞芳區柴寮路70號', '02-24971266', '猴硐貓村102年曾被美國有線電視新聞網(CNN)評選全球六大賞貓景點之一的山城，早年因猴子出沒及煤礦而得名。近年起因於一個愛貓網友的發動，成立了志工隊希望改善村內的環境，讓貓咪有更友善的生活空間，隨著網路資訊的傳播而逐漸聞名，現成為許多愛貓遊客朝聖的地點。新北市政府為了宣導正確餵養貓咪的保育觀念，並活化閒置空間再利用，特地將位於貓村的台鐵舊宿舍翻修打造為貓咪資訊站，並於103年11月開幕，提供民眾正確的動保觀念。', 4.2, '00:00:00', '23:00:00', 'Sunny'),
