(440, 5, '參好', '新北市三重區三民街70號', '02 2989 7373', '營業時間：11:00 – 19:00\r\n低消：每人一佰元 或 一份冰品\r\n備註：不提供訂位\r\n特色；網美聖地、乾燥花、多肉盆栽', 4.4, '11:00:00', '19:00:00', 'Any'),
(441, 5, 'Merci vielle咖啡館', '新北市板橋區府中路50號2樓', '02 8965 3906', '營業時間：13:00 – 22:00（週二休息）\r\n備註：提供付費插座、平日不限時，假日客滿限時兩小時\r\nMERCI VIELLE 是MERCI 團隊的第三間店 VIELLE 在法文中意指老的', 4.5, '13:00:00', '22:00:00', 'Any'),
(442, 5, '貓欸Camulet', '新北市板橋區文化路一段270巷3弄6號', '(02)8258-1127', '營業時間：周二～周五11:00 – 17:00 、 18:00 – 21:00；周六～周日11:00 – 21:00\r\n菜單：咖啡、精釀啤酒、花茶氣泡飲、沙拉、炸物、早午餐、燉飯及義大利麵', 4.6, '11:00:00', '21:00:00', 'Any'),
(443, 5, '框影咖啡永康店', '台北市大安區麗水街2-1號2樓', '02-33221020', '營業時間：11:00~21:00\r\n✓不限時間✓插座網路✓餐點、下午茶、立體貓咪咖啡✓可愛貓咪駐站', 4.4, '11:00:00', '21:00:00', 'Any'),
(444, 5, 'Merci créme', '新北市板橋區漢生東路43巷34號', '0938 819 338', '營業時間：12:00 – 20:00 (周二公休)\r\n消費：每人低消一杯飲品，使用插座需付費、免費網路', 4.5, '12:00:00', '20:00:00', 'Any'),
(445, 5, '藝風巷 Artalley Cafe', '台北市承德路三段90巷2號1樓  (捷運民權西路站)', '(02)2599-4502', '營業時間：10:00~22:00\r\n提供無線網路、有插座\r\n平日開放訂位，無用餐時間限制，假日暫不提供訂位', 4.4, '10:00:00', '22:00:00', 'Any'),
(446, 5, '產出The Food，愛我吧', '台北市大同區赤峰街77巷2號', '無', '營業時間：10：00-18：00\r\n赤峰街有名的早午餐產出The Food第三間店，以提供咖啡、果汁、甜點及帕里尼為主。', 3.3, '10:00:00', '18:00:00', 'Any'),
(447, 5, '2730 cafe 貳柒參零咖啡館 ', '台北市大安區延吉街288號', '(02)2708-8230', '營業時間：10:30~22:30 (週五、週六 10:00~23:00)\r\n特色：✔不限時間 ✔部分座位有插座、低消一杯飲品', 4.6, '10:30:00', '22:30:00', 'Any'),
(448, 5, 'MinouMinou ', '台北市羅斯福路四段138號2樓', '02-2365-6265', '營業時間:週二-週六: 11:00 – 21:00 週日: 11:00 – 20:00\r\n貓奴來！貓咪咖啡廳！', 4.2, '11:00:00', '20:00:00', 'Any'),
(449, 5, '不想上班 只好喝拿鐵', '台北市內湖區江南街116巷2號', '0966 859 605', '營業時間：7:30 – 17:30\r\n#沒有外送', 4.4, '07:30:00', '17:30:00', 'Any'),
(450, 3, '松山文創園區', '台北市信義區光復南路133號', '(02)2765-1388', '肩負帶動台北市原創力、強化文創軟實力且提升城市競爭力為使命的松山文創園區，定位為「台北市原創基地」，2011年正式對外開放，扮演文創「社會企業」角色，規劃「創意實驗室」、「創意合作社」、「創意學院」、「創意櫥窗」、「創作者工廠」五大創新策略領航，藉由「軟實力創新」、「社群網絡連結」、「品牌價值經營」、「人才養成」面向達「臺北市原創基地」目標，培養原創人才及原創力。\r\n\r\n園區規劃豐富的創意展演活動、文創產業諮詢與育成服務、民眾文化與創意美學推廣與服務、古蹟維運管理等多元化展現方式，為臺北最璀璨的文化亮點，更是展現文創力的國際櫥窗。\r\n\r\n做為一個國際型的文創聚落，從扶植原創的精神出發，鼓勵創新性與實驗性。從創業育成到建立品牌，從核心創作到商業運用，從產業進駐到資源連結，提供創作者展現的平台與國際連結的場合，更提供市民看見台北原創力與文創趨勢的平台。從創意激發到產業群聚，打造國際性的文創聚落一直是松山文創園區致力所為的使命與目標。', 4.3, '09:00:00', '18:00:00', 'Any'),
(451, 3, '華山文創園區', '台北市中正區八德路一段1號', '(02)2358-1914', '文創產業的旗艦基地\n為台灣其他城市的文創發展創造經驗。\n\n創意人的江湖\n讓各式各樣的創意在這裡切磋較量，在切磋較量中滙成文化。「華山今論劍，創意起擂台」\n\n文創活動的消費體驗聚落\n讓文創活動的價值，在愉悅的消費體驗中傳遞發散。\n\n一種風景、一所學校、一座舞台、一本大書\n一種風景，可以欣賞；一所學校，可以學習；一座舞台，可以展現成果，揮灑能量；一本大書，紀錄下我們從過去到未來的努力軌跡。', 4.5, '09:30:00', '21:00:00', 'Any'),
(452, 1, '台北', '有路就可以', '無', '整個大台北地區你愛怎麼騎就怎麼騎，隨心所欲的來一趟旅程吧！\r\n※騎車不喝酒，喝酒不騎車', 4, '00:00:00', '23:59:59', 'Sunny'),
(453, 1, '你家附近球場', '你家附近球場', '無', '找幾個久未碰面的朋友打球運動……你要自己打也可以啊！', 4, '00:00:00', '23:59:59', 'Sunny'),
(454, 1, '你家附近操場', '你家附近操場', '無', '看看身上的肉……去跑個步吧！\r\n揪家人或朋友一起運動完再去大吃一頓(？)', 4, '00:00:00', '23:59:59', 'Sunny'),
(455, 1, '勤奮的在家裡', '你家', '你家電話', '都沒事了就該來動一下啊，看看你身上的肉……啊不是，總是該流點汗嘛～', 4, '00:00:00', '23:59:59', 'Any'),
(456, 5, '懶懶的在家裡', '你家', '你家電話', '懶懶地做一些懶懶的事，放鬆在家裡最適合沉浸在自己的世界裡了。', 4, '00:00:00', '23:59:59', 'Any'),
(457, 1, '隨時隨地', '大馬路以外', '無', '天下無難事，只怕有心人，要活就要動！\r\n隨意去附近走走逛逛也不失為一種樂趣。', 4, '00:00:00', '23:59:59', 'Any'),
(458, 5, '悠閒的找個地方', '哪裡都行', '無', '找一個舒適的位子，陪伴著明亮的光線，手邊一杯能使心情愉悅加倍的飲品，悠閒，悠閒，莫過於此。', 4, '00:00:00', '23:59:59', 'Any'),
(459, 3, '隨意的找個地方', '哪裡都行', '無', '煩躁時放慢步調理清思緒，激動時靜下心來沉澱心靈，無事時慢慢思考隨心所欲，偶爾也要活在自己的小宇宙裡！', 4, '00:00:00', '23:59:59', 'Any'),
(460, 3, '悠閒的在家裡', '你家', '無', '悠閒能讓心靈充足，讓心境開闊，讓心情愉悅。\r\n\r\n就算生活再忙、工作再累、讀書再辛苦，悠閒的生活方式是必不可缺的！', 4, '00:00:00', '23:59:59', 'Any');
